INSERT OR IGNORE INTO `unit_enemy_data` VALUES (206901, "スリーピィオウル", 206901, 0, 0, 270, 645, 2, 3.5, 0, 0, 0, "【魔法】中距離攻撃\n寝不足で気怠げなフクロウの魔物。\n敵を睨み術をかけ、動きを奪う。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (207000, "ワッパダヌキ", 207000, 0, 0, 100, 120, 2, 0.5, 0, 0, 0, "【魔法】一定時間無敵・中距離攻撃\n幼いながらも巧みな変化で\n攻守を必死にこなす豆狸の魔物。");
