INSERT OR IGNORE INTO `unit_enemy_data` VALUES (207100, "キラービー", 207100, 0, 0, 270, 550, 1, 0.9, 0, 0, 0, "【物理】遠距離攻撃\n脅威となる敵をいち早く察知し、\n的確に狙い穿つハチの魔物。");
