INSERT OR IGNORE INTO `unit_enemy_data` VALUES (211001, "エリコのシャドウ", 211001, 0, 3, 450, 260, 1, 1.425, 0, 0, 0, "エリコの姿をした特殊な魔物\n\n・目の前の敵１キャラに物理特大ダメージを\n　与え、さらにこのスキルで敵を倒した場合、\n　自分の物理攻撃力を大アップさせる。\n・自分の物理攻撃力を小アップさせる。\n・目の前の敵１キャラに物理中ダメージ\n　を与え、さらに毒状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (211101, "シズルのシャドウ", 211101, 0, 5, 450, 150, 1, 2.375, 0, 0, 0, "シズルの姿をした特殊な魔物\n\n・目の前の敵１キャラに物理大ダメージを与え、\n　さらに自分に物理吸収バリアを展開する。\n・最もＨＰが低い味方１キャラのＨＰを中回復\n　させる。\n・自分の周りの味方に物理無効バリアを\n　展開する。");
