INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300100, "ミノタウロス", 300100, 0, 3, 270, 1000, 1, 1.9, 0, 0, 0, "【物理】さらなる力を得た牡牛座の魔星獣。\n力の限界を超えた戦斧の一撃が全てを破砕する。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　ミノタウロスの物理攻撃力に応じた物理割合ダ\n　メージを与える。\n　さらに火傷状態を付与し、ＴＰを中ダウン。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・最も魔法攻撃力の高い敵１キャラに物理大ダ\n　メージを与え、ノックバックさせると同時にス\n　タンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から３キャラに魔法中ダメージを与え、麻痺\n　させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300101, "ミノタウロス", 300101, 0, 3, 270, 1000, 1, 1.9, 0, 0, 0, "【物理】さらなる力を得た牡牛座の魔星獣。\n力の限界を超えた戦斧の一撃が全てを破砕する。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　ミノタウロスの物理攻撃力に応じた物理割合ダ\n　メージを与える。\n　さらに火傷状態を付与し、ＴＰを中ダウン。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・最も魔法攻撃力の高い敵１キャラに物理大ダ\n　メージを与え、ノックバックさせると同時にス\n　タンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から３キャラに魔法中ダメージを与え、麻痺\n　させる。\n・自身の物理攻撃力を中アップ、魔法攻撃力を大\n　アップさせ、前から１番目と２番目のキャラに\n　物理大ダメージ。\n　スキル発動後、自身の物理防御力を小ダウン、\n　魔法防御力を中ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300102, "ミノタウロス", 300102, 0, 3, 270, 1000, 1, 1.9, 0, 0, 0, "【物理】さらなる力を得た牡牛座の魔星獣。\n力の限界を超えた戦斧の一撃が全てを破砕する。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　ミノタウロスの物理攻撃力に応じた物理割合ダ\n　メージを与える。\n　さらに火傷状態を付与し、ＴＰを中ダウン。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・最も魔法攻撃力の高い敵１キャラに物理大ダ\n　メージを与え、ノックバックさせると同時にス\n　タンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から３キャラに魔法中ダメージを与え、麻痺\n　させる。\n・自身の物理攻撃力を中アップ、魔法攻撃力を大\n　アップさせ、前から１番目と２番目のキャラに\n　物理大ダメージ。\n　スキル発動後、自身の物理防御力を小ダウン、\n　魔法防御力を中ダウン。\n・バトルフィールドを展開する。\n\n【バトルフィールド効果】\nフィールド全体が炎に包まれ、以下の効果が発動\nする。\n・挑発を無視して、物理攻撃力、魔法攻撃力いず\n　れかで、最も攻撃力が高い味方１キャラの物理\n　攻撃力と魔法攻撃力を０にする。\n・ミノタウロスの物理防御力と魔法防御力が特大\n　ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300200, "レサトパルト", 300200, 0, 6, 270, 1000, 1, 1.5, 0, 0, 0, "猛毒の尾棘で災厄を振りまく、蠍座の魔星獣。\n砂漠を護る神蟲が、信仰を失い邪神と化した。\n\n・敵全体に物理大ダメージを与える。\n　ボスがユニオンバーストを使用する毎に、\n　敵に与えるダメージがアップ。\n　この効果は、最大３回まで累積する。\n・前方範囲内の敵に物理中ダメージを与え、\n　毒状態にする。\n・自身にかかっているステータスダウン効果を\n　解除し、さらに自身の物理防御力をアップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300201, "レサトパルト", 300201, 0, 6, 270, 1000, 1, 1.5, 0, 0, 0, "【物理】信仰を失った神殿に遺る、蠍座の魔星獣。\n過去に受けた敬虔な祈りも忘れ、破滅をもたらす。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に物理中ダメージ\n　を与える。\n　このスキルを使用した後、敵を攻撃するたび、\n　以降その敵にレサトパルトが与えるダメージが\n　アップする。\n　この効果は最大３回まで累積する。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・前方１キャラを中心にした小範囲に物理中ダ\n　メージを与え、毒状態にする。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。\n・自身の物理攻撃力、物理防御力、魔法防御力を\n　中アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300202, "レサトパルト", 300202, 0, 6, 270, 1000, 1, 1.5, 0, 0, 0, "【物理】信仰を失った神殿に遺る、蠍座の魔星獣。\n過去に受けた敬虔な祈りも忘れ、破滅をもたらす。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に物理中ダメージ\n　を与える。\n　このスキルを使用した後、敵を攻撃するたび、\n　以降その敵にレサトパルトが与えるダメージが\n　アップする。\n　この効果は最大３回まで累積する。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・前方１キャラを中心にした小範囲に物理中ダ\n　メージを与え、毒状態にする。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。\n・自身の物理攻撃力、物理防御力、魔法防御力を\n　中アップ。\n・レサトガードを１体召喚する。\n　召喚時、すでに召喚されているレサトガードを\n　１秒間無敵状態にする。\n・３体目のレサトガードが召喚された時、敵全体\n　にキャラの最大ＨＰに応じた魔法割合ダメージ\n　を与え、さらにスタンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・レサトガードのＨＰが一定値以下になった時、\n　レサトパルトに魔法固定ダメージを与え、さら\n　に物理攻撃力を中ダウンし、消滅する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300203, "レサトパルト", 300203, 0, 6, 270, 1000, 1, 1.5, 0, 0, 0, "【物理】信仰を失った神殿に遺る、蠍座の魔星獣。\n過去に受けた敬虔な祈りも忘れ、破滅をもたらす。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に物理中ダメージ\n　を与える。\n　このスキルを使用した後、敵を攻撃するたび、\n　以降その敵にレサトパルトが与えるダメージが\n　アップする。\n　この効果は最大３回まで累積する。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・前方１キャラを中心にした小範囲に物理中ダ\n　メージを与え、毒状態にする。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。\n・自身の物理攻撃力、物理防御力、魔法防御力を\n　中アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300204, "レサトパルト", 300204, 0, 6, 270, 1000, 1, 1.5, 0, 0, 0, "【物理】信仰を失った神殿に遺る、蠍座の魔星獣。\n過去に受けた敬虔な祈りも忘れ、破滅をもたらす。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に物理中ダメージ\n　を与える。\n　このスキルを使用した後、敵を攻撃するたび、\n　以降その敵にレサトパルトが与えるダメージが\n　アップする。\n　この効果は最大３回まで累積する。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・前方１キャラを中心にした小範囲に物理中ダ\n　メージを与え、毒状態にする。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。\n・自身の物理攻撃力、物理防御力、魔法防御力を\n　中アップ。\n・レサトガードを１体召喚する。\n　召喚時、すでに召喚されているレサトガードを\n　１秒間無敵状態にする。\n・３体目のレサトガードが召喚された時、敵全体\n　にキャラの最大ＨＰに応じた魔法割合ダメージ\n　を与え、さらにスタンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・レサトガードのＨＰが一定値以下になった時、\n　レサトパルトに魔法固定ダメージを与え、さら\n　に物理攻撃力を中ダウンし、消滅する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300205, "レサトパルト", 300205, 0, 6, 270, 1000, 1, 1.5, 0, 0, 0, "【物理】信仰を失った神殿に遺る、蠍座の魔星獣。\n過去に受けた敬虔な祈りも忘れ、破滅をもたらす。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に物理中ダメージ\n　を与える。\n　このスキルを使用した後、敵を攻撃するたび、\n　以降その敵にレサトパルトが与えるダメージが\n　アップする。\n　この効果は最大３回まで累積する。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・前方１キャラを中心にした小範囲に物理中ダ\n　メージを与え、毒状態にする。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。\n・自身の物理攻撃力、物理防御力、魔法防御力を\n　中アップ。\n・レサトガードを１体召喚する。\n　召喚時、すでに召喚されているレサトガードを\n　１秒間無敵状態にする。\n・３体目のレサトガードが召喚された時、敵全体\n　にキャラの最大ＨＰに応じた魔法割合ダメージ\n　を与え、さらにスタンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・レサトガードは、敵全体にキャラの最大ＨＰに\n　応じた魔法割合ダメージを与え、さらにスタン\n　させる。\n・レサトガードは、レサトパルトの物理防御力と\n　魔法防御力を中アップさせる。\n・レサトガードのＨＰが一定値以下になった時、\n　レサトパルトに魔法固定ダメージを与え、さら\n　に物理攻撃力を中ダウンし、消滅する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300206, "レサトパルト", 300206, 0, 6, 270, 1000, 1, 1.5, 0, 0, 0, "【物理】信仰を失った神殿に遺る、蠍座の魔星獣。\n過去に受けた敬虔な祈りも忘れ、破滅をもたらす。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に物理中ダメージ\n　を与える。\n　このスキルを使用した後、敵を攻撃するたび、\n　以降その敵にレサトパルトが与えるダメージが\n　アップする。\n　この効果は最大３回まで累積する。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・前方１キャラを中心にした小範囲に物理中ダ\n　メージを与え、毒状態にする。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。\n・自身の物理攻撃力、物理防御力、魔法防御力を\n　中アップ。\n・レサトガードを１体召喚する。\n　召喚時、すでに召喚されているレサトガードを\n　１秒間無敵状態にする。\n・３体目のレサトガードが召喚された時、敵全体\n　にキャラの最大ＨＰに応じた魔法割合ダメージ\n　を与え、さらにスタンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・レサトガードは、敵全体にキャラの最大ＨＰに\n　応じた魔法割合ダメージを与え、さらにスタン\n　させる。\n・レサトガードは、レサトパルトの物理防御力と\n　魔法防御力を中アップさせる。\n・レサトガードのＨＰが一定値以下になった時、\n　レサトパルトに魔法固定ダメージを与え、さら\n　に物理攻撃力を中ダウンし、消滅する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300300, "メサルティム", 300300, 0, 7, 270, 1000, 2, 2.5, 0, 0, 0, "【魔法】さらなる力を得た牡羊座の魔星獣。\n鬱々たる眠りの牢獄で冒険者の魂を貪り尽くす。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　行動不能状態のキャラには追加の魔法割合ダメ\n　ージを与える。\n・前方範囲内の敵に魔法中ダメージ。\n・残りＨＰが最も低い１キャラを束縛状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300301, "メサルティム", 300301, 0, 7, 270, 1000, 2, 2.5, 0, 0, 0, "【魔法】さらなる力を得た牡羊座の魔星獣。\n鬱々たる眠りの牢獄で冒険者の魂を貪り尽くす。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　行動不能状態のキャラには追加の魔法割合ダメ\n　ージを与える。\n・前方範囲内の敵に魔法中ダメージ。\n・残りＨＰが最も低い１キャラを束縛状態にする。\n・敵全体に魔法小ダメージ。\n　キャラのＨＰが70％未満の場合、束縛状態に\n　する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300302, "メサルティム", 300302, 0, 7, 270, 1000, 2, 2.5, 0, 0, 0, "【魔法】さらなる力を得た牡羊座の魔星獣。\n鬱々たる眠りの牢獄で冒険者の魂を貪り尽くす。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　行動不能状態のキャラには追加の魔法割合ダメ\n　ージを与え、さらにＴＰを大ダウン。\n・前方範囲内の敵に魔法中ダメージ。\n・残りＨＰが最も低い１キャラを束縛状態にする。\n・敵全体に魔法小ダメージ。\n　キャラのＨＰが70％未満の場合、束縛状態に\n　する。\n・最も魔法攻撃力が高い２キャラを束縛状態にし、\n　自身の物理防御力と魔法防御力を小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300400, "アルゲティ", 300400, 0, 7, 270, 1000, 2, 1.8, 0, 0, 0, "妖しき邪教で世界支配を謀る、山羊座の魔星獣。\n沙漠に迷う人間を誘い、悪魔の儀式で虜とする。\n\n・ユニオンバーストは敵全体に魔法大ダメ―ジ\n　さらに物理攻撃キャラは物理攻撃力をダウン\n　魔法攻撃キャラは魔法防御力をダウン。\n・最も物理攻撃力の高い1キャラに魔法特大ダ\n　メージを与え、さらにＴＰダウン。\n・前方の2キャラに魔法小ダメージを与え沈黙\n　状態を付与する。\n　さらに敵全体に魔法中ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300401, "アルゲティ", 300401, 0, 7, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】邪教の秘術を極めし、山羊座の魔星獣。\n膨大な魔力を自在に操り、全ての自由を剥奪する。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・アルゲティから受けるすべてのダメージで発生\n　する、パーティキャラのＴＰ回復量を中ダウン\n　させる。\n・ユニオンバーストは、敵全体に物理攻撃キャラ\n　は物理攻撃力を大ダウン、魔法攻撃キャラは魔\n　法攻撃力を大ダウンを付与する。\n・前から１キャラに魔法大ダメージを与え、沈黙\n　状態を付与する。\n　さらに敵全体に魔法中ダメージ。\n・最も物理攻撃力の高い１キャラに魔法大ダメー\n　ジを与え、さらにＴＰを大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300402, "アルゲティ", 300402, 0, 7, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】邪教の秘術を極めし、山羊座の魔星獣。\n膨大な魔力を自在に操り、全ての自由を剥奪する。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・アルゲティから受けるすべてのダメージで発生\n　する、パーティキャラのＴＰ回復量を中ダウン\n　させる。\n・ユニオンバーストは、敵全体に物理攻撃キャラ\n　は物理攻撃力を大ダウン、魔法攻撃キャラは魔\n　法攻撃力を大ダウンを付与する。\n・前から１キャラに魔法大ダメージを与え、沈黙\n　状態を付与する。\n　さらに敵全体に魔法中ダメージ。\n・最も物理攻撃力の高い１キャラに魔法大ダメー\n　ジを与え、さらにＴＰを大ダウン。\n・敵全体に魔法大ダメージ。\n　キャラのＨＰが80%未満の場合、沈黙状態を\n　付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300403, "アルゲティ", 300403, 0, 7, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】邪教の秘術を極めし、山羊座の魔星獣。\n膨大な魔力を自在に操り、全ての自由を剥奪する。\n\n・ユニオンバーストは敵全体に魔法大ダメージ\n　さらに物理攻撃キャラは物理攻撃力をダウン\n　魔法攻撃キャラは魔法攻撃力をダウン。\n・前から１キャラに魔法特大ダメージを与え沈黙\n　状態を付与する。\n　さらに敵全体に魔法中ダメージ。\n・最も物理攻撃力の高い１キャラに\n　魔法大ダメージを与え、さらにＴＰダウン。\n・アルゲティが毒、猛毒、呪い、火傷の\n　効果を受けていると、自身に沈黙状態を\n　付与し、さらに魔法大ダメージを与える。\n　効果を受けていない場合、敵全体に\n　沈黙状態を付与し、\n　さらに魔法大ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300404, "アルゲティ", 300404, 0, 7, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】邪教の秘術を極めし、山羊座の魔星獣。\n膨大な魔力を自在に操り、全ての自由を剥奪する。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を中アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・アルゲティから受けるすべてのダメージで発生\n　する、パーティキャラのＴＰ回復量を中ダウン\n　させる。\n・ユニオンバーストは、敵全体に物理攻撃キャラ\n　は物理攻撃力を大ダウン、魔法攻撃キャラは魔\n　法攻撃力を大ダウンを付与する。\n・前から１キャラに魔法大ダメージを与え、沈黙\n　状態を付与する。\n　さらに敵全体に魔法大ダメージ。\n・最も物理攻撃力の高い１キャラに魔法大ダメー\n　ジを与え、さらにＴＰを大ダウン。\n・敵全体に魔法大ダメージ。\n　キャラのＨＰが80%未満の場合、沈黙状態を\n　付与し、スタンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300500, "リザードマン", 300500, 0, 4, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】二刀を自在に操り、\n煙幕弾で相手の目を\nくらませる\nオオトカゲの戦士。\n\n・ランダムな1キャラに物理\n　中ダメージを与える。\n\n・ランダムな敵を中心にした小範囲\n　に、物理小ダメージを与え、\n　暗闇状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300600, "クリーパー", 300600, 0, 2, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】頭から放つ毒攻撃と\nツタによる範囲物理攻撃で\n近づく冒険者の体力を一気に奪う\n悪魔の花。\n\n・前方2キャラに物理中ダメージ\n　を与える。\n\n・前方3キャラの物理防御力を\n　下げ、毒状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300601, "ニードルクリーパー", 300601, 0, 2, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】特異な力で変質したクリーパー。\n無数のトゲを持つ蔓を巻き付け、動きを奪う。\n\n・前方範囲内の敵に物理中ダメージを与え、\n　拘束状態にする。\n・前方範囲内の敵の物理防御力を下げ、毒\n　状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300602, "ニードルクリーパー", 300602, 0, 2, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】特異な力で変質したクリーパー。\n無数のトゲを持つ蔓を巻き付け、動きを奪う。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ニードルクリーパーから受けるすべてのダメー\n　ジで発生する、パーティキャラのＴＰ回復量を\n　中ダウンさせる。\n・ユニオンバーストは、前方２キャラに物理中ダ\n　メージを与え、拘束状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方３キャラの物理防御力を中ダウンし、毒状\n　態を付与する。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300603, "ニードルクリーパー", 300603, 0, 2, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】特異な力で変質したクリーパー。\n無数のトゲを持つ蔓を巻き付け、動きを奪う。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ニードルクリーパーから受けるすべてのダメー\n　ジで発生する、パーティキャラのＴＰ回復量を\n　中ダウンさせる。\n・ユニオンバーストは、前方２キャラに物理中ダ\n　メージを与え、拘束状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方３キャラの物理防御力を中ダウンし、毒状\n　態を付与する。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300604, "サンドクリーパー", 300604, 0, 2, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】広大な砂海に棲む巨大な\n食人植物の魔物。凶悪なトゲの蔓\nで動きを封じ、冒険者を捕食する。\n\n・ユニオンバーストは、前から２\n　キャラに物理中ダメージを与え、\n　拘束状態にする。\n\n・前から３キャラの敵の物理防御\n　力を下げ、毒状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300700, "オークリーダー", 300700, 0, 13, 270, 1000, 1, 1.5, 0, 0, 0, "【物理】族長として群れを鼓舞し\n大地を砕くほどの連撃で\n敵に大ダメージを与える\nオーク中のオーク。\n\n・ランダムな3キャラに\n　物理中ダメージを与える。\n\n・味方全体の物理攻撃力を上げる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300701, "オークチーフ", 300701, 0, 13, 270, 1000, 1, 1.5, 0, 0, 0, "【物理】特異な力で変質したオークリーダー。\n巨大な盾で、攻防一体の一撃を繰り出す。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、前方３キャラに物理大ダ\n　メージを与え、さらにスタンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方２キャラの物理防御力を大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300702, "オークチーフ", 300702, 0, 13, 270, 1000, 1, 1.5, 0, 0, 0, "【物理】特異な力で変質したオークリーダー。\n巨大な盾で、攻防一体の一撃を繰り出す。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、前方３キャラに物理大ダ\n　メージを与え、さらにスタンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方２キャラの物理防御力を大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300800, "エルダーホーン", 300800, 0, 1, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ひとたび暴れ出せば\n手が付けられず、その嘶きは\n天まで届くと言われる\n伝説のワイルドホーン。\n\n・敵全体に物理中ダメージを与え、\n　小さく引き寄せる。\n\n・前方3キャラに物理中ダメージを\n　与え、物理攻撃力と\n　物理防御力を下げる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300801, "スピリットホーン", 300801, 0, 1, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】特異な力で変質したエルダーホーン。\n角に魔力を込め、打撃より強力な一撃を放つ。\n\n・前方３キャラに魔法大ダメージを与え、ノック\n　バックさせると同時にスタンさせる。\n・前方３キャラに魔法小ダメージを与え、魔法防\n　御力と行動速度を大ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300802, "スピリットホーン", 300802, 0, 1, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】特異な力で変質したエルダーホーン。\n角に魔力を込め、打撃より強力な一撃を放つ。\n\n・前方３キャラに魔法大ダメージを与え、ノック\n　バックさせると同時にスタンさせる。\n　さらに、自身に物理/魔法無効バリアを展開す\n　る。\n・前方３キャラに魔法小ダメージを与え、魔法防\n　御力と行動速度を大ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (300900, "エルダータイラント", 300900, 0, 13, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】岩山の如く進化した、大いなる老亀。\n強力無比な頭突きは、大地を容易く砕き割る。\n\n・ユニオンバーストは前方範囲内に物理ダメージ\n　を与え、さらに麻痺状態にする。\n・前方3キャラに物理防御力ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301000, "シードレイク", 301000, 0, 14, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】強力な氷のブレスで\n前衛を一瞬で氷漬けにし、\n咬みついて身体を砕く\n獰猛な深海竜。\n\n・前方3キャラに物理中ダメージを\n　与える。\n\n・前方2キャラに物理中ダメージを\n　与え、凍結状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301001, "シードレイク", 301001, 0, 14, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】強力な氷のブレスで前衛を一瞬で\n氷漬けにし、咬みついて身体を砕く獰猛な深海竜。\n\n・前方３キャラに物理中ダメージを与える。\n・前方１キャラに物理中ダメージを与え、凍結状\n　態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301002, "シードレイク", 301002, 0, 14, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】強力な氷のブレスで前衛を一瞬で\n氷漬けにし、咬みついて身体を砕く獰猛な深海竜。\n\n・前方３キャラに物理中ダメージを与える。\n・前方２キャラに物理中ダメージを与え、凍結状\n　態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301100, "サベージベア", 301100, 0, 13, 270, 1000, 1, 1.7, 0, 0, 0, "【物理】体格にそぐわぬ俊敏さと\n咬みつき攻撃で体力を奪い、\n巨大なツメで敵を引き裂く\n残虐非道な森の支配者。\n\n・前方4キャラに物理大ダメージを\n　与える。\n\n・前方1キャラに物理小ダメージを\n　与え、物理攻撃力を下げる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301101, "マッドベア", 301101, 0, 13, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】特異な力で変質したサベージベア。\n怒りを込めた剛腕は、敵ごと地面を引き裂く。\n\n・前方３キャラに物理大ダメージを与え、さらに\n　スタンさせる。\n・前から１番目の敵を中心にした小範囲の最大３\n　キャラに物理大ダメージを与え、物理攻撃力を\n　特大ダウン、魔法攻撃力を大ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301102, "マッドベア", 301102, 0, 13, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】特異な力で変質したサベージベア。\n怒りを込めた剛腕は、敵ごと地面を引き裂く。\n\n・前方３キャラに物理大ダメージを与え、さらに\n　スタンさせる。\n・前から１番目の敵を中心にした小範囲の最大３\n　キャラに物理大ダメージを与え、物理攻撃力を\n　特大ダウン、魔法攻撃力を大ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301200, "グレーターゴーレム", 301200, 0, 13, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】際限なくゴーレムを召喚し\n岩の針で体力と精神を同時に削る。\n無数のゴーレムの残骸を\n魔力で再構築した巨大なゴーレム。\n\n・前方4キャラに物理中ダメージを\n　与え、ＴＰを下げる。\n\n・ゴーレムを召喚する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301201, "クリスタルゴーレム", 301201, 0, 13, 270, 1000, 1, 1.3, 0, 0, 0, "【物理】ルナの魔力の結晶でその身を覆う巨大ゴーレム。\n身に纏う結晶は堅牢な盾であり、全てを穿つ矛となる。\n・クリスタルゴーレムが毒、猛毒、呪い、火傷の\n　効果を受けると、行動速度が大ダウンする。\n・自身のデバフ効果をすべて解除し、\n　物理防御力と魔法防御力を大アップする。\n　さらに、自分以外の味方の物理防御力と\n　魔法防御力を中アップさせる。\n・敵全体に物理中ダメージを与え、スタンさせる。\n・前方範囲内の敵に物理大ダメージを与え、\n　味方全体の物理攻撃力と魔法攻撃力を\n　小アップさせる。\n　さらに、自身のＴＰを中回復する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301202, "アイスゴーレム", 301202, 0, 13, 270, 1000, 1, 1.3, 0, 0, 0, "【物理】凍てつく大地の洞窟に\n潜む巨大ゴーレム。身に纏う\n結晶は堅牢な盾にも矛にもなる。\n\n・アイスゴーレムが毒、猛毒、呪\n　い、火傷の効果を受けると、行\n　動速度が大ダウンする。\n\n・自身のデバフ効果をすべて解除\n　し、物理防御力と魔法防御力を\n　中アップする。\n\n・敵全体に物理中ダメージを与え\n　る。\n\n・前方範囲内の敵に物理大ダメー\n　ジを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301203, "アイスゴーレム", 301202, 0, 13, 270, 1000, 1, 1.3, 0, 0, 0, "【物理】凍てつく大地の洞窟に\n潜む巨大ゴーレム。身に纏う\n結晶は堅牢な盾にも矛にもなる。\n\n・アイスゴーレムが毒、猛毒、呪\n　い、火傷の効果を受けると、行\n　動速度が大ダウンする。\n\n・自身のデバフ効果をすべて解除\n　し、物理防御力と魔法防御力を\n　中アップする。\n\n・敵全体に物理中ダメージを与え\n　る。\n\n・前方範囲内の敵に物理大ダメー\n　ジを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301300, "グラットン", 301300, 0, 4, 270, 1000, 1, 3.0, 0, 0, 0, "暴食の凶獣として悪名轟く、天秤座の魔星獣。\n奪った魂の善悪をはかり、味の違いを愉しむ。\n\n・敵からの攻撃による麻痺、スタン、束縛、\n　行動速度低下効果への耐性を持たない。\n・敵全体に魔法大ダメージを与え、さらに自\n　身の物理攻撃力と魔法攻撃力を特大アップ。\n・後方範囲内の敵に魔法中ダメージ。\n・前方範囲内の敵に魔法中ダメージを与え、Ｔ\n　Ｐを小ダウン。さらに自身のＴＰを中アップ\n　させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301301, "グラットン", 301301, 0, 4, 270, 1000, 1, 3.0, 0, 0, 0, "【物理】あらゆる魂を貪る、天秤座の魔星獣。\nその天秤は、厳正とは程遠く暴食獣の食欲に傾く。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、さらに自身の物理攻撃力と魔法攻撃力\n　を大アップ。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・後方の敵２キャラに魔法中ダメージ。\n・前方の敵３キャラに魔法小ダメージを与え、Ｔ\n　Ｐを小ダウン。\n　さらに自身のＴＰを中アップさせる。\n・向かって左側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン。\n・中央のターゲットのブレイク時、魔法攻撃力が\n　特大ダウン。\n・向かって右側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301302, "グラットン", 301302, 0, 4, 270, 1000, 1, 3.0, 0, 0, 0, "【物理】あらゆる魂を貪る、天秤座の魔星獣。\nその天秤は、厳正とは程遠く暴食獣の食欲に傾く。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、さらに自身の物理攻撃力と魔法攻撃力\n　を大アップ。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・後方の敵２キャラに魔法中ダメージ。\n・前方の敵３キャラに魔法小ダメージを与え、Ｔ\n　Ｐを小ダウン。\n　さらに自身のＴＰを中アップさせる。\n・前方の敵３キャラを束縛状態にし、魔法大ダ\n　メージを与える。\n　自身のターゲットがブレイクしている場合、自\n　身の魔法攻撃力を特大アップ。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・向かって左側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン。\n・中央のターゲットのブレイク時、魔法攻撃力が\n　特大ダウン。\n・向かって右側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301303, "グラットン", 301303, 0, 4, 270, 1000, 1, 3.0, 0, 0, 0, "【物理】あらゆる魂を貪る、天秤座の魔星獣。\nその天秤は、厳正とは程遠く暴食獣の食欲に傾く。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、さらに自身の物理攻撃力と魔法攻撃力\n　を大アップ。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・後方の敵２キャラに魔法中ダメージ。\n・前方の敵３キャラに魔法小ダメージを与え、Ｔ\n　Ｐを小ダウン。\n　さらに自身のＴＰを中アップさせる。\n・向かって左側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン。\n・中央のターゲットのブレイク時、魔法攻撃力が\n　特大ダウン。\n・向かって右側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301304, "グラットン", 301304, 0, 4, 270, 1000, 1, 3.0, 0, 0, 0, "【物理】あらゆる魂を貪る、天秤座の魔星獣。\nその天秤は、厳正とは程遠く暴食獣の食欲に傾く。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、さらに自身の物理攻撃力と魔法攻撃力\n　を大アップ。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・後方の敵２キャラに魔法中ダメージ。\n・前方の敵３キャラに魔法小ダメージを与え、Ｔ\n　Ｐを小ダウン。\n　さらに自身のＴＰを中アップさせる。\n・前方の敵３キャラを束縛状態にし、魔法大ダ\n　メージを与える。\n　自身のターゲットがブレイクしている場合、自\n　身の魔法攻撃力を特大アップ。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・向かって左側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン。\n・中央のターゲットのブレイク時、魔法攻撃力が\n　特大ダウン。\n・向かって右側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301305, "グラットン", 301305, 0, 4, 270, 1000, 1, 3.0, 0, 0, 0, "【物理】あらゆる魂を貪る、天秤座の魔星獣。\nその天秤は、厳正とは程遠く暴食獣の食欲に傾く。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、さらに自身の物理攻撃力と魔法攻撃力\n　を大アップ。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・後方の敵２キャラに魔法中ダメージ。\n・前方の敵３キャラに魔法小ダメージを与え、Ｔ\n　Ｐを小ダウン。\n　さらに自身のＴＰを中アップさせる。\n・前方の敵３キャラを束縛状態にし、魔法大ダ\n　メージを与える。\n　自身のターゲットがブレイクしている場合、自\n　身の魔法攻撃力を特大アップ。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・敵全体に毎秒魔法小ダメージを与える。\n　自身のターゲットがブレイクしていない場合、\n　敵全体のＴＰを毎秒小ダウン。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・向かって左側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン。\n・中央のターゲットのブレイク時、魔法攻撃力が\n　特大ダウン。\n・向かって右側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301400, "メデューサ", 301400, 0, 3, 270, 1000, 1, 2.5, 0, 0, 0, "無数の毒蛇から成る頭髪の、乙女座の魔星獣。\n悲恋の苦しみは、全てを拒み石に変える。\n\n・敵全体に魔法大ダメージを与え、前方範囲内\n　の敵はさらに石化状態にする。\n・前方範囲内の敵に物理ダメージを与え、石化\n　状態の敵はさらにＴＰを大ダウン。\n・物理攻撃力が最も高い敵1キャラに魔法大ダ\n　メージを与え、毒状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301401, "メデューサ", 301401, 0, 3, 270, 1000, 1, 2.5, 0, 0, 0, "【物理】果てのない愛憎に狂う乙女座の魔星獣。\n凄まじい嫉妬と拒絶が見るもの全てを石化させる。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、さらに前\n　方範囲内の敵すべてに石化状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方範囲内の敵に物理大ダメージを与え、行動\n　不能状態の敵はさらにＴＰを特大ダウン。\n・後ろから２番目の敵を中心にした小範囲に魔法\n　小ダメージを与え、毒状態を付与する。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301402, "メデューサ", 301402, 0, 3, 270, 1000, 1, 2.5, 0, 0, 0, "【物理】果てのない愛憎に狂う乙女座の魔星獣。\n凄まじい嫉妬と拒絶が見るもの全てを石化させる。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、さらに前\n　方範囲内の敵すべてに石化状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方範囲内の敵に物理大ダメージを与え、行動\n　不能状態の敵はさらにＴＰを特大ダウン。\n・後ろから２番目の敵を中心にした小範囲に魔法\n　小ダメージを与え、毒状態を付与する。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。\n・後ろから２番目の敵を中心にした小範囲に魔法\n　小ダメージを与える。\n　キャラのＨＰが60％未満の場合、石化状態を\n　付与する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301403, "メデューサ", 301403, 0, 3, 270, 1000, 1, 2.5, 0, 0, 0, "【物理】果てのない愛憎に狂う乙女座の魔星獣。\n凄まじい嫉妬と拒絶が見るもの全てを石化させる。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、さらに前\n　方範囲内の敵すべてに石化状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方範囲内の敵に物理大ダメージを与え、行動\n　不能状態の敵はさらにＴＰを特大ダウン。\n・後ろから２番目の敵を中心にした小範囲に魔法\n　小ダメージを与え、毒状態を付与する。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。\n・後ろから２番目の敵を中心にした小範囲に魔法\n　小ダメージを与える。\n　キャラのＨＰが60％未満の場合、石化状態を\n　付与する。\n・しもべを１体召喚し、自身の物理防御力を中ダ\n　ウン、魔法防御力を小ダウン。\n・しもべは、前方１キャラに物理中ダメージを与\n　え、さらに石化状態を付与する。\n・しもべは、敵全体を小さく引き寄せる。\n・しもべのＨＰが一定値以下になった時、メデュ\n　ーサに物理固定ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301404, "メデューサ", 301404, 0, 3, 270, 1000, 1, 2.5, 0, 0, 0, "【物理】果てのない愛憎に狂う乙女座の魔星獣。\n凄まじい嫉妬と拒絶が見るもの全てを石化させる。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、さらに前\n　方範囲内の敵すべてに石化状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方範囲内の敵に物理大ダメージを与え、行動\n　不能状態の敵はさらにＴＰを特大ダウン。\n・後ろから２番目の敵を中心にした小範囲に魔法\n　小ダメージを与え、毒状態を付与する。\n　このスキルにより付与された毒のダメージでは、\n　ＴＰが回復しない。\n・後ろから２番目の敵を中心にした小範囲に魔法\n　小ダメージを与える。\n　キャラのＨＰが60％未満の場合、石化状態を\n　付与する。\n・しもべを１体召喚し、自身の物理防御力を中ダ\n　ウン、魔法防御力を小ダウン。\n・しもべは、前方１キャラに物理中ダメージを与\n　え、さらに石化状態を付与する。\n・しもべは、敵全体を小さく引き寄せる。\n・しもべのＨＰが一定値以下になった時、メデュ\n　ーサに物理固定ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301500, "ウールヴヘジン", 301500, 0, 12, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】遠吠えで獲物を麻痺させ\nひるんだ所をツメで引き裂く。\n数々の冒険者の行く手を阻んできた\n残虐を極める魔界の狼。\n\n・ランダムな2キャラに物理\n　大ダメージを与える。\n\n・前方3キャラに魔法小ダメージを\n　与え、麻痺状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301501, "ウールヴヘジン", 301501, 0, 12, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】遠吠えで獲物をひるませツメで引き裂く。\n自身の欲望のまま、残虐の限りを尽くす魔狼。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、前方２キャラに物理大ダ\n　メージを与え、ＴＰを中ダウン。\n・敵全体にキャラの最大ＨＰに応じた魔法割合ダ\n　メージを与え、さらに最も物理攻撃力の高い２\n　キャラを麻痺状態にする。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301600, "ジズ", 301600, 0, 3, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】猛り狂う暴風を纏いし大怪鳥。\n魔物図鑑を抜け出し、破壊の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与え、\n　さらにスタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301601, "ジズ", 301600, 0, 3, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】猛り狂う暴風を纏いし大怪鳥。\n魔物図鑑を抜け出し、破壊の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与え、\n　さらにスタンさせる。\n・前方範囲内の敵にキャラの最大ＨＰに応じた\n　中ダメージを与え、物理防御力を下げる。\n・ジズ自身のＨＰが50％を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301700, "ジャバウォック", 301700, 0, 3, 270, 1000, 1, 2.6, 0, 0, 0, "【物理】毒瘴の闇稜の頂に棲まう、醜悪なる狂獣。\n猛毒の瘴気で生を奪い、屍を食み力の糧にする。\n\n・ユニオンバーストは敵全体に魔法大ダメージと\n　毒状態を与え、さらにノックバックさせる。\n・前方2キャラに物理ダメージを与え、さらに物\n　理攻撃力とTPをダウンさせる。\n・ジャバウォック自身の残りHPが40%を切る\n　とさらに攻撃が激しく強暴になり、さらに3体\n　のモンスターを呼び寄せる。\n・残り時間が20秒を切ると、敵全体に強力な毒\n　状態を付与し、自身のTPを特大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301800, "サジタリウス", 301800, 0, 3, 270, 1000, 1, 2.0, 0, 0, 0, "天を駆け数多の標的を射止める射手座の魔星獣。\n雷光纏いし矢は、刹那にすべてを穿つ至高の技。\n\n・ユニオンバーストは敵全体に最大ＨＰに応じ\n　て魔法ダメージを与える。\n　暗闇状態の敵はダメージが3倍になる。\n・敵全体に魔法中ダメージを与え、さらに残り\n　ＨＰ割合が最も少ない敵1キャラに強力な暗\n　闇状態を付与。\n・前方の敵3キャラに物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301801, "サジタリウス", 301801, 0, 3, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】星穹の神殿を守護する射手座の魔星獣。\n万象を射抜く一閃は、紫電煌めく神域の絶技。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、魔法攻撃\n　力を大ダウンさせる。\n　さらに、暗闇状態の敵はダメージと魔法攻撃力\n　のダウン量が増加する。\n・敵全体に魔法小ダメージを与え、さらに強力な\n　暗闇状態を付与する。\n・前方の敵３キャラに物理中ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301802, "サジタリウス", 301802, 0, 3, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】星穹の神殿を守護する射手座の魔星獣。\n万象を射抜く一閃は、紫電煌めく神域の絶技。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、魔法攻撃\n　力を大ダウンさせる。\n　さらに、暗闇状態の敵はダメージと魔法攻撃力\n　のダウン量が増加する。\n・敵全体に魔法小ダメージを与え、さらに強力な\n　暗闇状態を付与する。\n・前方の敵３キャラに物理中ダメージ。\n・敵全体に魔法中ダメージ。\n　自身のターゲットがブレイクしていない場合、\n　自身の矢に【黒星】を１追加する。\n　【黒星】の数が２の場合、敵全体に強力な暗闇\n　状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301803, "サジタリウス", 301803, 0, 3, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】星穹の神殿を守護する射手座の魔星獣。\n万象を射抜く一閃は、紫電煌めく神域の絶技。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、魔法攻撃\n　力を大ダウンさせる。\n　さらに、暗闇状態の敵はダメージと魔法攻撃力\n　のダウン量が増加する。\n　このスキルによるダメージでは、ＴＰ回復量は\n　減少する。\n・敵全体に魔法小ダメージを与え、さらに強力な\n　暗闇状態を付与する。\n・前方の敵３キャラに物理中ダメージ。\n・敵全体に魔法中ダメージ。\n　自身のターゲットがブレイクしていない場合、\n　自身の矢に【黒星】を１追加する。\n　【黒星】の数が２の場合、敵全体に強力な暗闇\n　状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301900, "ウェアオルカ", 301900, 0, 11, 270, 1000, 1, 1.7, 0, 0, 0, "【物理】鋭い眼つきで、獲物\nと波を探し求める海のハンター。\n魔力で無限に生み出す潮水は\n敵の刃と気力を鈍らせる。\n\n・前方4キャラに物理中ダメージを\n　与え、物理攻撃力を下げる。\n\n・前方2キャラに魔法小ダメージを\n　与え、ＴＰを下げる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (301901, "キリングオルカ", 301901, 0, 11, 270, 1000, 1, 1.5, 0, 0, 0, "【物理】ルナの魔力により凶悪化した大海の狩人。\n鍛え抜いた躰で、刃と化した水流の一撃を放つ。\n\n・前方４キャラに物理大ダメージを与え、\n　物理攻撃力を中ダウンさせる。さらに、\n　味方全員のＴＰ上昇を小アップする。\n・前方小範囲に魔法中ダメージを与え、\n　ＴＰを大ダウン。\n・後ろから２番目のキャラを中心にした\n　小範囲に物理中ダメージを与え、\n　魔法攻撃力を大ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302000, "ワイルドグリフォン", 302000, 0, 11, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】過酷な環境で進化したプチグリフォン。\n竜巻で獲物を巻き上げ、空で狩りをする。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・前から３キャラに魔法中ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302001, "ワイルドグリフォン", 302001, 0, 11, 270, 1000, 1, 1.6, 0, 0, 0, "過酷な環境で進化したプチグリフォン。\n竜巻で獲物を巻き上げ、空で狩りをする。\n\n・前方範囲内の敵に魔法中ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302002, "ワイルドグリフォン", 302002, 0, 11, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】過酷な環境で進化したプチグリフォン。\n竜巻で獲物を巻き上げ、空で狩りをする。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・前から３キャラに魔法中ダメージを与え、さら\n　にノックバックさせる。\n　キャラのＨＰが70％未満の場合、スタン状態\n　を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から３キャラに魔法中ダメージを与え、魔法\n　防御力を中ダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302100, "ワイバーン", 302100, 0, 11, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】大きな皮翼を使い、空を駆ける翼竜。\n巨大な火球を吐き、侵入者の行く手を阻む。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、前から１番目の敵を中心\n　にした小範囲の最大３キャラに物理中ダメージ\n　を与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302101, "ワイバーン", 302101, 0, 11, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】大きな皮翼を使い、空を駆ける翼竜。\n巨大な火球を吐き、侵入者の行く手を阻む。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、前から１番目の敵を中心\n　にした小範囲の最大３キャラに物理中ダメージ\n　を与え、物理防御力を特大ダウン。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から３キャラをノックバックさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302102, "ワイバーン", 302102, 0, 11, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】大きな皮翼を使い、空を駆ける翼竜。\n巨大な火球を吐き、侵入者の行く手を阻む。\n\n・前から１番目の敵を中心にした小範囲の\n　最大３キャラに物理中ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302103, "サンドワイバーン", 302103, 0, 11, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】砂塵舞う空を縄張りにする\n翼竜。厳しい環境でも獲物を逃さず\n荒野の空を支配する。\n\n・前から１番目の敵を中心にした小\n　範囲の最大３キャラに魔法中ダメ\n　ージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302104, "サンドワイバーン", 302103, 0, 11, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】砂塵舞う空を縄張りにする\n翼竜。厳しい環境でも獲物を逃さず\n荒野の空を支配する。\n\n・前から１番目の敵を中心にした小\n　範囲の最大３キャラに魔法中ダメ\n　ージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302200, "イクト・ガラディオン", 302200, 0, 16, 270, 1000, 2, 1.6, 0, 0, 0, "【魔法】ルナの魔力で目覚めた、古代の機械兵器。\n無慈悲に放たれる魔力が、侵入者を阻む。\n\n・敵全体に魔法特大ダメージを与え、魔法防御力\n　を大ダウン。\n・前方範囲内の敵に物理大ダメージを与える。\n・前方範囲内の敵に魔法大ダメージを与え、\n　麻痺状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302300, "ワイズオウル", 302300, 0, 16, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】大樹の頂に棲まう、聡明なる大梟。\n森に生ける者の英知を束ね、巧みに魔術を操る。\n\n・ユニオンバーストは敵全体に魔法ダメージを\n　与える。\n・ランダムな1キャラに物理ダメージを与え\n　さらに麻痺状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302400, "アークガーディアン", 302400, 0, 16, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】太古より遺跡を護り続ける人工生命体。\n創造主の秘術で、無限に動力を得て動き続ける。\n\n・ユニオンバーストは敵全体に魔法大ダメージを\n　与える。\n・前方範囲内に物理ダメージを与える。\n・敵全体に魔法ダメージを与え、さらに沈黙させ\n　る。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302500, "キマイラ", 302500, 0, 16, 270, 1000, 1, 1.4, 0, 0, 0, "【物理】孤塔の頂に座する、暴虐なる混成魔獣。\n千変万化の猛攻は、挑む者数多を屠ってきた。\n\n・ユニオンバーストは前方範囲内に物理大\n　ダメージを与え、さらにノックバックさせる。\n・前方3キャラに物理ダメージを与え、さらに\n　火傷状態にする。\n・敵全体に魔法ダメージを与え、さらに行動速度\n　物理防御力、魔法防御力をダウン。\n・残り時間が10秒を切ると、敵全体に魔法極大\n　ダメージを与え、自身のTPを特大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302600, "ツインピッグス", 302600, 0, 16, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】さらなる力を得た双子座の魔星獣。\n前衛で防御しつつ、熟達した技で攻撃を行う。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n・後ろから２キャラに物理大ダメージを与え、行\n　動速度を大ダウンさせる。\n・敵全体に物理大ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302601, "ツインピッグス", 302601, 0, 16, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】さらなる力を得た双子座の魔星獣。\n前衛で防御しつつ、熟達した技で攻撃を行う。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n・後ろから２キャラに物理大ダメージを与え、行\n　動速度を大ダウンさせる。\n・敵全体に物理大ダメージ。\n・自身の物理防御力と魔法防御力を大ダウン。\n　その後自身のＴＰ上昇と物理クリティカルを特\n　大アップさせ、敵全体に物理大ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302602, "ツインピッグス", 302602, 0, 16, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】さらなる力を得た双子座の魔星獣。\n前衛で防御しつつ、熟達した技で攻撃を行う。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n・後ろから２キャラに物理大ダメージを与え、行\n　動速度を大ダウンさせる。\n・敵全体に物理大ダメージ。\n・自身の物理防御力と魔法防御力を大ダウン。\n　その後自身のＴＰ上昇と物理クリティカルを特\n　大アップさせ、敵全体に物理大ダメージ。\n・自身の物理防御力と魔法防御力を大ダウン。\n　その後敵全体のＨＰ吸収を特大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302700, "カルキノス", 302700, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】船墓の入江に巣食う、蟹座の魔星獣。\n巨大なハサミの一撃で、無数の船を沈める。\n\n・敵全体に魔法大ダメージを与え、物理防御力\n　をダウン。\n・前方範囲内の敵すべてに物理中ダメージを与\n　え、さらにスタン状態にする。\n・敵全体に物理中ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302701, "カルキノス", 302701, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】幾多の船を沈めた蟹座の魔星獣。\n大海の覇者は万物を断裁し、圧潰し、殲滅する。\n\n・ユニオンバーストは、敵全体に自身の魔法攻撃\n　力に応じた魔法割合ダメージを与える。\n　その後、自身の魔法攻撃力を特大アップ。\n・前から１番目の敵を中心にした小範囲の敵すべ\n　てに物理中ダメージを与え、さらにスタンさせ\n　る。\n・敵全体に物理小ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302702, "カルキノス", 302702, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】幾多の船を沈めた蟹座の魔星獣。\n大海の覇者は万物を断裁し、圧潰し、殲滅する。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を中アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に自身の魔法攻撃\n　力に応じた魔法割合ダメージを与える。\n　その後、自身の魔法攻撃力を特大アップ。\n・前から１番目の敵を中心にした小範囲の敵すべ\n　てに物理中ダメージを与え、さらにスタンさせ\n　る。\n・敵全体に物理小ダメージ。\n・一定時間姿を変える。\n　姿を変える際、敵全体をノックバックし自身の\n　ステータスアップ効果をダウンさせる。\n　あわせて自身の魔法攻撃力を特大アップさせ、\n　すべてのスキルを魔法攻撃に変化させる。\n・元の姿に戻る際、敵全体をノックバックし、\n　自身のステータスアップ効果をアップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302703, "カルキノス", 302703, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】幾多の船を沈めた蟹座の魔星獣。\n大海の覇者は万物を断裁し、圧潰し、殲滅する。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を中アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に自身の魔法攻撃\n　力に応じた魔法割合ダメージを与える。\n　その後、自身の魔法攻撃力を特大アップ。\n・前から１番目の敵を中心にした小範囲の敵すべ\n　てに物理中ダメージを与え、さらにスタンさせ\n　る。\n・敵全体に物理小ダメージ。\n・一定時間姿を変える。\n　姿を変える際、敵全体をノックバックし自身の\n　ステータスアップ効果をダウンさせる。\n　あわせて自身の魔法攻撃力を特大アップさせ、\n　すべてのスキルを魔法攻撃に変化させる。\n・元の姿に戻る際、敵全体をノックバックし、\n　自身のステータスアップ効果をアップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302800, "オルレオン", 302800, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "サバンナの覇者と名高い、獅子座の魔星獣。\n刃向かう者は、灼熱の咆哮で焼き尽くす。\n\n・敵全体に、最大ＨＰに応じた防御力無視の\n　物理大ダメージを与え、残りＨＰの少ない\n　敵はさらに火傷状態にする。\n・敵1キャラに物理大ダメージを与え、火傷\n　状態の場合はさらに追加ダメージ。\n・前方範囲内の敵に物理中ダメージを与え、\n　火傷状態の場合はさらに追加ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302801, "オルレオン", 302801, 0, 16, 270, 1000, 1, 3.0, 0, 0, 0, "【物理】荒涼たる原野に君臨する獅子座の魔星獣。\n鋭爪で大気を切裂き、業火の咆哮が大地を焦がす。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n　キャラのＨＰが80%未満の場合、火傷状態を\n　付与する。\n　このスキルにより付与された火傷のダメージで\n　は、ＴＰが回復しない。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方１キャラに物理大ダメージを与える。\n　火傷状態の場合はさらに追加ダメージ。\n・前方範囲内の敵に物理大ダメージを与える。\n　火傷状態の場合はさらに追加ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302802, "オルレオン", 302802, 0, 16, 270, 1000, 1, 3.0, 0, 0, 0, "【物理】荒涼たる原野に君臨する獅子座の魔星獣。\n鋭爪で大気を切裂き、業火の咆哮が大地を焦がす。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n　キャラのＨＰが80%未満の場合、火傷状態を\n　付与する。\n　このスキルにより付与された火傷のダメージで\n　は、ＴＰが回復しない。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方１キャラに物理大ダメージを与える。\n　火傷状態の場合はさらに追加ダメージ。\n・前方範囲内の敵に物理大ダメージを与える。\n　火傷状態の場合はさらに追加ダメージ。\n・敵全体にキャラの最大ＨＰに応じた魔法割合ダ\n　メージを与え、スタンさせる。\n　キャラのＨＰが40%未満の場合、長時間スタ\n　ンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302803, "オルレオン", 302803, 0, 16, 270, 1000, 1, 3.0, 0, 0, 0, "【物理】荒涼たる原野に君臨する獅子座の魔星獣。\n鋭爪で大気を切裂き、業火の咆哮が大地を焦がす。\n\n・オルレオンから受けるすべてのダメージで発生\n　する、パーティキャラのＴＰ回復量を小ダウン\n　させる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n　キャラのＨＰが80%未満の場合、火傷状態を\n　付与する。\n　このスキルにより付与された火傷のダメージで\n　は、ＴＰが回復しない。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方１キャラに物理大ダメージを与える。\n　火傷状態の場合はさらに追加ダメージ。\n・前方範囲内の敵に物理大ダメージを与える。\n　火傷状態の場合はさらに追加ダメージ。\n・敵全体にキャラの最大ＨＰに応じた魔法割合ダ\n　メージを与え、スタンさせる。\n　キャラのＨＰが40%未満の場合、長時間スタ\n　ンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・敵の挑発を無視して、後方１キャラに魔法中ダ\n　メージを与え、さらに打ち上げて引き寄せ、ス\n　タンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302900, "アクアリオス", 302900, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "神瓶に宿る魔力に取込まれた、水瓶座の魔星獣。\n強大な力に溺れ、大海を支配せんと暴れまわる。\n\n・ユニオンバーストは、敵全体に魔法小ダメー\n　ジを計６回与える。\n　キャラのＨＰが８０％を切るとノックバック\n　させ、４０％を切るとさらに追加でノックバ\n　ックとスタン状態を付与。\n・目の前の敵３キャラに物理中ダメージ。\n・自身のステータスダウン効果と、敵全体のス\n　テータスアップ効果を打消し、自身のＴＰを\n　アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302901, "アクアリオス", 302901, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】神瓶に宿る魔力を操る水瓶座の魔星獣。\n激流は全てを飲込み蒼海の支配者として君臨する。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・アクアリオスから受けるすべてのダメージで発\n　生する、パーティキャラのＴＰ回復量を小ダウ\n　ンさせる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　キャラのＨＰが80％未満の場合ノックバック\n　させ、50％未満の場合さらに追加でノック\n　バックとスタン状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・敵全体の物理攻撃力と魔法攻撃力を大ダウンさ\n　せ、自身のＴＰ、物理防御力、魔法防御力を小\n　アップ。\n・目の前の敵１キャラに物理特大ダメージ、前か\n　ら２番目と３番目のキャラに物理大ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302902, "アクアリオス", 302902, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】神瓶に宿る魔力を操る水瓶座の魔星獣。\n激流は全てを飲込み蒼海の支配者として君臨する。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・アクアリオスから受けるすべてのダメージで発\n　生する、パーティキャラのＴＰ回復量を小ダウ\n　ンさせる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　キャラのＨＰが80％未満の場合ノックバック\n　させ、50％未満の場合さらに追加でノック\n　バックとスタン状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・敵全体の物理攻撃力と魔法攻撃力を大ダウンさ\n　せ、自身のＴＰ、物理防御力、魔法防御力を小\n　アップ。\n・目の前の敵１キャラに物理特大ダメージ、前か\n　ら２番目と３番目のキャラに物理大ダメージ。\n\n【バトルフィールド効果】\n一定時間が経過するごとに、激流が発生する。\n・パーティキャラ全体に連続で魔法小ダメージ。\n　キャラのＨＰが90％未満の場合、ノックバッ\n　クさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・アクアリオスのターゲットがブレイクしている\n　場合、アクアリオスのＴＰを小ダウン。\n　アクアリオスのターゲットがブレイクしていな\n　い場合、アクアリオスの物理防御力と魔法防御\n　力を小アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302903, "アクアリオス", 302903, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】神瓶に宿る魔力を操る水瓶座の魔星獣。\n激流は全てを飲込み蒼海の支配者として君臨する。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・アクアリオスから受けるすべてのダメージで発\n　生する、パーティキャラのＴＰ回復量を小ダウ\n　ンさせる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　キャラのＨＰが80％未満の場合ノックバック\n　させ、50％未満の場合さらに追加でノック\n　バックとスタン状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・敵全体の物理攻撃力と魔法攻撃力を大ダウンさ\n　せ、自身のＴＰ、物理防御力、魔法防御力を小\n　アップ。\n・目の前の敵１キャラに物理特大ダメージ、前か\n　ら２番目と３番目のキャラに物理大ダメージ。\n\n【バトルフィールド効果】\n一定時間が経過するごとに、激流が発生する。\n・パーティキャラ全体に連続で魔法小ダメージ。\n　キャラのＨＰが90％未満の場合、ノックバッ\n　クさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・アクアリオスのターゲットがブレイクしている\n　場合、アクアリオスのＴＰを小ダウン。\n　アクアリオスのターゲットがブレイクしていな\n　い場合、アクアリオスの物理防御力と魔法防御\n　力を小アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (302904, "アクアリオス", 302904, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】神瓶に宿る魔力を操る水瓶座の魔星獣。\n激流は全てを飲込み蒼海の支配者として君臨する。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・アクアリオスから受けるすべてのダメージで発\n　生する、パーティキャラのＴＰ回復量を小ダウ\n　ンさせる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　キャラのＨＰが80％未満の場合ノックバック\n　させ、50％未満の場合さらに追加でノック\n　バックとスタン状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・敵全体の物理攻撃力と魔法攻撃力を大ダウンさ\n　せ、自身のＴＰ、物理防御力、魔法防御力を小\n　アップ。\n・目の前の敵１キャラに物理特大ダメージ、前か\n　ら２番目と３番目のキャラに物理大ダメージ。\n\n【バトルフィールド効果】\n一定時間が経過するごとに、激流が発生する。\n・パーティキャラ全体に連続で魔法小ダメージ。\n　キャラのＨＰが90％未満の場合、ノックバッ\n　クさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・アクアリオスのターゲットがブレイクしている\n　場合、アクアリオスのＴＰを小ダウン。\n　アクアリオスのターゲットがブレイクしていな\n　い場合、アクアリオスの物理防御力と魔法防御\n　力を小アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303000, "トルペドン", 303000, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "大海原を爆走し、鬼シケ呼び込む魚座の魔星獣。\n取巻く手下の赤ビレはカチコミ上等ヘッドの証。\n\n・物理攻撃力アップ・ダウン効果の影響を受け\n　やすい。\n・ユニオンバーストは、敵全体に物理大ダメー\n　ジを与え、自分の行動速度と物理攻撃力をア\n　ップ。\n・敵全体に物理小ダメージ。\n・前方２キャラに物理中ダメージを与え、物理\n　防御力を小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303001, "トルペドン", 303001, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】大海を背負って立つ、爆走魚座の魔星獣。\n舎弟に魅せるその背中。共に往くのは覇道の極み。\n\n・物理攻撃力アップ・ダウン効果の影響を受けや\n　すい。\n・ユニオンバーストは、敵全体のバリアを解除し、\n　敵全体にトルペドンの物理攻撃力に応じた物理\n　割合ダメージを与える。\n　さらに、自身の行動速度と物理攻撃力を中アッ\n　プ。\n・敵全体に物理小ダメージ。\n・前方２キャラに物理中ダメージを与え、物理防\n　御力を小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303002, "トルペドン", 303002, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】大海を背負って立つ、爆走魚座の魔星獣。\n舎弟に魅せるその背中。共に往くのは覇道の極み。\n\n・物理攻撃力アップ・ダウン効果の影響を受けや\n　すい。\n・ユニオンバーストは、敵全体のバリアを解除し、\n　敵全体にトルペドンの物理攻撃力に応じた物理\n　割合ダメージを与える。\n　さらに、自身の行動速度と物理攻撃力を中アッ\n　プ。\n・敵全体に物理小ダメージ。\n・前方２キャラに物理中ダメージを与え、物理防\n　御力を小ダウン。\n・旗持ち子分を１体召喚する。\n　旗持ち子分は、トルペドンのＴＰを回復させる。\n　旗持ち子分のＨＰが一定値以下になった時、パ\n　ーティキャラ全体の物理攻撃力と魔法攻撃力を\n　中アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303003, "トルペドン", 303003, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】大海を背負って立つ、爆走魚座の魔星獣。\n舎弟に魅せるその背中。共に往くのは覇道の極み。\n\n・物理攻撃力アップ・ダウン効果の影響を受けや\n　すい。\n・ユニオンバーストは、敵全体のバリアを解除し、\n　敵全体にトルペドンの物理攻撃力に応じた物理\n　割合ダメージを与える。\n　さらに、自身の行動速度と物理攻撃力を中アッ\n　プ。\n・敵全体に物理小ダメージ。\n・前方２キャラに物理中ダメージを与え、物理防\n　御力を小ダウン。\n・旗持ち子分を１体召喚する。\n　旗持ち子分は、トルペドンのＴＰを回復させる。\n　旗持ち子分のＨＰが一定値以下になった時、パ\n　ーティキャラ全体の物理攻撃力と魔法攻撃力を\n　中アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303004, "トルペドン", 303002, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】大海を背負って立つ、爆走魚座の魔星獣。\n舎弟に魅せるその背中。共に往くのは覇道の極み。\n\n・物理攻撃力アップ・ダウン効果の影響を受けや\n　すい。\n・ユニオンバーストは、敵全体のバリアを解除し、\n　敵全体にトルペドンの物理攻撃力に応じた物理\n　割合ダメージを与える。\n　さらに、自身の行動速度と物理攻撃力を中アッ\n　プ。\n・敵全体に物理小ダメージ。\n・前方２キャラに物理中ダメージを与え、物理防\n　御力を小ダウン。\n・旗持ち子分を１体召喚する。\n　旗持ち子分は、トルペドンのＴＰを回復させる。\n　旗持ち子分のＨＰが一定値以下になった時、パ\n　ーティキャラ全体の物理攻撃力と魔法攻撃力を\n　中アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303100, "トウミングマ", 303100, 0, 13, 270, 1000, 1, 3.5, 0, 0, 0, "【物理】氷穴最奥に引き篭り\n生涯冬眠すると決めた巨大熊。\n長い歳月を夢うつつの中で過ごし\n獲物を狩るその一瞬、覚醒する。\n\n・敵全体に魔法大ダメージを与え、\n　物理攻撃力を下げる。\n\n・前方3キャラに物理小ダメージを\n　与える。さらに、前方1キャラを\n　大きく吹き飛ばし、氷結状態\n　にして移動速度を下げる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303200, "マダムピック", 303200, 0, 6, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】吹雪と共に現れ、\n縄張りを荒らす者には\n大群を呼び寄せ襲い掛かる\n雪国イチのゴージャスマダム。\n\n・前方4キャラに魔法中ダメージを\n　与える。\n\n・ランダムな2キャラに魔法\n　小ダメージを与え、\n　凍結状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303300, "ガーゴイル", 303300, 0, 13, 270, 1000, 1, 2.1, 0, 0, 0, "【物理】朽ちた遺跡に残り\n主亡き地を護る、謎の鳥像。\n街も命令も、全て砂と消えた今は\n誰彼構わず炎を吐き襲い掛かる。\n\n・前方5キャラに魔法中ダメージを\n　与え、火傷状態にする。さらに、\n　魔法防御力を下げる。\n\n・ランダムな3キャラに\n　魔法小ダメージを与え、\n　敵全体を暗闇状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303301, "ダークガーゴイル", 303301, 0, 13, 270, 1000, 1, 2.1, 0, 0, 0, "【物理】暴食の君主に仕える、近衛の黒鉄像。\n冥府を彷徨いし魂を巧みに操り、主に捧げる。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法中ダメージ\n　を与え、火傷状態にし、さらに魔法防御力を中\n　ダウン。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・前方の敵１キャラに魔法特大ダメージ。\n　さらに敵全体に魔法中ダメージを与え、物理攻\n　撃力と魔法攻撃力を中ダウン。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303302, "ダークガーゴイル", 303302, 0, 13, 270, 1000, 1, 2.1, 0, 0, 0, "【物理】暴食の君主に仕える、近衛の黒鉄像。\n冥府を彷徨いし魂を巧みに操り、主に捧げる。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法中ダメージ\n　を与え、火傷状態にし、さらに魔法防御力を中\n　ダウン。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・前方の敵１キャラに魔法特大ダメージ。\n　さらに敵全体に魔法中ダメージを与え、物理攻\n　撃力と魔法攻撃力を中ダウン。\n　キャラのＨＰが80%未満の場合、ノックバッ\n　クさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303303, "サンドガーゴイル", 303303, 0, 13, 270, 1000, 1, 2.1, 0, 0, 0, "【物理】塔の魔力を帯び命を宿した砂岩像の魔物。\n砂塵舞う地で敵を待ち、灼炎を吐いて襲い掛かる。\n\n・前方範囲内に魔法大ダメージを与え、火傷状態\n　にする。さらに、魔法防御力を中ダウンさせる。\n・前方３キャラに魔法中ダメージを与え、敵全体\n　を暗闇状態にする。\n・目の前の敵１キャラに物理大ダメージを与える。\n　さらに、敵全体のうち火傷状態の敵には魔法\n　大ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303304, "アウスグス", 303304, 0, 13, 270, 1000, 1, 2.1, 0, 0, 0, "【物理】砂の大地を守護する漆黒\nの悪魔像。広大な砂漠一面を焼き\n尽くすブレスを吐き、灼熱の地を\n進む冒険者の行手を阻む。\n\n・ユニオンバーストは、敵全体に\n　魔法中ダメージを与え、火傷状\n　態にし、さらに魔法防御力を小\n　ダウンさせる。\n　このスキルによるダメージ\n　では、敵のＴＰが回復しない。\n\n・前方の敵１キャラに魔法中\n　ダメージを与える。\n　さらに敵全体に魔法中ダメージ\n　を与え、物理攻撃力と魔法攻撃\n　力を中ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303400, "スナノヅチ", 303400, 0, 13, 270, 1000, 1, 1.9, 0, 0, 0, "【物理】生存競争激しい砂漠の\n頂点に君臨する、巨大トカゲ。\n毒を使い、砂を活かす戦法は、\n過酷な環境で得たサバイバル術。\n\n・敵全体に物理中ダメージを与え、\n　行動速度を下げる。\n　さらに、味方全体の物理攻撃力を\n　上げる。\n\n・前方1キャラを中心にした小範囲\n　に物理小ダメージを与え、毒状態\n　にする。さらに、物理防御力を\n　下げる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303401, "イワノヅチ", 303401, 0, 13, 270, 1000, 1, 1.9, 0, 0, 0, "【物理】ルナの魔力を帯び変異した巨大トカゲ。\n硬い棘状のうろこが、敵の体力と鎧を削り落とす。\n\n・敵全体に物理大ダメージを与え、さらにＴＰを\n　下げる。\n・前方2キャラに物理中ダメージを与え、毒状態\n　にする。\n・前方3キャラに物理中ダメージを与える。\n　さらに前方1キャラに物理大ダメージを与え、\n　物理防御力と魔法防御力を中ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303402, "イワノヅチ", 303402, 0, 13, 270, 1000, 1, 1.9, 0, 0, 0, "【物理】ルナの魔力を帯び変異した巨大トカゲ。\n硬い棘状のうろこが、敵の体力と鎧を削り落とす。\n\n・敵全体に物理大ダメージを与え、さらにＴＰを\n　下げる。\n・前方2キャラに物理中ダメージを与え、毒状態\n　にする。\n・前方3キャラに物理中ダメージを与える。\n　さらに前方1キャラに物理大ダメージを与え、\n　物理防御力と魔法防御力を中ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303500, "ムシュフシュ", 303500, 0, 13, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】吸い続けた他者の\n魔力で、妖術を体得した魔物。\n敵に付けた傷から魔力を奪い、\nさらなる力を得ようとする。\n\n・敵全体に魔法中ダメージを与え、\n　魔法攻撃をする敵すべての\n　ＴＰを下げる。\n\n・前方1キャラを中心にした小範囲\n　に魔法小ダメージを与え、\n　魔法防御力を下げる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303501, "ムシュフシュ", 303501, 0, 13, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】吸い続けた他者の魔力で妖術を得た魔物。\n敵に付けた傷から魔力を奪いさらなる力を求める。\n\n・敵全体に魔法中ダメージを与える。\n　さらに、魔法攻撃をする敵すべてのＴＰを大ダ\n　ウン。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方２キャラに魔法中ダメージを与え、物理攻\n　撃力を大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303502, "ムシュフシュ", 303502, 0, 13, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】吸い続けた他者の魔力で妖術を得た魔物。\n敵に付けた傷から魔力を奪いさらなる力を求める。\n\n・敵全体に魔法中ダメージを与え、ノックバック\n　させる。\n　さらに、魔法攻撃をする敵すべてのＴＰを大ダ\n　ウン。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方２キャラに魔法中ダメージを与え、物理攻\n　撃力を大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303600, "バーンサウルス", 303600, 0, 13, 270, 1000, 1, 1.7, 0, 0, 0, "【物理】強靭な脚と鋭利なツメで\n獲物を一瞬で狩る、獰猛な恐竜。\n滅びた大地でマグマを喰らい、\n生存の道を見つけた孤高の存在。\n\n・敵全体に物理中ダメージを与え、\n　自分の行動速度を上げる。\n\n・前方3キャラに物理中ダメージ\n　を与え、行動速度を下げる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303700, "ヘルハウンド", 303700, 0, 14, 270, 1000, 1, 0.7, 0, 0, 0, "【物理】火山に身を落としてなお\n地獄の炎を纏い蘇った双頭の魔犬。\n愛犬ボニーと共に縄張りを駆け、\n侵入者には灼熱の洗礼を浴びせる。\n\n・敵全体に物理中ダメージを与え、\n　火傷状態にする。さらに、召喚\n　モンスターのＨＰを回復する。\n\n・ボニーを召喚する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303701, "バーンウルフ", 303701, 0, 14, 270, 1000, 1, 0.7, 0, 0, 0, "【物理】塔の魔力で、魔界の炎を顕現させる魔狼。\n灼熱の地で、相棒のボニーとともに待ち受ける。\n\n・敵全体に物理大ダメージを与え火傷状態にする。\n　さらに、ボニーのHPを回復する。\n・ボニーを召喚する。\n・敵全体に物理中ダメージを与え、行動速度をダ\n　ウンさせる。さらに、味方全体の物理攻撃力を\n　大アップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303800, "アルマ", 303800, 0, 16, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】はるか古より迷宮を守護する防衛兵器。すべての罠を超えた最奥で侵入者を静かに待つ。\n・敵全体にキャラの最大ＨＰに応じた\n　魔法中ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303801, "アルマ", 303800, 0, 16, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】はるか古より迷宮を守護する防衛兵器。すべての罠を超えた最奥で侵入者を静かに待つ。\n・敵全体にキャラの最大ＨＰに応じた\n　魔法特大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与える。\n・残りＨＰの高い敵に対して最大ＨＰに応じた\n　魔法中ダメージを与えさらにスタンさせる。\n・アルマ自身のＨＰが50％を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303900, "サイクロプス", 303900, 0, 13, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】怪力が自慢の、凶暴な一つ目巨人。\n瞳に魔力をみなぎらせ、強力な怪光線を放つ。\n\n・敵全体に魔法大ダメージ。\n　残りＨＰが100％のキャラにはダメージがアッ\n　プし、さらに行動速度をダウンさせる。\n・最も物理攻撃力が高い１キャラに、最大ＨＰ\n　に応じた物理中ダメージを与え、ＴＰダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303901, "サイクロプス", 303901, 0, 13, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】怪力が自慢の、凶暴な一つ目巨人。\n瞳に魔力をみなぎらせ、強力な怪光線を放つ。\n\n・敵全体に魔法大ダメージ。\n　残りＨＰが１００％のキャラにはダメージが\n　アップし、さらに行動速度をダウンさせる。\n・最も物理攻撃力が高い１キャラに、最大ＨＰ\n　に応じた物理中ダメージを与え、ＴＰダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303902, "サイクロプス", 303902, 0, 13, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】怪力が自慢の、凶暴な一つ目巨人。\n瞳に魔力をみなぎらせ、強力な怪光線を放つ。\n\n・敵全体に魔法大ダメージを与え、ステータス\n　アップ効果を解除する。\n　さらに行動速度をダウンさせる。\n　残りＨＰが100％のキャラにはダメージがアッ\n　プする。\n・最も物理攻撃力が高い１キャラに、最大ＨＰに\n　応じた物理中ダメージを与え、ＴＰダウン。\n・通常攻撃のたびに自身のＴＰを小アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (303903, "ヒトツメ巨人", 303903, 0, 13, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】砂塵の中、山のように佇\nむ一つ目の巨人。単眼から超強力\nな光線を発し冒険者を薙ぎ払う。\n\n・ユニオンバーストは、敵全体に\n　魔法大ダメージを与え、さらに\n　行動速度を中ダウンさせる。\n　残りＨＰが100％のキャラ\n　には、ダメージがアップする。\n\n・最も物理攻撃力が高い１キャラ\n　に、最大ＨＰに応じた物理割合\n　ダメージを与え、さらにＴＰを\n　大ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304000, "ムーバ", 304000, 0, 13, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】夢幻より生まれ、闇を彷徨う魔獣。\n悪夢の牢に獲物を縛り、旨そうに生気を喰う。\n\n・物理攻撃力が最も高い敵１キャラに魔法特大ダ\n　メージを与え、ＴＰを特大ダウン。\n・敵の挑発を無視して、一番遠くの敵１キャラを\n　中心とした範囲内の敵すべてに呪い状態を付与\n　する。\n　このスキルにより付与された呪いのダメージで\n　は、ＴＰが回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304001, "ムーバ", 304001, 0, 13, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】夢幻より生まれ、闇を彷徨う魔獣。\n悪夢の牢に獲物を縛り、旨そうに生気を喰う。\n\n・物理攻撃力が最も高い敵１キャラに魔法特大ダ\n　メージを与え、ＴＰを特大ダウン。\n・敵の挑発を無視して、一番遠くの敵１キャラを\n　中心とした範囲内の敵すべてのＴＰを大ダウン\n　し、呪い状態を付与する。\n　このスキルにより付与された呪いのダメージで\n　は、ＴＰが回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304100, "ティタノタートル", 304100, 0, 13, 270, 1000, 1, 2.5, 0, 0, 0, "甲羅に大樹が根ざすほどの、老大な陸ガメ。\n敵の攻撃を耐え続け、憤怒の反撃を見舞う。\n\n・敵全体に物理大ダメージを与える。\n・甲羅にこもっている間に受けたダメージ量に\n　応じた物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304101, "ティタノタートル", 304101, 0, 13, 270, 1000, 1, 0.1, 0, 0, 0, "【物理】甲羅に大樹が根ざすほどの老大な陸ガメ。\n敵の攻撃を耐え続け、憤怒の反撃を見舞う。\n\n・敵全体に物理中ダメージを与える。\n・甲羅にこもっている間に受けたダメージ量に応\n　じて、敵全体に物理ダメージを与える。\n・全ターゲットがブレイクされると、一定時間行\n　動不能になる。\n　行動不能の間、自身の物理防御力と魔法防御力\n　を100%ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304102, "ティタノタートル", 304102, 0, 13, 270, 1000, 1, 0.1, 0, 0, 0, "【物理】甲羅に大樹が根ざすほどの老大な陸ガメ。\n敵の攻撃を耐え続け、憤怒の反撃を見舞う。\n\n・敵全体に物理中ダメージを与える。\n・甲羅にこもっている間に受けたダメージ量に応\n　じて、敵全体に物理ダメージを与える。\n・全ターゲットがブレイクされると、一定時間行\n　動不能になる。\n　行動不能の間、自身の物理防御力と魔法防御力\n　を100%ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304200, "ガルグ", 304200, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】屍肉を喰らう凶暴な大型魔獣。\n強固な棘を全身に纏い獲物を執念深くつけ狙う。\n・敵全体にキャラの最大ＨＰに応じた\n　物理中ダメージを与える。\n・後方範囲内に物理中ダメージを与えさらに\n　スタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304201, "ガルグ", 304200, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】屍肉を喰らう凶暴な大型魔獣。\n強固な棘を全身に纏い獲物を執念深くつけ狙う。\n・敵全体にキャラの最大ＨＰに応じた\n　物理中ダメージを与える。\n・後方範囲内に物理中ダメージを与えさらに\n　スタンさせる。\n・前方２番目の敵に物理中ダメージを与える。\n・ガルグ自身のＨＰが50％を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304300, "テンタパス", 304300, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】海辺に君臨する巨大な軟体魔獣。\n強靭な触手と鋼鉄の大銛で全てを破壊しつくす。\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・後方範囲内に魔法中ダメージを与え、\n　麻痺状態を付与、さらに物理攻撃力、\n　魔法攻撃力を特大ダウン。\n・一定時間経過すると敵単体に\n　物理超特大ダメージを与える。\n・テンタパス自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304301, "テンタパス", 304300, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】海辺に君臨する巨大な軟体魔獣。\n強靭な触手と鋼鉄の大銛で全てを破壊しつくす。\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・後方範囲内に魔法中ダメージを与え、\n　麻痺状態を付与、さらに物理攻撃力、\n　魔法攻撃力を特大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304302, "テンタパス", 304300, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】海辺に君臨する巨大な軟体魔獣。\n強靭な触手と鋼鉄の大銛で全てを破壊しつくす。\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・後方範囲内に魔法中ダメージを与え、\n　麻痺状態を付与、さらに物理攻撃力、\n　魔法攻撃力を特大ダウン。\n・テンタパス自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304303, "テンタパス", 304300, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】海辺に君臨する巨大な軟体魔獣。\n強靭な触手と鋼鉄の大銛で全てを破壊しつくす。\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・後方範囲内に魔法中ダメージを与え、\n　麻痺状態を付与、さらに物理攻撃力、\n　魔法攻撃力を特大ダウン。\n・一定時間経過すると敵単体に\n　物理超特大ダメージを与える。\n・テンタパス自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304304, "オクタスキッド", 304304, 0, 16, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】塔の力で人間に復讐を目論む、軟体魔獣。\n若かりし頃に刺された銛の恨みは、海よりも深い。\n\n・敵全体に物理大ダメージを与える。\n・前から３番目以降の敵に魔法中ダメージを与え、\n　物理防御力と行動速度を中ダウン。\n　さらに、ステータスアップ効果を解除する。\n・残りＨＰの最も高い敵に、残りＨＰに応じた\n　物理大ダメージを与え、ＴＰを中ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304400, "島クジラ", 304400, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】数多の探検家を飲み込んだ幻島の巨鯨。欲望、幻想に憑りつかれた愚者を無慈悲に葬る。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・敵全体に魔法中ダメージを与え、\n　さらに島クジラ自身の物理防御力、\n　魔法防御力を極大アップ。\n・前から３キャラに魔法大ダメージを与え、\n　さらに大きく吹き飛ばす。\n・島クジラ自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304401, "島クジラ", 304400, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】数多の探検家を飲み込んだ幻島の巨鯨。欲望、幻想に憑りつかれた愚者を無慈悲に葬る。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・敵全体に魔法中ダメージを与え、\n　さらに島クジラ自身の物理防御力、\n　魔法防御力を極大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304402, "島クジラ", 304400, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】数多の探検家を飲み込んだ幻島の巨鯨。欲望、幻想に憑りつかれた愚者を無慈悲に葬る。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・敵全体に魔法中ダメージを与え、\n　さらに島クジラ自身の物理防御力、\n　魔法防御力を極大アップ。\n・前から３キャラに魔法大ダメージを与え、\n　さらに大きく吹き飛ばす。\n・島クジラ自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304403, "島クジラ", 304400, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】数多の探検家を飲み込んだ幻島の巨鯨。欲望、幻想に憑りつかれた愚者を無慈悲に葬る。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・敵全体に魔法中ダメージを与え、\n　さらに島クジラ自身の物理防御力、\n　魔法防御力を極大アップ。\n・前から３キャラに魔法大ダメージを与え、\n　さらに大きく吹き飛ばす。\n・島クジラ自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304500, "ライデン", 304500, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】熟練の戦闘術で翻弄するクワガタの魔物。\n豪雷を纏う技のキレに、シビれる者が続出。\n\n・ユニオンバーストは、前から２キャラに物理中\n　ダメージを与え麻痺させる。\n　さらに敵全体の行動速度を大ダウンさせたのち、\n　自身の物理防御力と魔法防御力を中ダウン。\n・一定時間、自身の物理防御力と魔法防御力を特\n　大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304600, "ライライ", 304600, 0, 16, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】雷雲を従え、無邪気に暴れるカミナリ娘。\n油断すると、加減知らずの雷撃を見舞われる。\n\n・ユニオンバーストは、敵全体に魔法中ダメージ。\n・後方２キャラに魔法小ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304601, "ライライ", 304601, 0, 16, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】雷雲を従え、無邪気に暴れるカミナリ娘。\n油断すると、加減知らずの雷撃を見舞われる。\n\n・ユニオンバーストは、敵全体に魔法中ダメージ\n　を与え、さらにスタンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・後方２キャラに魔法小ダメージを与え、さらに\n　ＴＰを小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304602, "ライライ", 304602, 0, 16, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】雷雲を従え、無邪気に暴れるカミナリ娘。\n油断すると、加減知らずの雷撃を見舞われる。\n\n・敵全体に魔法中ダメージ。\n・後方２キャラの敵に魔法小ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304700, "リビングメイル", 304700, 0, 16, 270, 1000, 1, 0.8, 0, 0, 0, "【物理】金属を喰らい、武具を操る謎の魔物。\n増殖融合し超大な怪物となり、平和を脅かす。\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与え、物理攻撃力と。\n　物理防御力を大ダウン。\n・前方範囲内に物理大ダメージを与える。\n・ＴＰの高い敵3キャラのＴＰを減少させ、\n　自身の物理攻撃力を大アップ。\n・リビングメイル自身のＨＰが40％を切ると、　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304701, "リビングメイル", 304700, 0, 16, 270, 1000, 1, 0.8, 0, 0, 0, "【物理】金属を喰らい、武具を操る謎の魔物。\n増殖融合し超大な怪物となり、平和を脅かす。\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与え、物理攻撃力と\n　物理防御力を大ダウン。\n・前方範囲内に物理大ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304702, "リビングメイル", 304700, 0, 16, 270, 1000, 1, 0.8, 0, 0, 0, "【物理】金属を喰らい、武具を操る謎の魔物。\n増殖融合し超大な怪物となり、平和を脅かす。\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与え、物理攻撃力と\n　物理防御力を大ダウン。\n・前方範囲内に物理大ダメージを与える。\n・残りＨＰの割合が多い敵3キャラのＴＰを\n　減少させ、自身の物理攻撃力を大アップ。\n・リビングメイル自身のＨＰが40％を切ると、　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304703, "リビングメイル", 304700, 0, 16, 270, 1000, 1, 0.8, 0, 0, 0, "【物理】金属を喰らい、武具を操る謎の魔物。\n増殖融合し超大な怪物となり、平和を脅かす。\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与え、物理攻撃力と\n　物理防御力を大ダウン。\n・前方範囲内に物理大ダメージを与える。\n・残りＨＰの割合が多い敵3キャラのＴＰを\n　減少させ、自身の物理攻撃力を大アップ。\n・リビングメイル自身のＨＰが40％を切ると、　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304704, "壊乱の黒鎧騎士", 304704, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ルナの塔の魔力を喰らい、増殖融合を\n続ける謎の魔物。すべてを無差別に圧し潰す。\n\n・敵全体に物理大ダメージを与え、\n　さらに物理防御力を中ダウン。\n・前方範囲内の敵に物理ダメージを与え、\n　そのうち物理攻撃力の高い2キャラの\n　物理攻撃力を特大ダウンさせ、さらに\n　ＴＰを特大ダウン。\n　自分の物理防御力を大ダウン。\n・前から3キャラに物理中ダメージを与え、\n　自分の物理攻撃力を中アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304705, "リビングメイル", 304705, 0, 16, 270, 1000, 1, 0.8, 0, 0, 0, "【物理】金属を喰らい、武具を操る謎の魔物。\n増殖融合し超大な怪物となり、平和を脅かす。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージを与え、\n　物理攻撃力と物理防御力を大ダウン。\n・前から３キャラに物理大ダメージを与える。\n・ＴＰの高い敵３キャラのＴＰを減少させ、\n　自身の物理攻撃力を大アップ。\n・リビングメイル自身のＨＰが40％を切ると、　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304706, "リビングメイル", 304705, 0, 16, 270, 1000, 1, 0.8, 0, 0, 0, "【物理】金属を喰らい、武具を操る謎の魔物。\n増殖融合し超大な怪物となり、平和を脅かす。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージを与え、\n　物理攻撃力と物理防御力を大ダウン。\n・前から３キャラに物理大ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304707, "リビングメイル", 304705, 0, 16, 270, 1000, 1, 0.8, 0, 0, 0, "【物理】金属を喰らい、武具を操る謎の魔物。\n増殖融合し超大な怪物となり、平和を脅かす。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージを与え、\n　物理攻撃力と物理防御力を大ダウン。\n・残りＨＰの割合が多い敵３キャラのＴＰを\n　減少し、さらにノックバックさせる。\n　その際、自身の物理攻撃力を大アップ。\n・前から３キャラに物理大ダメージを与える。\n・リビングメイル自身のＨＰが40％を切ると、　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304708, "リビングメイル", 304705, 0, 16, 270, 1000, 1, 0.8, 0, 0, 0, "【物理】金属を喰らい、武具を操る謎の魔物。\n増殖融合し超大な怪物となり、平和を脅かす。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージを与え、\n　物理攻撃力と物理防御力を大ダウン。\n・残りＨＰの割合が多い敵３キャラのＴＰを\n　減少し、さらにノックバックさせる。\n　その際、自身の物理攻撃力を大アップ。\n・前から３キャラに物理大ダメージを与える。\n・リビングメイル自身のＨＰが40％を切ると、　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304800, "レイスロード", 304800, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】強者の魂を幽鬼とし従える、冥府の高官。\n亡者の念が刃に絡みつき、動きを鈍らせる。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵の挑発を無視して、最\n　も物理攻撃力が高い敵１キャラと最も魔法攻撃\n　力が高い敵１キャラに魔法大ダメージ。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・前方範囲内の敵すべてに魔法中ダメージを与え、\n　さらに物理攻撃力と行動速度を大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304801, "レイスロード", 304801, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】強者の魂を幽鬼とし従える、冥府の高官。\n亡者の念が刃に絡みつき、動きを鈍らせる。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を中アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵の挑発を無視して、最\n　も物理攻撃力が高い敵１キャラと最も魔法攻撃\n　力が高い敵１キャラに魔法大ダメージ。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・前方範囲内の敵すべてに魔法中ダメージを与え、\n　さらに物理攻撃力と行動速度を大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304802, "ソウルイーター", 304802, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】塔の魔力で蘇り、生命のマナを求め彷徨\nう悪霊。幽鬼の念を纏う大鎌を振るい、無差別に\n生者の魂を刈る。\n\n・前方範囲内に魔法大ダメージを与え、物理\n　攻撃力を特大ダウンさせる。\n・前方範囲内に魔法中ダメージを与える。\n　物理攻撃をする敵には追加の魔法ダメージを\n　与え、さらに行動速度をダウンさせる。\n・前方範囲内に物理中ダメージを与え、\n　ステータスアップ効果を解除させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (304900, "エレクトロ・ギガス", 304900, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ルナの魔力で目覚めた、巨腕の改造人間。\n小型リアクターの最大出力は自身が感電するほど。\n\n・前方範囲内の敵に物理大ダメージ＆麻痺。\n　自身のステータスアップ効果を解除し、\n　物理防御力と魔法防御力を中ダウン。\n・敵全体に魔法大ダメージを与え、\n　自身の物理攻撃力を長時間大アップ。\n・味方全体の行動速度を大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305000, "ジャック・オー・プリン", 305000, 0, 16, 270, 1000, 1, 0.8, 0, 0, 0, "【物理】人間への復讐を企む、霊界の住人。\n「オイラはジャック！ジャック・オー・プリン！\n　遊んでくれなきゃ、イタズラしちゃうぞ～」\n\n・敵全体に物理大ダメージを与え、\n　キャラのＨＰが40%を切っている場合、\n　誘惑状態にする。\n・敵全体に魔法小ダメージを与え、\n　キャラのステータスアップ効果を解除。\n・最も近い敵に物理中ダメージを与え、\n　さらに、前から3キャラに、物理中\n　ダメージ＆スタン。\n・ジャック・オー・プリン自身のＨＰが\n　40％を切ると、さらに攻撃が激しく\n　凶暴になる。\n");
