INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305100, "メガラパーン", 305100, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】巨体を駆使して暴れ回る大ウサギの魔物。\n繰り出す一撃は消耗が大きく、持てあまし気味。\n\n・ユニオンバーストは敵全体に物理大ダメージ\n　を与え、さらにノックバックさせる。\n　その後、目を回している間、自身の物理防御\n　力と魔法防御力が大幅にダウン。\n・敵全体に物理中ダメージを与え、さらに前方\n　範囲内の敵をスタンさせる。\n　このスキルの状態異常はダメージを無効化し\n　ても付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305101, "メガラパーン", 305100, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】巨体を駆使して暴れまわる\n大ウサギの魔物。繰り出す一撃は\n消耗が大きく、持てあまし気味。\n\n・敵全体に物理大ダメージを与え、\n　さらにノックバックさせる。\n　その後、目を回している間、\n　自身の物理防御力と魔法防御力が\n　大幅にダウン。\n\n・敵全体に物理中ダメージを与え、\n　さらに前方範囲内の敵をスタン\n　させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305102, "メガラパーン", 305102, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】巨体を駆使して暴れ回る大ウサギの魔物。\n繰り出す一撃は消耗が大きく、持てあまし気味。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に物理大ダメージ\n　を与え、さらにノックバックさせる。\n　目を回している間、自身の物理防御力と魔法防\n　御力を特大ダウン。\n　その後、自身の物理防御力と魔法防御力を小ダ\n　ウン。\n　このスキルの状態異常はダメージを無効化し\n　ても付与される。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・敵全体に物理中ダメージを与え、さらに前方\n　範囲内の敵をスタンさせる。\n　その後、自身のＴＰを中回復。\n　このスキルの状態異常はダメージを無効化し\n　ても付与される。\n・通常攻撃は先頭のキャラに物理大ダメージを\n　与え、さらにノックバックさせる。\n　このスキルの状態異常はダメージを無効化し\n　ても付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305200, "オラム", 305200, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古に生み出された、防衛兵器。\n悪党の謀により悠久の眠りに終焉を告げる。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与えたのち、\n　自身の物理攻撃力を大ダウン。\n・前方中範囲内の敵に物理中ダメージを与え、\n　物理攻撃力を大ダウン。\n・前方広範囲内の敵に物理中ダメージを与え、\n　麻痺状態にする。\n　キャラのＨＰが70％以下の場合、\n　麻痺の効果時間が長くなる。\n・オラム自身のＨＰが40％を切ると、　\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305201, "オラム", 305200, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古に生み出された、防衛兵器。\n悪党の謀により悠久の眠りに終焉を告げる。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与えたのち、\n　自身の物理攻撃力を大ダウン。\n・前方中範囲内の敵に物理中ダメージを与え、\n　物理攻撃力を大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305202, "オラム", 305200, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古に生み出された、防衛兵器。\n悪党の謀により悠久の眠りに終焉を告げる。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与えたのち、\n　自身の物理攻撃力を大ダウン。\n・前方中範囲内の敵に物理中ダメージを与え、\n　物理攻撃力を大ダウン。\n・前方広範囲内の敵に物理中ダメージを与え、\n　麻痺状態にする。\n　キャラのＨＰが70％以下の場合、\n　麻痺の効果時間が長くなる。\n・オラム自身のＨＰが40％を切ると、　\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305203, "オラム", 305200, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古に生み出された、防衛兵器。\n悪党の謀により悠久の眠りに終焉を告げる。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与えたのち、\n　自身の物理攻撃力を大ダウン。\n・前方中範囲内の敵に物理中ダメージを与え、\n　物理攻撃力を大ダウン。\n・前方広範囲内の敵に物理中ダメージを与え、\n　麻痺状態にする。\n　キャラのＨＰが70％以下の場合、\n　麻痺の効果時間が長くなる。\n・オラム自身のＨＰが40％を切ると、　\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305204, "カース・オラム", 305204, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ルナの塔の魔力で暴走する、古代兵器。\n古き守護の力は、呪いを振りまく大禍と化した。\n\n・敵全体に物理大ダメージを与え、自身の\n　物理防御力と魔法防御力を大ダウンさせる。\n・前方１キャラを中心にした範囲内の敵すべてに\n　物理中ダメージを与え、物理防御力を中ダウン\n　させる。さらにスタンを与える。\n・敵全体に物理中ダメージを与え、呪い状態\n　にする。キャラのＨＰが40％以下の場合、\n　呪いのダメージが２倍になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305205, "オラム", 305205, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古に生み出された、防衛兵器。\n悪党の謀により悠久の眠りに終焉を告げる。\n\n・ユニオンバーストは、敵全体にキャラの\n最大ＨＰに応じた物理大ダメージを与えた\nのち、自身の物理攻撃力を大ダウン。\n・前方中範囲内の敵に物理中ダメージを与え、\n　物理攻撃力を大ダウン。\n・前方広範囲内の敵に物理中ダメージを与え、\n　麻痺状態にする。\n　キャラのＨＰが70％以下の場合、\n　麻痺の効果時間が長くなる。\n・オラム自身のＨＰが40％を切ると、　\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305206, "オラム", 305205, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古に生み出された、防衛兵器。\n悪党の謀により悠久の眠りに終焉を告げる。\n\n・ユニオンバーストは、自身の物理攻撃力を\n　大ダウンしたのち、敵全体にキャラの最大\n　ＨＰに応じた物理大ダメージを与える。\n・前方中範囲内の敵に物理大ダメージを与え、\n　物理攻撃力を大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305207, "オラム", 305205, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古に生み出された、防衛兵器。\n悪党の謀により悠久の眠りに終焉を告げる。\n\n・ユニオンバーストは、自身の物理攻撃力を\n　大ダウンしたのち、敵全体にキャラの最大\n　ＨＰに応じた物理大ダメージを与える。\n・前方中範囲内の敵に物理大ダメージを与え、\n　物理攻撃力を大ダウン。\n・前方広範囲内の敵に物理大ダメージを与え、\n　麻痺状態にする。\n　キャラのＨＰが70％以下の場合、\n　麻痺の効果時間が長くなる。\n・オラム自身のＨＰが40％を切ると、　\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305208, "オラム", 305205, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古に生み出された、防衛兵器。\n悪党の謀により悠久の眠りに終焉を告げる。\n\n・ユニオンバーストは、自身の物理攻撃力を\n　大ダウンしたのち、敵全体にキャラの最大\n　ＨＰに応じた物理大ダメージを与える。\n・前方中範囲内の敵に物理大ダメージを与え、\n　物理攻撃力を大ダウン。\n・前方広範囲内の敵に物理大ダメージを与え、\n　麻痺状態にする。\n　キャラのＨＰが70％以下の場合、\n　麻痺の効果時間が長くなる。\n・オラム自身のＨＰが40％を切ると、　\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305300, "ハイ・ガルグ", 305300, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ルナの魔力を帯び変異した獰猛な魔獣。\n強靭な歯牙は歴戦の冒険者さえ容易く切り裂く。\n\n・ユニオンバーストは敵全体に物理大ダメージを\n　与え、さらに自分のＨＰを回復する。\n・後方範囲内の敵に物理ダメージを与え、スタン\n　させる。\n　さらに敵全体の物理防御力を中ダウンさせる。\n・前方範囲内の敵に物理ダメージを与え、毒状態\n　にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305301, "アイスガルグ", 305301, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】雪山に棲む獰猛な魔狼。\n強靭な歯牙は歴戦の冒険者さえ\n容易く氷塊の墓標へ変える。\n\n・ユニオンバーストは敵全体に物\n　理大ダメージを与える。\n\n・一番後ろの敵キャラを中心とし\n　て、範囲内の敵すべてに物理小\n　ダメージを与え、スタンさせる。\n　さらに敵全体の物理防御力を中\n　ダウンさせる。\n\n・前方範囲内の敵すべてに物理小\n　ダメージを与え、毒状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305302, "アイスガルグ", 305301, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】雪山に棲む獰猛な魔狼。\n強靭な歯牙は歴戦の冒険者さえ\n容易く氷塊の墓標へ変える。\n\n・ユニオンバーストは敵全体に物\n　理大ダメージを与える。\n\n・一番後ろの敵キャラを中心とし\n　て、範囲内の敵すべてに物理小\n　ダメージを与え、スタンさせる。\n　さらに敵全体の物理防御力を中\n　ダウンさせる。\n\n・前方範囲内の敵すべてに物理小\n　ダメージを与え、毒状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305400, "アイスホーン", 305400, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】強力な氷の頭突きで\n堅牢な盾も貫き穿つ一角獣。\n氷丘押し寄せる北の果てで、\n冒険者を氷獄へ突き落す。\n\n・敵全体に魔法大ダメージを与え、\n　魔法防御力を下げる。\n　さらに、味方全体のＴＰ上昇率を\n　上げる。\n\n・前方小範囲内に魔法小ダメージを\n　与え、氷結状態にする。さらに、\n　全体に魔法小ダメージを与え、\n　前方3キャラを小さく\n　吹き飛ばす。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305500, "フォギー", 305500, 0, 16, 270, 2160, 2, 3.0, 0, 0, 0, "【魔法】幾多の伝承に名を残す、記憶の大精霊。\n霧の如く実態を持たず、全て覆い隠してしまう。\n\n・ユニオンバーストは敵全体に\n　魔法大ダメージを与え、\n　さらに敵が呪い状態の場合、\n　ダメージがアップする。\n・敵全体に魔法中ダメージを与える。\n　さらに呪い状態にする。\n・分身体（紫）（赤）（青）のうち、\n　いずれか1体を召喚する。\n　召喚する際は敵全体をノックバックさせる。\n・【物理】分身体（紫）は、自身に物理/魔法\n　吸収バリアを展開する。\n・【物理】分身体（赤）は、敵全体に\n　魔法中ダメージを与える。\n・【物理】分身体（青）は、敵全体に\n　魔法中ダメージ。\n　さらに、呪い状態にする。\n　分身体（青）のＨＰが30％以下になった時、\n　フォギーのＴＰを300回復させる。\n・フォギー自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305501, "フォギー", 305500, 0, 16, 270, 2160, 2, 3.0, 0, 0, 0, "【魔法】幾多の伝承に名を残す、記憶の大精霊。\n霧の如く実態を持たず、全て覆い隠してしまう。\n\n・ユニオンバーストは敵全体に\n　魔法大ダメージを与え、\n　さらに敵が呪い状態の場合、\n　ダメージがアップする。\n・敵全体に魔法中ダメージを与え、\n　さらに呪い状態にする。\n・分身体（紫）（赤）のうち、どちらか1体を\n　召喚する。\n　召喚する際は敵全体をノックバックさせる。\n・【物理】分身体（紫）は、自身に物理/魔法\n　吸収バリアを展開する。\n・【物理】分身体（赤）は、敵全体に\n　魔法中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305502, "フォギー", 305500, 0, 16, 270, 2160, 2, 3.0, 0, 0, 0, "【魔法】幾多の伝承に名を残す、記憶の大精霊。\n霧の如く実態を持たず、全て覆い隠してしまう。\n\n・ユニオンバーストは敵全体に\n　魔法大ダメージを与え、\n　さらに敵が呪い状態の場合、\n　ダメージがアップする。\n・敵全体に魔法中ダメージを与え、\n　さらに呪い状態にする。\n・分身体（紫）（赤）のうち、どちらか1体を\n　召喚する。\n　召喚する際は敵全体をノックバックさせる。\n・【物理】分身体（紫）は、自身に物理/魔法\n　吸収バリアを展開する。\n・【物理】分身体（赤）は、敵全体に\n　魔法中ダメージを与える。\n・フォギー自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305503, "フォギー", 305500, 0, 16, 270, 2160, 2, 3.0, 0, 0, 0, "【魔法】幾多の伝承に名を残す、記憶の大精霊。\n霧の如く実態を持たず、全て覆い隠してしまう。\n\n・ユニオンバーストは敵全体に\n　魔法大ダメージを与え、\n　さらに敵が呪い状態の場合、\n　ダメージがアップする。\n・敵全体に魔法中ダメージを与える。\n　さらに呪い状態にする。\n・分身体（紫）（赤）（青）のうち、\n　いずれか1体を召喚する。\n　召喚する際は敵全体をノックバックさせる。\n・【物理】分身体（紫）は、自身に物理/魔法\n　吸収バリアを展開する。\n・【物理】分身体（赤）は、敵全体に\n　魔法中ダメージを与える。\n・【物理】分身体（青）は、敵全体に\n　魔法中ダメージ。\n　さらに、呪い状態にする。\n　分身体（青）のＨＰが30％以下になった時、\n　フォギーのＴＰを300回復させる。\n・フォギー自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305504, "フォギー", 305500, 0, 16, 270, 2160, 2, 3.0, 0, 0, 0, "【魔法】幾多の伝承に名を残す、記憶の大精霊。\n霧の如く実体を持たず、全て覆い隠してしまう。\n\n・ユニオンバーストは敵全体に\n　魔法大ダメージを与え、\n　さらに敵が呪い状態の場合、\n　ダメージがアップする。\n・敵全体に魔法大ダメージを与える。\n　さらに呪い状態にする。\n・分身体（紫）（赤）（青）のうち、\n　いずれか1体を召喚する。\n　召喚する際は敵全体をノックバックさせる。\n・【物理】分身体（紫）は、自身に物理/魔法\n　吸収バリアを展開する。\n・【物理】分身体（赤）は、敵全体に\n　魔法中ダメージを与える。\n・【物理】分身体（青）は、敵全体に\n　魔法中ダメージ。\n　さらに、呪い状態にする。\n　分身体（青）のＨＰが30％以下になった時、\n　フォギーのＴＰを300回復させる。\n・フォギー自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305505, "フォギー", 305500, 0, 16, 270, 2160, 2, 3.0, 0, 0, 0, "【魔法】幾多の伝承に名を残す、記憶の大精霊。\n霧の如く実体を持たず、全て覆い隠してしまう。\n\n・ユニオンバーストは敵全体に\n　魔法中ダメージを与え、\n　さらに敵が呪い状態の場合、\n　ダメージがアップする。\n・敵全体に魔法小ダメージを与え、\n　さらに呪い状態にする。\n・分身体（紫）（赤）のうち、どちらか1体を\n　召喚する。\n　召喚する際は敵全体をノックバックさせる。\n・【物理】分身体（紫）は、自身に物理/魔法\n　吸収バリアを展開する。\n・【物理】分身体（赤）は、敵全体に\n　魔法大ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305506, "フォギー", 305500, 0, 16, 270, 2160, 2, 3.0, 0, 0, 0, "【魔法】幾多の伝承に名を残す、記憶の大精霊。\n霧の如く実体を持たず、全て覆い隠してしまう。\n\n・ユニオンバーストは敵全体に\n　魔法中ダメージを与え、\n　さらに敵が呪い状態の場合、\n　ダメージがアップする。\n・敵全体に魔法小ダメージを与え、\n　さらに呪い状態にする。\n・分身体（紫）（赤）のうち、どちらか1体を\n　召喚する。\n　召喚する際は敵全体をノックバックさせる。\n・【物理】分身体（紫）は、自身に物理/魔法\n　吸収バリアを展開する。\n・【物理】分身体（赤）は、敵全体に\n　魔法大ダメージを与える。\n・フォギー自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305507, "フォギー", 305500, 0, 16, 270, 2160, 2, 3.0, 0, 0, 0, "【魔法】幾多の伝承に名を残す、記憶の大精霊。\n霧の如く実体を持たず、全て覆い隠してしまう。\n\n・ユニオンバーストは敵全体に\n　魔法大ダメージを与え、\n　さらに敵が呪い状態の場合、\n　ダメージがアップする。\n・敵全体に魔法大ダメージを与える。\n　さらに呪い状態にする。\n・分身体（紫）（赤）（青）のうち、\n　いずれか1体を召喚する。\n　召喚する際は敵全体をノックバックさせる。\n・【物理】分身体（紫）は、自身に物理/魔法\n　吸収バリアを展開する。\n・【物理】分身体（赤）は、敵全体に\n　魔法大ダメージを与える。\n・【物理】分身体（青）は、敵全体に\n　物理小ダメージ。\n　さらに、呪い状態にする。\n　分身体（青）のＨＰが30％以下になった時、\n　フォギーのＴＰを300回復させる。\n・フォギー自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305508, "ミストシーカー", 305508, 0, 16, 270, 1000, 2, 3.0, 0, 0, 0, "【魔法】塔の魔力を帯びた霧が実体化した魔物。\n怨嗟を振りまき、分身とともに冒険者を付け狙う。\n\n・敵全体に魔法大ダメージを与える。\n　敵が呪い状態の場合、ダメージがアップし、呪\n　詛状態の場合、さらにダメージがアップする。\n・敵全体に魔法中ダメージを与える。\n　敵が呪い状態の場合、呪詛状態にする。さらに、\n　ミストシーカー自身のＨＰが80％未満の場合、\n　物理攻撃力と魔法攻撃力を短時間大ダウンさせ\n　る。\n・分身体を召喚する。\n　召喚する際は敵全体をノックバックさせる。\n・分身体は、敵全体に物理中ダメージを\n　与え、さらに呪い状態にする。\n・分身体のＨＰが30％以下になった時、最も魔\n　法攻撃力が高い味方１キャラのＴＰを1000\n　回復させる。\n・ミストシーカー自身のＨＰが80％を切ると、\n　さらに攻撃が激しく狂暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305600, "ロード・イビリィ", 305600, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ルナの魔力欲しさに現れた異界の魔物。\n魔眼と従えた兵で、ルナの塔の征服を目論む。\n\n・敵全体に魔法大ダメージを与え、\n　さらに敵全体の魔法防御力を中ダウンさせる。\n・6回、ランダムで1キャラに魔法小ダメージ\n　を与える。\n・後ろから3番目のキャラに魔法中ダメージと、\n　長時間の拘束を与える。\n　さらに全体に魔法小ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305700, "ゴブリングレート", 305700, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】豪快に戦斧を振るう熟練のゴブリン戦士。\n幼き戦士を脇に抱え、魂の技を見せ付ける。\n\n・ユニオンバーストは、自身の物理攻撃力を中\n　アップ、物理防御力を小アップさせ、さらに\n　目の前の１キャラに物理特大ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305701, "ゴブリングレート", 305701, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "豪快に戦斧を振り回す、熟練のゴブリン戦士。\n幼き戦士を脇に抱え、魂の技を見せ付ける。\n\n・ユニオンバーストは、自身の物理攻撃力を中\n　アップ、物理防御力を小アップさせ、さらに\n　目の前の１キャラに物理特大ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305702, "ゴブリングレート", 305702, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】豪快に戦斧を振るう熟練のゴブリン戦士。\n幼き戦士を脇に抱え、魂の技を見せ付ける。\n\n・ユニオンバーストは、自身の物理攻撃力を中\n　アップ、物理防御力を小アップさせる。\n　さらに目の前の１キャラに物理特大ダメージを\n　与え、スタンさせる。\n・目の前の１キャラに物理特大ダメージを与え、\n　スタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305703, "蛮族のリーダー", 305703, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】屈強な体と心で砂漠を\n生き抜く蛮族の戦士。我が幼子を\n守るため、戦斧を振るい続ける。\n\n・ユニオンバーストは、自身の物理\n　攻撃力を中アップ、物理防御力を\n　小アップさせる。\n　さらに目の前の１キャラに物理特\n　大ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305800, "ネプテリオン", 305800, 0, 16, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】海神の使者で、不思議な軟体の魔物。\n身体のほとんどは魔力を帯びた海水だとか。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ネプテリオンから受けるすべてのダメージで発\n　生する、パーティキャラのＴＰ回復量を小ダウ\n　ンさせる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、行動速度\n　を特大ダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から２番目のキャラに魔法特大ダメージを与\n　え行動速度特大ダウン、前から３番目のキャラ\n　に魔法大ダメージを与え行動速度特大ダウン。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から２番目のキャラを中心にした範囲に、物\n　理攻撃力と魔法攻撃力を大ダウンさせ、継続魔\n　法小ダメージを与えるフィールドを展開。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305801, "カムツカイ", 305801, 0, 16, 270, 1000, 2, 2.6, 0, 0, 0, "【魔法】ルナの塔で暴れ回る海獣。太古の海神に\n仕えるが、今や大義なき破壊者となり果てる。\n\n・敵全体に魔法ダメージを与える。\n・一定範囲に、物理攻撃力と魔法防御力を\n　ダウンさせ、継続魔法ダメージを与える\n　フィールドを展開する。\n・前から２番目と３番目のキャラに\n　魔法大ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305802, "ネプテリオン", 305802, 0, 16, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】海神に仕える奇体な魔物。\n水域の平穏を脅かす侵入者を見るや\n神使いの力を行使し、一掃する。\n\n・敵全体に魔法大ダメージ。\n\n・前から２番目のキャラに魔法特大\n　ダメージ、前から３番目のキャラ\n　に魔法中ダメージ。\n\n・一定範囲に、魔法防御力をダウン\n　させ、継続魔法ダメージを与える\n　フィールドを展開。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305900, "マダムプリズム", 305900, 0, 16, 270, 1000, 1, 2.2, 0, 0, 0, "【物理】圧倒的な魅力を放つ麗しき極彩色の艶鳥。\nその色香に囚われれば、味方を襲う下僕となる。\n\n・ユニオンバーストは、誘惑状態のキャラを除\n　き、敵全体に物理大ダメージ。\n・前から２キャラに魔法小ダメージと誘惑状態\n　を与え、その後さらに物理攻撃力と魔法攻撃\n　力を大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (305901, "マダムプリズム", 305901, 0, 16, 270, 1000, 1, 2.2, 0, 0, 0, "【物理】圧倒的な魅力を放つ麗しき極彩色の艶鳥。\nその色香に囚われれば、味方を襲う下僕となる。\n\n・ユニオンバーストは、誘惑状態のキャラを除き、\n　敵全体に物理大ダメージ。\n　さらに、敵全体に誘惑状態を付与する。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から２キャラに魔法小ダメージと誘惑状態を\n　与え、その後さらに物理攻撃力と魔法攻撃力を\n　大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306000, "邪餅神ガミィ", 306000, 0, 16, 270, 2160, 1, 1.6, 0, 0, 0, "【物理】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・ユニオンバーストは敵全体に\n　物理大ダメージを与える。\n・前方3キャラに魔法中ダメージを与え、\n　物理攻撃力を下げる。\n・時限式の爆弾モチを前方中距離に召喚する。\n・爆弾モチは、召喚されてから\n　8秒後に大爆発し、範囲内の敵全体に\n　物理中ダメージを与える。\n　ただし、爆発するまでに爆弾モチ自身の\n　ＨＰが50％を切ると、\n　敵全体のＨＰを小回復し、消滅する。\n・邪餅神ガミィ自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306001, "邪餅神ガミィ", 306000, 0, 16, 270, 2160, 1, 1.6, 0, 0, 0, "【物理】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・ユニオンバーストは敵全体に\n　物理大ダメージを与える。\n・前方3キャラに魔法中ダメージを与え、\n　物理攻撃力を下げる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306002, "邪餅神ガミィ", 306000, 0, 16, 270, 2160, 1, 1.6, 0, 0, 0, "【物理】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・ユニオンバーストは敵全体に\n　物理大ダメージを与える。\n・前方3キャラに魔法中ダメージを与え、\n　物理攻撃力を下げる。\n・時限式の爆弾モチを前方中距離に召喚する。\n・爆弾モチは、召喚されてから\n　8秒後に大爆発し、範囲内の敵全体に\n　物理中ダメージを与える。\n　ただし、爆発するまでに爆弾モチ自身の\n　ＨＰが50％を切ると、\n　敵全体のＨＰを小回復し、消滅する。\n・邪餅神ガミィ自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306003, "邪餅神ガミィ", 306000, 0, 16, 270, 2160, 1, 1.6, 0, 0, 0, "【物理】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・ユニオンバーストは敵全体に\n　物理大ダメージを与える。\n・前方3キャラに魔法中ダメージを与え、\n　物理攻撃力を下げる。\n・時限式の爆弾モチを前方中距離に召喚する。\n・爆弾モチは、召喚されてから\n　8秒後に大爆発し、範囲内の敵全体に\n　物理中ダメージを与える。\n　ただし、爆発するまでに爆弾モチ自身の\n　ＨＰが50％を切ると、\n　敵全体のＨＰを小回復し、消滅する。\n・邪餅神ガミィ自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306004, "邪餅神ガミィ", 306004, 0, 16, 270, 3000, 1, 0.0, 0, 0, 0, "【MODE1】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・邪餅神ガミィ自身が攻撃を受けると、\n　味方全体のＨＰを小回復し、\n　邪餅神ガミィ自身のＨＰを全回復する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306005, "邪餅神ガミィ", 306005, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【MODE2】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・前方1キャラに物理ダメージを与える。\n・前方範囲内に魔法中ダメージを与え、\n　大きく吹き飛ばす。\n・6個の邪念を込めてボンノウ（赤）を召喚する。\n・3個の邪念を込めてボンノウ（紫）を召喚する。\n・1個の邪念を込めてボンノウ（青）を召喚する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306006, "邪餅神ガミィ", 306006, 0, 16, 270, 2160, 1, 1.6, 0, 0, 0, "【MODE3】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・前方1キャラに物理ダメージを与える。\n・ユニオンバーストは敵全体に\n　物理大ダメージを与える。\n・前方3キャラに魔法中ダメージを与え、\n　物理攻撃力を下げる。\n・時限式の爆弾モチを前方中距離に召喚する。\n・爆弾モチは、召喚されてから\n　8秒後に大爆発し、範囲内の敵全体に\n　物理中ダメージを与える。\n　ただし、爆発するまでに爆弾モチ自身の\n　ＨＰが50％を切ると、\n　敵全体のＨＰを小回復し、消滅する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306007, "邪餅神ガミィ", 306000, 0, 16, 270, 2160, 1, 1.6, 0, 0, 0, "【物理】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・ユニオンバーストは敵全体に\n　キャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・前方３キャラに魔法中ダメージを与え、\n　物理攻撃力を小ダウンさせる。\n・時限式の爆弾モチを前方中距離に召喚する。\n・爆弾モチは、召喚されてから\n　８秒後に大爆発し、範囲内の敵すべてに\n　物理中ダメージを与える。\n　ただし、爆発するまでに爆弾モチ自身の\n　ＨＰが50％を切ると、\n　敵全体のＨＰを小回復し、消滅する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306008, "邪餅神ガミィ", 306000, 0, 16, 270, 2160, 1, 1.6, 0, 0, 0, "【物理】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・ユニオンバーストは敵全体に\n　キャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・前方３キャラに魔法中ダメージを与え、\n　物理攻撃力を小ダウンさせる。\n・時限式の爆弾モチを前方中距離に召喚する。\n・爆弾モチは、召喚されてから\n　８秒後に大爆発し、範囲内の敵すべてに\n　物理中ダメージを与える。\n　ただし、爆発するまでに爆弾モチ自身の\n　ＨＰが50％を切ると、\n　敵全体のＨＰを小回復し、消滅する。\n・邪餅神ガミィ自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306009, "邪餅神ガミィ", 306000, 0, 16, 270, 2160, 1, 1.6, 0, 0, 0, "【物理】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・ユニオンバーストは敵全体に\n　キャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・前方３キャラに魔法中ダメージを与え、\n　物理攻撃力を小ダウンさせる。\n・時限式の爆弾モチを前方中距離に召喚する。\n・爆弾モチは、召喚されてから\n　８秒後に大爆発し、範囲内の敵すべてに\n　物理大ダメージを与える。\n　ただし、爆発するまでに爆弾モチ自身の\n　ＨＰが50％を切ると、\n　敵全体のＨＰを小回復し、消滅する。\n・邪餅神ガミィ自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306010, "邪餅神ガミィ", 306000, 0, 16, 270, 2160, 1, 1.6, 0, 0, 0, "【物理】邪念の残滓が群集し邪神と化した。\n顕現した煩悩を全て浄化し、新年を迎えよう！\n\n・ユニオンバーストは敵全体に\n　キャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・前方３キャラに魔法中ダメージを与え、\n　物理攻撃力を下げる。\n・時限式の爆弾モチを前方中距離に召喚する。\n・爆弾モチは、召喚されてから\n　８秒後に大爆発し、範囲内の敵全体に\n　物理中ダメージを与える。\n　ただし、爆発するまでに爆弾モチ自身の\n　ＨＰが50％を切ると、\n　敵全体のＨＰを小回復し、消滅する。\n・邪餅神ガミィ自身のＨＰが\n　60％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306100, "ジャッカルシーフ", 306100, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】闇に紛れ、人里で盗みを\nはたらく魔物の頭目。\nくすねたエモノを容赦なく投げつけ\n開拓の邪魔をするならず者。\n\n・前方３キャラに物理中ダメージを\n　与え、麻痺させる。\n\n・敵全体に物理小ダメージを与え、\n　行動速度を下げる。\n　さらに、前方小範囲を毒状態\n　にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306101, "ジャッカルシーフ", 306101, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】闇に紛れ、人里で盗みを働く魔物の頭目。\nくすねたエモノを器用に使って戦う、ならず者。\n\n・前方３キャラに物理中ダメージを与え、麻痺さ\n　せる。\n・敵全体に物理小ダメージを与え、行動速度をダ\n　ウンさせる。\n　さらに、前方小範囲を毒状態にする。\n　このスキルの毒はダメージを無効化しても付与\n　される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306102, "ジャッカルシーフ", 306102, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】闇に紛れ、人里で盗みを働く魔物の頭目。\nくすねたエモノを器用に使って戦う、ならず者。\n\n・前方３キャラに物理中ダメージを与え、麻痺さ\n　せる。\n・敵全体に物理小ダメージを与え、行動速度をダ\n　ウンさせる。\n　さらに、前方小範囲を毒状態にする。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n　このスキルによるダメージでは、ＴＰが回復し\n　ない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306200, "マスター・センリ", 306200, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】森奥に座し、周辺一帯を\n手下と共に支配する老獪な大狸。\nありもしない幻を見せ、精神を蝕む\n幻影攻撃を巧みに操る。\n\n・敵全体に魔法中ダメージを与え、\n　ワッパダヌキ２体を召喚する。\n\n・敵全体に魔法小ダメージを与え、\n　無敵状態でない召喚モンスターを\n　消滅させる。\n　さらに敵のＨＰが40％以下の\n　場合、麻痺状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306201, "マスター・センリ", 306201, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】森奥に座し、一帯を支配する老獪な大狸。\n口寄せした子狸との多彩な連携で敵を惑わせる。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法中ダメージ\n　を与え、ワッパダヌキ２体を召喚する。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・敵全体に魔法小ダメージを与え、ノックバック\n　し、無敵状態でないワッパダヌキを消滅させる。\n　さらに敵のＨＰが50％未満の場合、麻痺状態\n　を付与する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306202, "マスター・センリ", 306202, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】森奥に座し、一帯を支配する老獪な大狸。\n口寄せした子狸との多彩な連携で敵を惑わせる。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法中ダメージ\n　を与え、ワッパダヌキ２体を召喚する。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・敵全体に魔法小ダメージを与え、ノックバック\n　し、無敵状態でないワッパダヌキを消滅させる。\n　さらに敵のＨＰが50％未満の場合、麻痺状態\n　を付与する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306203, "マスター・センリ", 306203, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】森奥に座し、一帯を支配する老獪な大狸。\n口寄せした子狸との多彩な連携で敵を惑わせる。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法中ダメージ\n　を与え、ワッパダヌキ２体を召喚する。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・敵全体に魔法小ダメージを与え、ノックバック\n　し、無敵状態でないワッパダヌキを消滅させる。\n　さらに敵のＨＰが50％未満の場合、麻痺状態\n　を付与する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306204, "マスター・センリ", 306204, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】森奥に座し、一帯を支配する老獪な大狸。\n口寄せした子狸との多彩な連携で敵を惑わせる。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、敵全体に魔法中ダメージ\n　を与え、ワッパダヌキ２体を召喚する。\n　このスキルによるダメージでは、敵のＴＰが回\n　復しない。\n・敵全体に魔法小ダメージを与え、ノックバック\n　し、無敵状態でないワッパダヌキを消滅させる。\n　さらに敵のＨＰが50％未満の場合、麻痺状態\n　を付与する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306300, "マスター・ウキキー", 306300, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ルナの魔力を使いウキキーを統べる仙猿。\n宝武具の棍を自在に操り、すべての敵をなぎ払う。\n\n・敵全体に物理大ダメージを与える。\n　この攻撃は火傷状態の敵に対して、\n　ダメージが1.8倍になる。\n・前方中範囲の敵に物理中ダメージを与える。\n・前方小範囲の敵に魔法中ダメージを与え、\n　火傷状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306301, "マスター・ウキキー", 306301, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ルナの魔力を使いウキキーを統べる仙猿。\n宝武具の棍を自在に操り、すべての敵をなぎ払う。\n\n・敵全体に物理大ダメージを与え、\n　さらに物理攻撃キャラの物理攻撃力を下げる。\n　この攻撃は火傷状態の敵に対して、\n　ダメージが1.8倍になる。\n・前方中範囲の敵に物理中ダメージを与える。\n・前方小範囲の敵に魔法中ダメージを与え、\n　火傷状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306400, "ワイルドクロウ", 306400, 0, 16, 270, 1000, 1, 3.5, 0, 0, 0, "【物理】荒れ山の捕食者として君臨\nする、凶悪な怪鳥獣。\n狩りを続けることでつくりあげた\n膂力と剛爪が、侵入者をつけ狙う。\n\n・敵全体に物理大ダメージを与え、\n　ＴＰ上昇をダウンさせる。\n　発動するたびにダメージがアップ\n　する。この効果は最大３回まで\n　累積する。\n\n・後ろから２番目の敵を中心にした\n　小範囲に物理小ダメージを与え、\n　麻痺状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306500, "トライバルオーク", 306500, 0, 16, 270, 1000, 1, 0.9, 0, 0, 0, "【物理】辺境の森のオークたちの\n首魁。独自の民族性の奇怪な\nリズムを撒き散らす。その怪音は、\n敵対者を混迷の渦に突き落とす。\n\n・敵全体に物理大ダメージを与え、\n　物理防御力と魔法防御力をダウン\n　さらに自身の物理攻撃力と\n　魔法攻撃力をアップする。\n\n・前方４キャラに魔法小ダメージを\n　与え、敵のＨＰが70％以下の\n　場合、混乱状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306501, "ノイジーオーク", 306501, 0, 16, 270, 1000, 1, 0.9, 0, 0, 0, "【物理】ルナの塔の力に魅せられたオークの首魁。\n奇怪なリズムの太鼓で、戦場に騒乱を引き起こす。\n\n・敵全体に物理大ダメージを与え、物理防御力と\n　魔法防御力をダウンさせる。さらに、自分の\n　物理攻撃力と魔法攻撃力をアップさせる。\n・前方３キャラに魔法小ダメージを与え、\n　小さく吹き飛ばす。敵のＨＰが70％未満の\n　場合、混乱状態にする。\n・敵全体に残りＨＰに応じた魔法大ダメージを\n　与え、行動速度をダウンさせる。\n　さらに、敵全体のステータスアップ効果を\n　解除する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306600, "ベノムサラマンドラ", 306600, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】獲物を求め水辺を猛毒\nで満たす、サンショウウオの魔物。\n漏れるほどに溜め込んだ猛毒は、\n近づくだけで意識を奪う危険物。\n\n・敵全体に魔法中ダメージを与え、\n　毒状態にする。\n　さらに猛毒状態にする。\n\n・前方範囲内の敵に\n　魔法小ダメージを与え、\n　猛毒状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306700, "アグリーラブリー", 306700, 0, 16, 270, 2160, 1, 1.8, 0, 0, 0, "【物理】悪罵で暴走した、巨大なチョコの魔物。\nささやく愛も誤れば、人を傷つける刃と化す。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージを与え、\n　火傷状態の場合は、さらに追加ダメージ。\n・前方3キャラに物理中ダメージを与え、スタン\n　させる。\n　さらにキャラのＨＰが50％以下の場合、\n　火傷状態にする。\n・アグリーラブリー自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306701, "アグリーラブリー", 306700, 0, 16, 270, 2160, 1, 1.8, 0, 0, 0, "【物理】悪罵で暴走した、巨大なチョコの魔物。\nささやく愛も誤れば、人を傷つける刃と化す。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージを与え、\n　火傷状態の場合は、さらに追加ダメージ。\n・前方3キャラに物理中ダメージを与え、スタン\n　させる。\n　さらにキャラのＨＰが50％以下の場合、\n　火傷状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306702, "アグリーラブリー", 306700, 0, 16, 270, 2160, 1, 1.8, 0, 0, 0, "【物理】悪罵で暴走した、巨大なチョコの魔物。\nささやく愛も誤れば、人を傷つける刃と化す。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージを与え、\n　火傷状態の場合は、さらに追加ダメージ。\n・前方3キャラに物理中ダメージを与え、スタン\n　させる。\n　さらにキャラのＨＰが50％以下の場合、\n　火傷状態にする。\n・アグリーラブリー自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306703, "アグリーラブリー", 306700, 0, 16, 270, 2160, 1, 1.8, 0, 0, 0, "【物理】悪罵で暴走した、巨大なチョコの魔物。\nささやく愛も誤れば、人を傷つける刃と化す。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージを与え、\n　火傷状態の場合は、さらに追加ダメージ。\n・前方3キャラに物理中ダメージを与え、スタン\n　させる。\n　さらにキャラのＨＰが50％以下の場合、\n　火傷状態にする。\n・アグリーラブリー自身のＨＰが\n　50％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306704, "アグリーラブリー", 306700, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【MODE1】チョコを大噴射し、身を覆い隠す。\n敵の攻撃を受け続け、憤怒の一撃を炸裂する。\n\n・敵全体に物理小ダメージを与え、バトル中の間\n　火傷状態にする。\n・チョコドームにこもっている間は、アグリー\n　ラブリー自身の物理防御力を中アップする。\n　チョコドーム状態を解除したのち、この状態の\n　間に受けたダメージ量に応じた\n　物理ダメージを与える。\n　さらにアグリーラブリー自身の物理防御力を\n　大ダウンする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306705, "アグリーラブリー", 306700, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【MODE2】カカオウラは奮起し、\n 死地に飛び込む。\n 激化する魔物の攻撃から、\n 大切な者たちを守るため。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージを与え、\n・カカオウラがキャラの味方として出現する。\n　カカオウラ出現中は、キャラ全体の物理\n　攻撃力と魔法攻撃力と行動速度が中アップする。\n・敵全体に魔法小ダメージを与え、\n　行動速度を大ダウンさせる。\n");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306706, "アグリーラブリー", 306700, 0, 16, 270, 2160, 1, 1.8, 0, 0, 0, "【MODE3】轟々たる咆哮が、会場を包み込む。\n愛憎渦巻くバレンタイン事変もいよいよ終局。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージを与え、\n　火傷状態の場合は、さらに追加ダメージ。\n・前方3キャラに物理中ダメージを与え、スタン\n　させる。\n　キャラのＨＰが50％以下の場合、\n　火傷状態にする。");
