INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306800, "嘆きの女神", 306800, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】失意と絶望で、魔に堕ちた悲哀の王女。\n慟哭を求め、恐怖と呪詛ですべてを満たす。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法大ダメージを与え、\n　魔法防御力を下げる。\n・前方２番目、３番目のキャラに魔法\n　中ダメージを与え、スタンさせる。\n・前方２キャラに魔法小ダメージを与え、\n　物理攻撃力を下げ、ＴＰを減少させる。\n　さらに呪い状態にする。\n・嘆きの女神自身のＨＰが\n　40％を切ると、さらに攻撃が激しく\n　凶暴になる。");
