INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306806, "嘆きの女神", 306800, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【MODE3】狂気に満ちた悲哀は、女王の真の　姿を解き放つ。呪われし願いは、一縷の希望も　赦さない。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法大ダメージを与え、\n　魔法防御力を下げる。\n・前方２番目、３番目のキャラに魔法\n　中ダメージを与え、スタンさせる。\n・前方２キャラに魔法小ダメージを与え、\n　物理攻撃力を下げ、ＴＰを減少させる。\n　さらに呪い状態にする。\n　このスキルの状態異常はダメージを\n　無効化しても付与される。");
