INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306813, "嘆きの女神", 306800, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【MODE3】狂気に満ちた悲哀は、女王の真の　姿を解き放つ。呪われし願いは、一縷の希望も　赦さない。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法大ダメージを与え、\n　魔法防御力を下げる。\n・前方２番目、３番目のキャラに魔法\n　中ダメージを与え、スタンさせる。\n・前方２キャラに魔法小ダメージを与え、\n　物理攻撃力を下げ、ＴＰを減少させる。\n　さらに呪い状態にする。\n　このスキルの状態異常はダメージを\n　無効化しても付与される。\n・バトル開始直後に、自身の魔法攻撃力と\n　行動速度をアップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306900, "トライロッカー", 306900, 0, 16, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】かつて人々に祀られていた三戦士の石像。\nそれぞれが能力を高め合い、必殺の一撃を放つ。\n\n・物理攻撃力ダウンと魔法攻撃力ダウン効果の\n影響を受けやすい。\n・自身の物理攻撃力と魔法攻撃力を\n　極大アップさせ、敵全体に物理中ダメージと\n　魔法中ダメージを与える。\n・前方範囲内の敵に魔法小ダメージ。\n・敵全体に物理中ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (306901, "トライロッカー", 306901, 0, 16, 270, 3000, 2, 1.8, 0, 0, 0, "【魔法】かつて人々に祀られていた三戦士の石像。\nそれぞれが能力を高め合い、必殺の一撃を放つ。\n\n・物理攻撃力ダウンと魔法攻撃力ダウン効果の影\n　響を受けやすい。\n・ユニオンバーストは、自身の物理攻撃力と魔法\n　攻撃力を特大アップさせ、敵全体に物理中ダ\n　メージと魔法中ダメージを与える。\n・前から１番目の敵を中心とした小範囲に魔法中\n　ダメージ。\n・敵全体に物理中ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307000, "コア・ギガース", 307000, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307001, "コア・ギガース", 307000, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】異界の魔石から生まれた、弩級の巨人。\n強靭な肉体を武器に、苛烈な猛攻を繰り出す。\n\n・物理攻撃力アップ・ダウン効果の影響を受け\n　やすい。\n・ユニオンバーストは、敵全体に物理大ダメージ。\n・前方３キャラに物理中ダメージ。\n・敵全体に物理ダメージを与え、大きくノック\n　バックさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307002, "コア・ギガース", 307002, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307003, "コア・ギガース", 307002, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】異界の魔石から生まれた、弩級の巨人。\n強靭な肉体を武器に、苛烈な猛攻を繰り出す。\n\n・物理攻撃力アップ・ダウン効果の影響を受け\n　やすい。\n・ユニオンバーストは、敵全体に物理大ダメージ。\n・前方３キャラに物理中ダメージ。\n・一定時間防御の構えをとったあと、その間に受\n　けたダメージ量に応じた物理ダメージを敵全体\n　に与え、前方２キャラを麻痺させる。\n　さらに、自身の物理攻撃力をアップ。\n・敵全体に物理ダメージを与え、大きくノック\n　バックさせる。\n・コア・ギガース自身のＨＰが40％を切ると\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307004, "コア・ギガース", 307002, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】異界の魔石から生まれた、弩級の巨人。\n強靭な肉体を武器に、苛烈な猛攻を繰り出す。\n\n・物理攻撃力アップ・ダウン効果の影響を受け\n　やすい。\n・ユニオンバーストは、敵全体に物理大ダメージ。\n・前方３キャラに物理中ダメージ。\n・一定時間防御の構えをとったあと、その間に受\n　けたダメージ量に応じた物理ダメージを敵全体\n　に与え、前方２キャラを麻痺させる。\n　さらに、自身の物理攻撃力をアップ。\n・敵全体に物理ダメージを与え、大きくノック\n　バックさせる。\n・コア・ギガース自身のＨＰが40％を切ると\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307005, "コア・ギガース", 307002, 0, 16, 270, 3000, 1, 5.0, 0, 0, 0, "【MODE1】【美食殿】メンバーをシャドウ\nとして召喚。旅の思い出を盾に、３人の心の\n弱さを試す。\n\n・シャドウを出現させる\n・前方３キャラに物理中ダメージ。\n・敵全体に物理ダメージを与え、大きくノック\n　バックさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307006, "コア・ギガース", 307002, 0, 16, 270, 3000, 1, 5.0, 0, 0, 0, "【MODE2】強靭な肉体であらゆる攻撃を\n耐え凌ぐ。その怒りを糧に、巨人は\n怒涛の大反撃を見舞う。\n\n・物理攻撃力アップ・ダウン効果の影響を受け\n　やすい。\n・ユニオンバーストは、敵全体に物理大ダメージ。\n・前方３キャラに物理中ダメージ。\n・一定時間防御の構えをとったあと、その間に受\n　けたダメージ量に応じた物理ダメージを敵全体\n　に与え、前方２キャラを麻痺させる。\n　さらに、自身の物理攻撃力をアップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307007, "コア・ギガース", 307002, 0, 16, 270, 3000, 1, 3.0, 0, 0, 0, "【MODE3】弩級の巨人は、全身全霊の力を\n解放する。強大無比な破壊力を前に\n小手先の攻撃は通じない。\n\n・物理攻撃力アップ・ダウン効果の影響を受け\n　やすい。\n・ユニオンバーストは、敵全体に物理大ダメージ。\n・前方３キャラに物理中ダメージ。\n・一定時間防御の構えをとったあと、その間に受\n　けたダメージ量に応じた物理ダメージを敵全体\n　に与え、前方２キャラを麻痺させる。\n　さらに、自身の物理攻撃力をアップ。\n・敵全体に物理ダメージを与え、大きくノック\n　バックさせる。");
