INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307012, "コア・ギガース", 307008, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】異界の魔石から生まれた、弩級の巨人。\n強靭な肉体を武器に、苛烈な猛攻を繰り出す。\n\n・物理攻撃力アップ・ダウン効果の影響を受け\n　やすい。\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理大ダメージ。\n・前方３キャラに物理中ダメージ。\n・一定時間防御の構えをとったあと、その間に受\n　けたダメージ量に応じた物理ダメージを敵全体\n　に与え、行動速度をダウンさせる。\n　さらに、前方２キャラを麻痺させ、自身の\n　物理攻撃力をアップ。\n・敵全体に物理中ダメージを与え、大きくノック\n　バックさせる。\n・コア・ギガース自身のＨＰが35％を切ると\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307013, "コア・ギガース", 307002, 0, 16, 270, 3000, 1, 5.0, 0, 0, 0, "【MODE1】【美食殿】メンバーをシャドウ\nとして召喚。旅の思い出を盾に、３人の心の\n弱さを試す。\n\n・前方３キャラに物理中ダメージ。\n・敵全体に物理中ダメージを与え、大きくノック\n　バックさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307014, "コア・ギガース", 307002, 0, 16, 270, 3000, 1, 5.0, 0, 0, 0, "【MODE2】強靭な肉体であらゆる攻撃を\n耐え凌ぐ。その怒りを糧に、巨人は\n怒涛の大反撃を見舞う。\n\n・物理攻撃力アップ・ダウン効果の影響を受け\n　やすい。\n・ユニオンバーストは、敵全体に物理中ダメージ。\n・前方３キャラに物理大ダメージ。\n・一定時間防御の構えをとったあと、その間に受\n　けたダメージ量に応じた物理ダメージを敵全体\n　に与え、前方２キャラを麻痺させる。\n　さらに、自身の物理攻撃力をアップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307015, "コア・ギガース", 307002, 0, 16, 270, 3000, 1, 3.0, 0, 0, 0, "【MODE3】弩級の巨人は、全身全霊の力を\n解放する。強大無比な破壊力を前に\n小手先の攻撃は通じない。\n\n・物理攻撃力アップ・ダウン効果の影響を受け\n　やすい。\n・ユニオンバーストは、敵全体に物理中ダメージ。\n・前方３キャラに物理大ダメージ。\n・一定時間防御の構えをとったあと、その間に受\n　けたダメージ量に応じた物理ダメージを敵全体\n　に与え、前方２キャラを麻痺させる。\n　さらに、自身の物理攻撃力をアップ。\n・敵全体に物理大ダメージを与え、大きくノック\n　バックさせる。\n・バトル開始直後に、自身の物理攻撃力と\n　行動速度をアップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307100, "ロボリマ（MODE1）", 307100, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "堅牢で多彩な技を持つ謎の巨大兵器の第１形態。\nリンゴ型補給機で未知のエネルギーを充填し、\n広範囲を焦土と化す連続攻撃に注意せよ！\n\n・ユニオンバーストは、敵全体に物理大ダメージ。\n・前方１キャラに物理小ダメージ。\n・一定範囲に、物理攻撃力と回避をダウンさせ\n　物理ダメージを与えるフィールドを展開。\n　同時に前方範囲内のキャラの\n　ステータスアップ効果を解除。\n・前方範囲内に物理中ダメージを与え、\n　自身のＴＰ上昇をアップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307101, "ロボリマ（MODE2）", 307101, 0, 16, 270, 3000, 1, 1.2, 0, 0, 0, "全てを攻めへと切替えた謎の巨大兵器の第２形態。\nコアリマクターの放つ熱線が、全土を焼き尽くす。\n無防備な巨大兵器に大ダメージを叩き込め！\n\n・ユニオンバーストは、前方小範囲に物理\n　特大ダメージ、中範囲に物理大ダメージ、\n　広範囲に物理中ダメージを与え、\n　大きく吹き飛ばす。\n・前方１キャラに物理小ダメージ。\n・ランダムな１キャラに物理小ダメージ。\n・一定範囲に、物理攻撃力と魔法攻撃力を\n　大ダウンさせ、魔法ダメージを与える\n　フィールドを展開。\n　同時に、魔法攻撃力の高い２キャラを\n　沈黙させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307102, "ロボリマ（MODE3）", 307102, 0, 16, 270, 3000, 1, 5.5, 0, 0, 0, "損耗を自己修復する謎の巨大兵器の第３形態。\n隙だらけな本体への攻撃を、防衛ドローンが阻む。\n範囲攻撃でドローンを蹴散らし、好機を狙え！\n\n・敵全体を大きく吹き飛ばし、\n　ミニロボリマを３体召喚する。\n・ミニロボリマが、前方１キャラに\n　物理小ダメージ。\n・ミニロボリマが、ランダムな１キャラに\n　魔法中ダメージ。\n・敵全体に残りＨＰに応じた割合物理\n　特大ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307200, "バジリスク", 307200, 0, 16, 270, 3000, 2, 1.8, 0, 0, 0, "【魔法】ルナの魔力を求め飛来した大怪鳥。\n雛鳥を従え、石化の呪剣を振り下ろす。\n\n・石化状態でないキャラ全員に魔法大ダメージ\n　を与え、短時間石化する。\n　石化状態のキャラ全員に最大ＨＰの80％の\n　ダメージを与える。\n・前から３キャラに魔法小ダメージを与える。\n　さらにこのスキルでダメージが発生した\n　毒状態のキャラを長時間石化する。\n・前方範囲内のキャラに魔法中ダメージを与え、\n　さらに毒状態にする。\n　自身のＨＰが50％以下の場合、さらに敵全体\n　をノックバックし、コッコーを召喚する。\n・コッコーは、前方範囲内で物理攻撃力が\n　一番高い１キャラに物理小ダメージを与え、\n　さらに毒状態にする。\n　また自身のＨＰが最大ＨＰの35％以下にな\n　ると、物理攻撃力が最も高い味方のＴＰを\n　中アップし、自身は戦闘不能になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307201, "バジリスク", 307201, 0, 16, 270, 3000, 2, 1.8, 0, 0, 0, "【魔法】石化の呪剣を携えた怪鳥。尾蛇の毒牙で\n獲物を蝕み、呪剣の石化で冒険者の歩みを止める。\n\n・ユニオンバーストは、行動不能状態でないキャ\n　ラ全員に魔法大ダメージを与え、石化状態にす\n　る。\n　行動不能状態のキャラ全員に最大ＨＰの80％\n　のダメージを与える。\n　さらに、敵全体のステータスアップ効果を解除。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から３キャラに魔法小ダメージを与える。\n　さらにこのスキルでダメージが発生した毒状態\n　のキャラを石化状態にする。\n・前方範囲内のキャラに魔法中ダメージを与え、\n　さらに毒状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307300, "アクダイカン", 307300, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】強欲にまみれたカラクリ人形。\nオーエド町の圧政者として君臨し、\n横暴の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与え、自分の物理\n　攻撃力を中アップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307301, "アクダイカン", 307300, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】強欲にまみれたカラクリ人形。\nオーエド町の圧政者として君臨し、\n横暴の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与え、自分の物理\n　攻撃力を中アップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307302, "アクダイカン", 307300, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】強欲にまみれたカラクリ人形。\nオーエド町の圧政者として君臨し、\n横暴の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与え、自分の物理\n　攻撃力を中アップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307303, "アクダイカン", 307300, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】強欲にまみれたカラクリ人形。\nオーエド町の圧政者として君臨し、\n横暴の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与え、自分の物理\n　攻撃力を中アップさせる。さらに、\n　召喚されているすべてのケライのＨＰ\n　を0にする。\n・目の前の敵１キャラへの物理攻撃を\n　行うケライを召喚する。\n　ケライは、自分のＨＰが0になると\n　大爆発し、範囲内の敵すべてに物理中\n　ダメージを与える。\n・アクダイカン自身のＨＰが\n　40％を切ると、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307304, "アクダイカン", 307300, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【MODE1】【ヴァイスフリューゲル\nランドソル支部】メンバーをシャドウ\nとして召喚。３人の固い絆をあざ笑う\n欲望の影が強襲する。\n\n・シャドウを出現させる\n・目の前の敵１キャラへの物理攻撃\n");
