INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307306, "アクダイカン", 307300, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【MODE3】虚栄に満ちた欲心は、すべて\nを支配せんと真の力を解放する。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与え、自分の物理\n　攻撃力を中アップさせる。さらに、\n　召喚されているすべてのケライのＨＰ\n　を0にする。\n・目の前の敵１キャラへの物理攻撃を\n　行うケライを召喚する。\n　ケライは、自分のＨＰが0になると\n　大爆発し、範囲内の敵すべてに物理中\n　ダメージを与える。\n");
