INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307313, "アクダイカン", 307307, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【MODE３】虚栄に満ちた欲心は、すべて\nを支配せんと真の力を解放する。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理割合ダメージを与え、自分の物理\n　攻撃力を中アップさせる。さらに、\n　召喚されているすべてのケライのＨＰ\n　を０にする。\n・目の前の敵１キャラへの物理攻撃を\n　行うケライを召喚する。\n　ケライは、自分のＨＰが０になると\n　大爆発し、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n・バトル開始直後に、自身の物理攻撃力と\n　行動速度をアップさせる。");
