INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307401, "ペテルギウス", 307400, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】ルグニカに悪名高き魔女教の幹部。\n異世界に行き着いてもなお自身の信念に従い、\n強力な権能『見えざる手』の力で暗躍する。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与える。\n・前方範囲内のキャラ全員に魔法中ダメージと\n　ＴＰダウン。\n　さらに敵全体に魔法中ダメージ。\n・後方２キャラに、キャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n・向かって左側のターゲットのブレイク時、物理\n　防御力と魔法防御力が小ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が中ダウン。\n・中央のターゲットのブレイク時、物理防御力と\n　魔法防御力が大ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が特大ダウン。\n・向かって右側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307402, "ペテルギウス", 307400, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】ルグニカに悪名高き魔女教の幹部。\n異世界に行き着いてもなお自身の信念に従い、\n強力な権能『見えざる手』の力で暗躍する。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与える。\n・前方範囲内のキャラ全員に魔法中ダメージと\n　ＴＰダウン。\n　さらに敵全体に魔法中ダメージ。\n・後方２キャラに、キャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n・向かって左側のターゲットのブレイク時、物理\n　防御力と魔法防御力が小ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が中ダウン。\n・中央のターゲットのブレイク時、物理防御力と\n　魔法防御力が大ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が特大ダウン。\n・向かって右側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が大ダウン。\n・残り時間が40秒を切ると、さらに攻撃が\n　激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307403, "ペテルギウス", 307400, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】ルグニカに悪名高き魔女教の幹部。\n異世界に行き着いてもなお自身の信念に従い、\n強力な権能『見えざる手』の力で暗躍する。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与える。\n・前方範囲内のキャラ全員に魔法中ダメージと\n　ＴＰダウン。\n　さらに敵全体に魔法中ダメージ。\n・後方２キャラに、キャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n・向かって左側のターゲットのブレイク時、物理\n　防御力と魔法防御力が小ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が中ダウン。\n・中央のターゲットのブレイク時、物理防御力と\n　魔法防御力が大ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が特大ダウン。\n・向かって右側のターゲットのブレイク時、物理\n　防御力と魔法防御力が大ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が大ダウン。\n・残り時間が40秒を切ると、さらに攻撃が\n　激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307404, "ペテルギウス", 307400, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ１】レムとラムのシャドウを召喚。\n大罪司教の狂気に呑まれた双子の影は、\n魔女教の手となり、仲間の前に立ち塞がる。\n\n・目の前の敵１キャラに物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307405, "ペテルギウス", 307400, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ２】威力を増した強力無比なる\n権能は怠惰なる怨敵に無慈悲な終焉をもたらす。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与える。\n・後方２キャラに、キャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n・残りＨＰ割合が少ない敵１キャラに\n　魔法大ダメージを与え、さらに\n　カウントダウンを付与する。\n　カウントが０になると、キャラの最大ＨＰに\n　応じた魔法割合ダメージを与える。\n・向かって左側のターゲットのブレイク時、物理\n　防御力と魔法防御力が小ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が中ダウン。\n・中央のターゲットのブレイク時、物理防御力が\n　中ダウン、魔法防御力が大ダウン、物理攻撃力\n　が小ダウン、魔法攻撃力が特大ダウン。\n・向かって右側のターゲットのブレイク時、物理\n　防御力が中ダウン、魔法防御力が大ダウン、\n　物理攻撃力が小ダウン、魔法攻撃力が大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307406, "ペテルギウス", 307400, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ３】理性も人の姿も失った狂信者は、\nただ執念のみに動かされ、忠愛に死力を尽くす。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与える。\n・前方範囲内のキャラ全員に魔法中ダメージと\n　ＴＰダウン。\n　さらに敵全体に魔法中ダメージ。\n・後方２キャラに、キャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n・向かって左側のターゲットのブレイク時、物理\n　防御力と魔法防御力が小ダウン、物理攻撃力が\n　小ダウン、魔法攻撃力が中ダウン。\n・中央のターゲットのブレイク時、物理防御力が\n　中ダウン、魔法防御力が大ダウン、物理攻撃力\n　が小ダウン、魔法攻撃力が特大ダウン。\n・向かって右側のターゲットのブレイク時、物理\n　防御力が中ダウン、魔法防御力が大ダウン、\n　物理攻撃力が小ダウン、魔法攻撃力が大ダウン。\n・残り時間が40秒を切ると、さらに攻撃が\n　激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307500, "ジズ", 307500, 0, 3, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】猛り狂う暴風を纏いし大怪鳥。\n魔物図鑑を抜け出し、破壊の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与え、\n　さらにスタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307501, "ジズ", 307500, 0, 3, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】猛り狂う暴風を纏いし大怪鳥。\n魔物図鑑を抜け出し、破壊の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与え、\n　さらにスタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307502, "ジズ", 307500, 0, 3, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】猛り狂う暴風を纏いし大怪鳥。\n魔物図鑑を抜け出し、破壊の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与え、\n　さらにスタンさせる。\n・前方範囲内の敵にキャラの最大ＨＰに応じた\n　物理中ダメージを与える。\n・ジズ自身のＨＰが５０％を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307503, "ジズ", 307500, 0, 3, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】猛り狂う暴風を纏いし大怪鳥。\n魔物図鑑を抜け出し、破壊の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与え、\n　さらにスタンさせる。\n・前方範囲内の敵にキャラの最大ＨＰに応じた\n　物理中ダメージを与える。\n・ジズ自身のＨＰが５０％を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307504, "紅極鳥", 307504, 0, 3, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】塔の魔力を喰らい、暴れ回る巨大魔鳥。\n迂闊に近づくものは、暴風と雷豪が身を引き裂く。\n\n・敵全体に物理大ダメージを与え、魔法攻撃を\n　行う全ての敵に追加の物理中ダメージを与える。\n・前から２番目のキャラを中心にした小範囲に\n　物理小ダメージを与え、スタンさせる。\n・前方範囲内の敵に物理中ダメージを与え、\n　小さく吹き飛ばす。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307505, "ジズ", 307505, 0, 3, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】猛り狂う暴風を纏いし大怪鳥。\n魔物図鑑を抜け出し、破壊の限りを尽くす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与え、\n　さらにスタンさせる。\n・前方範囲内の敵にキャラの最大ＨＰに応じた\n　物理中ダメージを与える。\n・ジズ自身のＨＰが50％を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307600, "マッドクラウン", 307600, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ルナの塔を己の舞台にしようと画策する、\n魔界の道化。陽気な笑顔と狂気で観客の命を弄ぶ。\n\n・敵全体に魔法大ダメージを与え、\n　暗闇状態にする。\n・6回、ランダムで1キャラに物理小ダメージを\n　与え、敵全体に物理大ダメージを与える。\n　この攻撃は前列にいるキャラほど\n　当たりやすくなる。\n・時限式の爆弾を前方中距離に召喚する。\n　爆弾は召喚されてから8秒後に大爆発し、\n　範囲内の敵全体に物理中ダメージを与える。\n　ただし、爆発するまでに爆弾のＨＰが\n　1％を切ると、マッドクラウンに\n　最大ＨＰの15％の物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307700, "アルマ", 307700, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古より迷宮を守護する防衛兵器。すべての罠を超えた最奥で侵入者を静かに待つ。\n\n・敵全体にキャラの最大ＨＰに応じた\n　魔法特大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307701, "アルマ", 307700, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古より迷宮を守護する防衛兵器。すべての罠を超えた最奥で侵入者を静かに待つ。\n\n・敵全体にキャラの最大ＨＰに応じた\n　魔法特大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307702, "アルマ", 307700, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古より迷宮を守護する防衛兵器。すべての罠を超えた最奥で侵入者を静かに待つ。\n\n・敵全体にキャラの最大ＨＰに応じた\n　魔法特大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与える。\n・残りＨＰの高い敵に対して最大ＨＰに応じた\n　魔法中ダメージを与えさらに麻痺させる。\n・アルマ自身のＨＰが５０％を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307703, "アルマ", 307700, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】はるか古より迷宮を守護する防衛兵器。すべての罠を超えた最奥で侵入者を静かに待つ。\n\n・敵全体にキャラの最大ＨＰに応じた\n　魔法特大ダメージを与える。\n・前方範囲内の敵に物理中ダメージを与える。\n・残りＨＰの高い敵に対して最大ＨＰに応じた\n　魔法中ダメージを与えさらに麻痺させる。\n・アルマ自身のＨＰが５０％を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307704, "カース・アルマ", 307704, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ルナの塔の魔力で暴走する、古代兵器。\n魔力で凶化した守護の力は全てを砕く災厄となる。\n\n・敵全体に物理特大ダメージを与える。\n・前方小範囲内のランダムな敵キャラに\n　物理大ダメージを３回与える。\n・最も魔法攻撃力が高い１キャラに\n　物理中ダメージを与え、麻痺させる。\n　さらに、その周りの小範囲の敵キャラに\n　物理中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307800, "雨神様", 307800, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】古より島の天候を見守ってきた守り神。\n友の心を求め憂うあまり、禍禍しき姿に変貌する。\nすべての大地を哀哭の雨で飲み込む。\n\n・ユニオンバーストは、敵全体に\n　魔法大ダメージを与えて吹き飛ばす。\n　さらに、前方範囲内の敵すべてに追加の\n　魔法中ダメージを与える。\n・一番遠くの敵１キャラに魔法中ダメージを与え、\n　さらに小さく引き寄せる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307801, "雨神様", 307800, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】古より島の天候を見守ってきた守り神。\n友の心を求め憂うあまり、禍禍しき姿に変貌する。\nすべての大地を哀哭の雨で飲み込む。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを\n　与えて吹き飛ばす。\n　さらに、前方範囲内の敵すべてにキャラの\n　最大ＨＰに応じた追加の魔法割合ダメージを\n　与える。\n・一番遠くの敵１キャラに魔法中ダメージを与え、\n　さらに小さく引き寄せる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307802, "雨神様", 307800, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】古より島の天候を見守ってきた守り神。\n友の心を求め憂うあまり、禍禍しき姿に変貌する。\nすべての大地を哀哭の雨で飲み込む。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを\n　与えて吹き飛ばす。\n　さらに、前方範囲内の敵すべてにキャラの\n　最大ＨＰに応じた追加の魔法割合ダメージを\n　与える。\n・前方範囲内の敵すべてに魔法中ダメージを与え、\n　小さく吹き飛ばす。さらに最も近い敵１キャラ\n　に追加の魔法中ダメージを与える。\n・一番遠くの敵１キャラに魔法中ダメージを与え、\n　さらに小さく引き寄せる。\n・雨神様自身のＨＰが40%を切ると、\n　さらに攻撃が激しく狂暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307803, "雨神様", 307800, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】古より島の天候を見守ってきた守り神。\n友の心を求め憂うあまり、禍禍しき姿に変貌する。\nすべての大地を哀哭の雨で飲み込む。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを\n　与えて吹き飛ばす。\n　さらに、前方範囲内の敵すべてにキャラの\n　最大ＨＰに応じた追加の魔法割合ダメージを\n　与える。\n・前方範囲内の敵すべてに魔法中ダメージを与え、\n　小さく吹き飛ばす。さらに最も近い敵１キャラ\n　に追加の魔法中ダメージを与える。\n・一番遠くの敵１キャラに魔法中ダメージを与え、\n　さらに小さく引き寄せる。\n・雨神様自身のＨＰが40%を切ると、\n　さらに攻撃が激しく狂暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307804, "雨神様", 307801, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【MODE1】悲嘆に暮れるアメきちは\nみんなの想いを拒絶し、心焦がれるほどに\n求めたハレきちの声すら今のアメきちには\n届かない。\n\n・バリアを張り、敵の攻撃を受け付けなくなる。\n　バリアはダメージ量に関係なく、攻撃を\n　命中させるたびに徐々に耐久性を失っていき、\n　２００回攻撃を命中させるとバリアは破壊\n　される。\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与えて吹き飛ばす。さらに、前方範囲内の\n　敵すべてに追加の魔法中ダメージを与える。\n・前方範囲内の敵すべてに魔法中ダメージを与え、\n　小さく吹き飛ばす。さらに最も近い敵１キャラ\n　に追加の魔法中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307805, "雨神様", 307800, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【MODE2】哀哭の雨が、哀しみとともに\n降り注ぐ。その漆黒の雫は、悲哀の渇きで\n人々の心身を蝕む。\n\n・バトル開始時に呪いのクリスタルを呼び出す。\n　呪いのクリスタルがバトル中に存在している間、\n　敵全体に継続ダメージを与える。さらに、\n　何らかの効果でＨＰを回復しようとした場合、\n　その回復を無効にし、本来の回復量の10%の\n　ダメージを与える。\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与えて吹き飛ばす。さらに、前方範囲内の\n　敵すべてに追加の魔法中ダメージを与える。\n・前方範囲内の敵すべてに魔法中ダメージを与え、\n　小さく吹き飛ばす。さらに最も近い敵１キャラ\n　に追加の魔法中ダメージを与える。\n・一番遠くの敵１キャラに魔法中ダメージを与え、\n　さらに小さく引き寄せる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307806, "雨神様", 307800, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【MODE3】ハレきちへの贖罪を乞う\n慟哭の奔流が、対峙する者の心を引き裂く。\n愛、友情、全ての感情が塵芥へと帰す。\n\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与えて吹き飛ばす。さらに、前方範囲内の\n　敵すべてに追加の魔法中ダメージを与える。\n・前方範囲内の敵すべてに魔法中ダメージを与え、\n　小さく吹き飛ばす。さらに最も近い敵１キャラ\n　に追加の魔法中ダメージを与える。\n・一番遠くの敵１キャラに魔法中ダメージを与え、\n　さらに小さく引き寄せる。\n・雨神様自身のＨＰが40%を切ると、\n　さらに攻撃が激しく狂暴になる。");
