INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307901, "ガルグ", 307900, 0, 16, 270, 1000, 1, 1.9, 0, 0, 0, "【物理】屍肉を喰らう凶暴な大型魔獣。\n強固な棘を全身に纏い獲物を執念深くつけ狙う。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n・前から３番目、４番目、５番目のキャラに\n　物理中ダメージを与えさらにスタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307902, "ガルグ", 307900, 0, 16, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】屍肉を喰らう凶暴な大型魔獣。\n強固な棘を全身に纏い獲物を執念深くつけ狙う。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n・前から３番目、４番目、５番目のキャラに\n　物理中ダメージを与えさらにスタンさせる。\n・前方２キャラに物理中ダメージを与える。\n・ガルグ自身のＨＰが50%を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (307903, "ガルグ", 307900, 0, 16, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】屍肉を喰らう凶暴な大型魔獣。\n強固な棘を全身に纏い獲物を執念深くつけ狙う。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n・前から３番目、４番目、５番目のキャラに\n　物理中ダメージを与えさらにスタンさせる。\n・前方２キャラに物理中ダメージを与える。\n・ガルグ自身のＨＰが50%を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308000, "マジムン", 308000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】善良なる魂を餌食とする、凶々しき悪霊。\nより良き贄を求め、体躯を幾多にも分かち蠢く。\n\n・マジムンが保持している【吸魂】ステータス\n　の数に応じて、通常攻撃と各スキルの効果\n　が強化される。\n・通常攻撃のたびに【吸魂】を6つ追加する。\n・ユニオンバーストは全体に魔法特大\n　ダメージ。さらに【吸魂】を5つ追加する。\n・全体に魔法小ダメージを与えてＴＰを減少させ、\n　さらにＴＰ上昇をダウンさせるフィールドを\n　展開する。ＴＰの減少量とフィールドの\n　効果値は、マジムンが保持している【吸魂】\n　の数が多い程強化される。\n・攻撃するたびにマジムンに【吸魂】を1つ\n　追加する分身体を3体召喚し、さらに全体を\n　小さく吹き飛ばす。\n・マジムンがクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が2つ減少する。\n・分身体がクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が1つ減少する。\n・マジムンのＨＰが40%を切ると、さらに\n　攻撃が激しく狂暴になる。\n　さらに【吸魂】を20追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308001, "マジムン", 308000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】善良なる魂を餌食とする、凶々しき悪霊。\nより良き贄を求め、体躯を幾多にも分かち蠢く。\n\n・マジムンが保持している【吸魂】ステータス\n　の数に応じて、通常攻撃と各スキルの効果\n　が強化される。\n・通常攻撃のたびに【吸魂】を6つ追加する。\n・ユニオンバーストは全体に魔法特大\n　ダメージ。さらに【吸魂】を5つ追加する。\n・全体に魔法小ダメージを与えてＴＰを減少させ、\n　さらにＴＰ上昇をダウンさせるフィールドを\n　展開する。ＴＰの減少量とフィールドの\n　効果値は、マジムンが保持している【吸魂】\n　の数が多い程強化される。\n・攻撃するたびにマジムンに【吸魂】を1つ\n　追加する分身体を3体召喚し、さらに全体を\n　小さく吹き飛ばす。\n・マジムンがクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が2つ減少する。\n・分身体がクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が1つ減少する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308002, "マジムン", 308000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】善良なる魂を餌食とする、凶々しき悪霊。\nより良き贄を求め、体躯を幾多にも分かち蠢く。\n\n・マジムンが保持している【吸魂】ステータス\n　の数に応じて、通常攻撃と各スキルの効果\n　が強化される。\n・通常攻撃のたびに【吸魂】を6つ追加する。\n・ユニオンバーストは全体に魔法特大\n　ダメージ。さらに【吸魂】を5つ追加する。\n・全体に魔法小ダメージを与えてＴＰを減少させ、\n　さらにＴＰ上昇をダウンさせるフィールドを\n　展開する。ＴＰの減少量とフィールドの\n　効果値は、マジムンが保持している【吸魂】\n　の数が多い程強化される。\n・攻撃するたびにマジムンに【吸魂】を1つ\n　追加する分身体を3体召喚し、さらに全体を\n　小さく吹き飛ばす。\n・マジムンがクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が2つ減少する。\n・分身体がクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が1つ減少する。\n・マジムンのＨＰが40%を切ると、さらに\n　攻撃が激しく狂暴になる。\n　さらに【吸魂】を20追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308003, "マジムン", 308000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【MODE1】黄昏より出でし巨悪の化身は、\n本能のまま幾百の魂を貪り喰う。\n\n・バトル開始と同時に、自身の魔法攻撃力を\n　特大アップさせ、さらに敵パーティの物理\n　クリティカルと魔法クリティカルを特大ダウン\n　させるフィールドを展開する。\n・マジムンが保持している【吸魂】ステータス\n　の数に応じて、通常攻撃と各スキルの効果\n　が強化される。\n・通常攻撃のたびに【吸魂】を6つ追加する。\n・ユニオンバーストは全体に魔法特大ダメージ。\n　さらに【吸魂】を5つ追加する。\n・全体に魔法小ダメージを与えてＴＰを減少させ、\n　さらにＴＰ上昇をダウンさせるフィールドを\n　展開する。ＴＰの減少量とフィールドの\n　効果値は、マジムンが保持している【吸魂】の\n　数が多い程強化される。\n・マジムンがクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が5減少する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308004, "マジムン", 308000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【MODE2】宵闇より現れし怨霊の叢りは、\n人々の魂を千々に引き裂く。\n\n・分身体を1体倒すたびに、残りマジムン数が\n　1減少する。その後、分身体が再度召喚される。\n・マジムンが保持している【吸魂】ステータス\n　の数に応じて、通常攻撃と各スキルの効果\n　が強化される。\n・通常攻撃のたびに【吸魂】を6つ追加する。\n・攻撃するたびにマジムンに【吸魂】を1つ\n　追加する分身体を3体召喚し、さらに全体を\n　小さく吹き飛ばす。\n・マジムンがクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が2つ減少する。\n・分身体がクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が1つ減少する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308005, "マジムン", 308000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【MODE3】暁闇の中で跋扈する魑魅は、\n遂には三千世界の魂を食らわんと牙を剥く。\n\n・マジムンが保持している【吸魂】ステータス\n　の数に応じて、通常攻撃と各スキルの効果\n　が強化される。\n・通常攻撃のたびに【吸魂】を6つ追加する。\n・ユニオンバーストは全体に魔法特大\n　ダメージ。さらに【吸魂】を5つ追加する。\n・全体に魔法小ダメージを与えてＴＰを減少させ、\n　さらにＴＰ上昇をダウンさせるフィールドを\n　展開する。ＴＰの減少量とフィールドの\n　効果値は、マジムンが保持している【吸魂】\n　の数が多い程強化される。\n・攻撃するたびにマジムンに【吸魂】を1つ\n　追加する分身体を3体召喚し、さらに全体を\n　小さく吹き飛ばす。\n・マジムンがクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が2つ減少する。\n・分身体がクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が1つ減少する。\n・残り時間が40秒を切ると、さらに\n　攻撃が激しく狂暴になる。\n　さらに【吸魂】を20追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308006, "マジムン", 308000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】善良なる魂を餌食とする、凶々しき悪霊。\nより良き贄を求め、体躯を幾多にも分かち蠢く。\n\n・マジムンが保持している【吸魂】ステータス\n　の数に応じて、通常攻撃と各スキルの効果\n　が強化される。\n・通常攻撃のたびに【吸魂】を６つ追加する。\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　さらに【吸魂】を５つ追加する。\n・敵全体に魔法小ダメージを与えＴＰを減少させ、\n　さらにＴＰ上昇をダウンさせるフィールドを\n　展開する。ＴＰの減少量とフィールドの\n　効果値は、マジムンが保持している【吸魂】\n　の数が多い程強化される。\n・攻撃するたびにマジムンに【吸魂】を１つ\n　追加する分身体を３体召喚し、さらに敵全体を\n　小さく吹き飛ばす。\n・マジムンがクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が２つ減少する。\n・分身体がクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が１つ減少する。\n・マジムンのＨＰが30%を切ると、さらに\n　攻撃が激しく狂暴になる。\n　さらに【吸魂】を20追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308007, "マジムン", 308000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】善良なる魂を餌食とする、凶々しき悪霊。\nより良き贄を求め、体躯を幾多にも分かち蠢く。\n\n・マジムンが保持している【吸魂】ステータス\n　の数に応じて、通常攻撃と各スキルの効果\n　が強化される。\n・通常攻撃のたびに【吸魂】を６つ追加する。\n・ユニオンバーストは、敵全体にマジムンが\n　保持している【吸魂】の数に応じた\n　魔法割合ダメージを与え、\n　さらに【吸魂】を５つ追加する。\n・敵全体に魔法小ダメージを与えＴＰを減少させ、\n　さらにＴＰ上昇をダウンさせるフィールドを\n　展開する。ＴＰの減少量とフィールドの\n　効果値は、マジムンが保持している【吸魂】\n　の数が多い程強化される。\n・攻撃するたびにマジムンに【吸魂】を１つ\n　追加する分身体を３体召喚し、さらに敵全体を\n　小さく吹き飛ばす。\n・マジムンがクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が２つ減少する。\n・分身体がクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が１つ減少する。");
