INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308011, "マジムン", 308000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ３】暁闇の中で跋扈する魑魅は、\n遂には三千世界の魂を喰らわんと牙を剥く。\n\n・マジムンが保持している【吸魂】ステータス\n　の数に応じて、通常攻撃と各スキルの効果\n　が強化される。\n・通常攻撃のたびに【吸魂】を６つ追加する。\n・ユニオンバーストは、敵全体にマジムンが\n　保持している【吸魂】の数に応じた\n　魔法割合ダメージを与え、\n　さらに【吸魂】を５つ追加する。\n・敵全体に魔法小ダメージを与えＴＰを減少させ、\n　さらにＴＰ上昇をダウンさせるフィールドを\n　展開する。ＴＰの減少量とフィールドの\n　効果値は、マジムンが保持している【吸魂】\n　の数が多い程強化される。\n・攻撃するたびにマジムンに【吸魂】を１つ\n　追加する分身体を３体召喚し、さらに敵全体を\n　小さく吹き飛ばす。\n・マジムンがクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が２つ減少する。\n・分身体がクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が１つ減少する。\n・残り時間が30秒を切ると、さらに\n　攻撃が激しく狂暴になる。\n　さらに【吸魂】を20追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308012, "マジムン", 308000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】善良なる魂を餌食とする、凶々しき悪霊。\nより良き贄を求め、体躯を幾多にも分かち蠢く。\n\n・マジムンが保持している【吸魂】ステータス\n　の数に応じて、通常攻撃と各スキルの効果\n　が強化される。\n・通常攻撃のたびに【吸魂】を６つ追加する。\n・ユニオンバーストは、敵全体にマジムンが\n　保持している【吸魂】の数に応じた\n　魔法割合ダメージを与え、\n　さらに【吸魂】を５つ追加する。\n・敵全体に魔法小ダメージを与えＴＰを減少させ、\n　さらにＴＰ上昇をダウンさせるフィールドを\n　展開する。ＴＰの減少量とフィールドの\n　効果値は、マジムンが保持している【吸魂】\n　の数が多い程強化される。\n・攻撃するたびにマジムンに【吸魂】を１つ\n　追加する分身体を３体召喚し、さらに敵全体を\n　小さく吹き飛ばす。\n・マジムンがクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が２つ減少する。\n・分身体がクリティカルダメージを受ける\n　たびに、マジムンの【吸魂】が１つ減少する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308100, "テンタパス", 308100, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】海辺に君臨する巨大な軟体魔獣。\n強靭な触手と鋼鉄の大銛で全てを破壊しつくす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・後方範囲内に魔法中ダメージを与え、\n　麻痺状態を付与、さらに物理攻撃力、\n　魔法攻撃力を特大ダウン。\n・一定時間経過すると敵単体に\n　物理超特大ダメージを与える。\n・テンタパス自身のＨＰが40%を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308101, "テンタパス", 308100, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】海辺に君臨する巨大な軟体魔獣。\n強靭な触手と鋼鉄の大銛で全てを破壊しつくす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・後方範囲内に魔法中ダメージを与え、\n　麻痺状態を付与、さらに物理攻撃力、\n　魔法攻撃力を特大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308102, "テンタパス", 308100, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】海辺に君臨する巨大な軟体魔獣。\n強靭な触手と鋼鉄の大銛で全てを破壊しつくす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・後方範囲内に魔法中ダメージを与え、\n　麻痺状態を付与、さらに物理攻撃力、\n　魔法攻撃力を特大ダウン。\n・テンタパス自身のＨＰが40%を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308103, "テンタパス", 308100, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】海辺に君臨する巨大な軟体魔獣。\n強靭な触手と鋼鉄の大銛で全てを破壊しつくす。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・後方範囲内に魔法中ダメージを与え、\n　麻痺状態を付与、さらに物理攻撃力、\n　魔法攻撃力を特大ダウン。\n・一定時間経過すると敵単体に\n　物理超特大ダメージを与える。\n・テンタパス自身のＨＰが40%を切ると、\n　さらに攻撃が激しく凶暴になる。");
