INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308201, "オオドクマンドラゴラ", 308200, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】異常発達したアオイのマンドラゴラ。\n強靭な根と種子の弾丸で眼前の敵を圧倒する。\n\n・前方２キャラに最大ＨＰに応じた物理割合\n　ダメージ。\n・ユニオンバーストは、敵全体に\n　物理大ダメージを与え、与えた合計ダメー\n　ジに応じて自身のＨＰを回復させる。\n・敵全体に連続で物理小ダメージを与えつつ、\n　物理防御力を３度ダウンさせる。\n・自身の物理攻撃力をアップさせつつ、ＴＰ\n　を上昇させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308202, "オオドクマンドラゴラ", 308200, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】異常発達したアオイのマンドラゴラ。\n強靭な根と種子の弾丸で眼前の敵を圧倒する。\n\n・前方２キャラに最大ＨＰに応じた物理割合\n　ダメージ。\n・ユニオンバーストは、敵全体に\n　物理大ダメージを与え、与えた合計ダメー\n　ジに応じて自身のＨＰを回復させる。\n・敵全体に連続で物理小ダメージを与えつつ、\n　物理防御力を３度ダウンさせる。\n・自身の物理攻撃力をアップさせつつ、ＴＰ\n　を上昇させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308203, "オオドクマンドラゴラ", 308200, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】異常発達したアオイのマンドラゴラ。\n強靭な根と種子の弾丸で眼前の敵を圧倒する。\n\n・前方２キャラに最大ＨＰに応じた物理割合\n　ダメージ。\n・ユニオンバーストは、敵全体に\n　物理大ダメージを与え、与えた合計ダメー\n　ジに応じて自身のＨＰを回復させる。\n・敵全体に連続で物理小ダメージを与えつつ、\n　物理防御力を３度ダウンさせる。\n・自身の物理攻撃力をアップさせつつ、ＴＰ\n　を上昇させる。\n・マンドラゴラ自身のＨＰが40％を切ると、\n　さらに攻撃が激しく狂暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308204, "オオドクマンドラゴラ", 308204, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【MODE2】猛毒の胞子が降り注ぎ、大地は\n荒野と化す。\n数多の骸を苗床に、猛毒の大輪が鮮やかに\n咲き誇る。\n\n下記の行動を順番に繰り返す。\n・地面に埋まっている間、ダメージを受け付け\n　ない状態になる。\n・敵全体を強力な毒状態にする。\n・自身にかかっているステータスダウン効果を\n　解除したあと、自身の物理防御力と魔法防御\n　力を極大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308205, "オオドクマンドラゴラ", 308200, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【MODE1】触手から滴り落ちる猛毒の雫。\nその一滴は泉を枯らし、森を腐らせ、命を侵す。\n\n・前方２キャラに物理ダメージを与え、さらに\n　毒状態にする。\n・ユニオンバーストは、敵全体に\n　物理大ダメージを与え、与えた合計ダメー\n　ジに応じて自身のＨＰを回復させる。\n　毒状態のキャラには、ダメージが大アップ。\n・敵全体に連続で物理小ダメージを与えつつ、\n　物理防御力を３度ダウンさせる。\n・自身の物理攻撃力をアップさせつつ、ＴＰ\n　を上昇させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308206, "オオドクマンドラゴラ", 308200, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【MODE3】絶命の咆哮、巨腕の蹂躙。\n花のように散る命。自らの断末魔を子守歌に、\n亡骸は永遠の眠りにつく。\n\n・前方２キャラに最大ＨＰに応じた物理割合\n　ダメージ。\n・ユニオンバーストは、敵全体に\n　物理大ダメージを与え、与えた合計ダメー\n　ジに応じて自身のＨＰを回復させる。\n・敵全体に連続で物理小ダメージを与えつつ、\n　物理防御力を３度ダウンさせる。\n・自身の物理攻撃力をアップさせつつ、ＴＰ\n　を上昇させる。\n・残り時間が40秒を切ると、さらに攻撃が\n　激しく狂暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308207, "ラフレシアマンドラゴラ", 308207, 0, 16, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】塔の魔力で開花した劇毒を放つ死の大花。\nその毒は、全ての感覚を狂わせ生ある全てを蝕む。\n\n・前方２キャラに物理ダメージを与える。\n　自身のＨＰが80％を切っている場合、さらに\n　毒状態にする。\n・ユニオンバーストは敵全体に物理大ダメージを\n　与え、毒状態のキャラに割合ダメージを与える。\n　その後、敵全体の物理攻撃力を大ダウンさせ、\n　自身の物理攻撃力を大アップさせる。\n・敵全体に物理中ダメージを与え、物理防御をダ\n　ウンさせる。\n・自分の物理攻撃力とＴＰをアップする。\n・残りＨＰが80％を切ると、さらに攻撃が激し\n　く狂暴になる。\n・地面に埋まっている間、ダメージを受け付けな\n　い状態になり、敵全体に物理中ダメージを与え、\n　敵全体を長時間、毒状態にする。さらに、毒状\n　態のキャラを猛毒状態にする。\n　その後、地面から出てきた際に、物理防御力と\n　魔法防御力を極大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308300, "島クジラ", 308300, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】数多の探検家を飲み込んだ幻島の巨鯨。欲望、幻想に憑りつかれた愚者を無慈悲に葬る。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・敵全体に魔法中ダメージを与え、\n　さらに島クジラ自身の物理防御力、\n　魔法防御力を極大アップ。\n・前から３キャラに魔法大ダメージを与え、\n　さらに大きく吹き飛ばす。\n・島クジラ自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308301, "島クジラ", 308300, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】数多の探検家を飲み込んだ幻島の巨鯨。欲望、幻想に憑りつかれた愚者を無慈悲に葬る。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・敵全体に魔法中ダメージを与え、\n　さらに島クジラ自身の物理防御力、\n　魔法防御力を極大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308302, "島クジラ", 308300, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】数多の探検家を飲み込んだ幻島の巨鯨。欲望、幻想に憑りつかれた愚者を無慈悲に葬る。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・敵全体に魔法中ダメージを与え、\n　さらに島クジラ自身の物理防御力、\n　魔法防御力を極大アップ。\n・前から３キャラに魔法大ダメージを与え、\n　さらに大きく吹き飛ばす。\n・島クジラ自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308303, "島クジラ", 308300, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】数多の探検家を飲み込んだ幻島の巨鯨。欲望、幻想に憑りつかれた愚者を無慈悲に葬る。\n\n・敵全体にキャラの最大ＨＰに応じた\n　物理大ダメージを与える。\n・敵全体に魔法中ダメージを与え、\n　さらに島クジラ自身の物理防御力、\n　魔法防御力を極大アップ。\n・前から３キャラに魔法大ダメージを与え、\n　さらに大きく吹き飛ばす。\n・島クジラ自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308400, "ファントムバロン", 308400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】我が子への妄執に囚われた亡親の霊。\n娘と偽りの日々を享受すべく、\n立ち塞がる者を容赦なく屠る。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　さらに魔法防御力をダウンさせる。\n・最も近い敵１キャラに魔法大ダメージを与える。\n　さらに、前方３キャラにキャラの最大ＨＰに\n　応じた魔法割合ダメージを与え、\n　大きく吹き飛ばす。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308401, "ファントムバロン", 308400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】我が子への妄執に囚われた亡親の霊。\n娘と偽りの日々を享受すべく、\n立ち塞がる者を容赦なく屠る。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　さらに魔法防御力をダウンさせる。\n・最も近い敵１キャラに魔法大ダメージを与える。\n　さらに、前方３キャラにキャラの最大ＨＰに\n　応じた魔法割合ダメージを与え、\n　大きく吹き飛ばす。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308402, "ファントムバロン", 308400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】我が子への妄執に囚われた亡親の霊。\n娘と偽りの日々を享受すべく、\n立ち塞がる者を容赦なく屠る。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　さらに魔法防御力をダウンさせる。\n・最も近い敵１キャラに魔法大ダメージを与える。\n　さらに、前方３キャラにキャラの最大ＨＰに\n　応じた魔法割合ダメージを与え、\n　大きく吹き飛ばす。\n・一番遠くの敵１キャラに物理中ダメージを\n　与え、さらに一番前にいるキャラの位置まで\n　引き寄せてスタンさせる。\n・ファントムバロンのＨＰが40％を切ると、\n　さらに攻撃が激しく狂暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308403, "ファントムバロン", 308400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】我が子への妄執に囚われた亡親の霊。\n娘と偽りの日々を享受すべく、\n立ち塞がる者を容赦なく屠る。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　さらに魔法防御力をダウンさせる。\n・最も近い敵１キャラに魔法大ダメージを与える。\n　さらに、前方３キャラにキャラの最大ＨＰに\n　応じた魔法割合ダメージを与え、\n　大きく吹き飛ばす。\n・一番遠くの敵１キャラに物理中ダメージを\n　与え、さらに一番前にいるキャラの位置まで\n　引き寄せてスタンさせる。\n・ファントムバロンのＨＰが40％を切ると、\n　さらに攻撃が激しく狂暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308404, "ファントムバロン", 308400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【ＭＯＤＥ１】【リトルリリカル】の\nシャドウを召喚。\n無垢な少女達が手招く先は、亡者が蠢く常夜の国。\n\n・前方１キャラに魔法ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308405, "ファントムバロン", 308400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【ＭＯＤＥ２】冥府の門が開かれ、\n生者の魂は奈落に墜ちる。既に還る術もなく、\n思い出を標に闇を漂う。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　さらに魔法防御力をダウンさせる。\n・一番遠くの敵１キャラに物理中ダメージを\n　与え、さらに一番前にいるキャラの位置まで\n　引き寄せてスタンさせる。\n・前方３キャラに魔法中ダメージを与えて\n　ＴＰを中ダウンさせ、ファントムバロン\n　のＴＰを中回復させる。\n　さらに、物理攻撃をするキャラのうち、\n　前から３キャラのステータスアップ効果を\n　解除し、魔法攻撃をするキャラのうち、\n　前から３キャラに追加の魔法大ダメージを\n　与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308406, "ファントムバロン", 308400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【ＭＯＤＥ３】最愛との別離が刻々と近づく。\n悲しき宿命に抗うべく、\n怨霊は寂滅の慟哭をあげる。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　さらに魔法防御力をダウンさせる。\n・最も近い敵１キャラに魔法大ダメージを与える。\n　さらに、前方３キャラにキャラの最大ＨＰに\n　応じた魔法割合ダメージを与え、\n　大きく吹き飛ばす。\n・一番遠くの敵１キャラに物理中ダメージを\n　与え、さらに一番前にいるキャラの位置まで\n　引き寄せてスタンさせる。\n・バトル開始直後に、自身の魔法攻撃力と\n　行動速度をアップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308408, "マッドファントム", 308408, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】塔の魔力に群がる怨魂が姿を成した亡霊。\n邪悪な手が生者を呼び込み、冥府へ引き摺り込む。\n\n・敵全体に魔法大ダメージを与え、\n　さらに魔法防御力をダウンさせる。\n・最も近い敵１キャラに魔法大ダメージを与える。\n　さらに、前方３キャラに魔法中ダメージを与え、\n　大きく吹き飛ばす。\n・一番遠くの敵１キャラに物理中ダメージを\n　与え、さらに一番前にいるキャラの位置まで\n　引き寄せてスタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308500, "水瑚麟", 308500, 0, 16, 270, 1000, 1, 2.8, 0, 0, 0, "【物理】ルナの魔力に魅入られ荒れ狂う水の神獣。\n自らの役目を忘れ、万物を飲み込む狂獣と化す。\n\n・敵全体に魔法大ダメージを与え、畏怖を与える。\n　畏怖状態のキャラは、一定時間攻撃および\n　ＨＰ回復のユニオンバーストの効果が半減する。\n・前方範囲内に魔法中ダメージを与え、\n　ヒットした数に応じて自身の物理防御力を\n　小アップ。さらに、魔法ダメージを与える\n　フィールドを展開する。\n・前方１キャラに魔法大ダメージを与え、\n　自身のＨＰを消費し、敵全体に追加の\n　魔法中ダメージを与える。\n　さらに、自身の物理攻撃力と魔法攻撃力を\n　小アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308600, "ドラゴンもどき", 308600, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308601, "ドラゴンもどき", 308600, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ドラゴン？の如き翼で空を舞い\nドラゴン？の如き灼熱のブレスで敵を焦がす。\n\n・バトルの開始時、自身に【火の実】を70追加。\n・ユニオンバーストは、敵全体に\n　ドラゴンもどきが保持している【火の実】の\n　数に応じた物理割合ダメージを与える。\n　その後【火の実】が60減少する。\n・前方の３キャラに、キャラの最大ＨＰに応じた\n　物理割合ダメージを与え、スタンさせる。\n・しばらくの間、物理防御力と魔法防御力が大幅\n　に下がり、食事モーションをとっている間、\n　最大で60、【火の実】を継続して追加する。\n　モーション中にドラゴンもどきが5000\n　以上のダメージを受けるとスキルが中断され\n　【火の実】が30減少する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308602, "ドラゴンもどき", 308600, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ドラゴン？の如き翼で空を舞い\nドラゴン？の如き灼熱のブレスで敵を焦がす。\n\n・バトルの開始時、自身に【火の実】を70追加。\n・ユニオンバーストは、敵全体に\n　ドラゴンもどきが保持している【火の実】の\n　数に応じた物理割合ダメージを与える。\n　その後【火の実】が60減少する。\n・前方の３キャラに、キャラの最大ＨＰに応じた\n　物理割合ダメージを与え、スタンさせる。\n・しばらくの間、物理防御力と魔法防御力が大幅\n　に下がり、食事モーションをとっている間、\n　最大で60、【火の実】を継続して追加する。\n　モーション中にドラゴンもどきが20000\n　以上のダメージを受けるとスキルが中断され\n　【火の実】が30減少する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308603, "ドラゴンもどき", 308600, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】ドラゴン？の如き翼で空を舞い\nドラゴン？の如き灼熱のブレスで敵を焦がす。\n\n・バトルの開始時、自身に【火の実】を70追加。\n・ユニオンバーストは、敵全体に\n　ドラゴンもどきが保持している【火の実】の\n　数に応じた物理割合ダメージを与える。\n　その後【火の実】が60減少する。\n・前方の３キャラに、キャラの最大ＨＰに応じた\n　物理割合ダメージを与え、スタンさせる。\n・しばらくの間、物理防御力と魔法防御力が大幅\n　に下がり、食事モーションをとっている間、\n　最大で60、【火の実】を継続して追加する。\n　モーション中にドラゴンもどきが160000\n　以上のダメージを受けるとスキルが中断され\n　【火の実】が30減少する。\n・ドラゴンもどきのＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308604, "ドラゴンもどき", 308600, 0, 16, 270, 2160, 1, 1.8, 0, 0, 0, "【ＭＯＤＥ１】蒼天から降る咆哮が空を裂き、\n陽光に輝く自慢の翼で巨大な偽竜が降臨する。\n\n・ドラゴンもどきの残りＨＰが80％を切ると\n　次のＭＯＤＥに移行する。\n\n・バトルの開始時、自身に【火の実】を70追加。\n・ユニオンバーストは、敵全体に\n　ドラゴンもどきが保持している【火の実】の\n　数に応じた物理割合ダメージを与える。\n　その後【火の実】が60減少する。\n・前方の３キャラに、キャラの最大ＨＰに応じた\n　物理割合ダメージを与え、スタンさせる。\n・しばらくの間、物理防御力と魔法防御力が大幅\n　に下がり、食事モーションをとっている間\n　最大で60、【火の実】を継続して追加する。\n　モーション中にドラゴンもどきが150000\n　以上のダメージを受けるとスキルが中断され\n　【火の実】が30減少する。\n・４体のモンスターを呼び寄せ、さらに敵全体\n　を小さくノックバック。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308605, "ドラゴンもどき", 308600, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【ＭＯＤＥ２】偽竜の呼びかけに森の魔物たちが\n集結する。彼を守るべく死力を尽くす。\n\n・ゴーレム、トレント、ポイズンポッド\n　を倒すと、次のＭＯＤＥに移行する。\n\n・ドラゴンもどきは、目の前の敵１キャラへの\n　物理攻撃を行う。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (308606, "ドラゴンもどき", 308606, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【ＭＯＤＥ３】竜への憧れが石竜子を覚醒\nさせる。空を統べる覇者の息吹は島を絶やす\n劫火となる。\n\n・バトルの開始時、自身に【火の実】を70追加。\n・ユニオンバーストは、敵全体に\n　ドラゴンもどきが保持している【火の実】の\n　数に応じた物理割合ダメージを与える。\n　その後【火の実】が60減少する。\n・前方の３キャラに、キャラの最大ＨＰに応じた\n　物理割合ダメージを与え、スタンさせる。\n・しばらくの間、物理防御力と魔法防御力が大幅\n　に下がり、食事モーションをとっている間、\n　最大で60、【火の実】を継続して追加する。\n　モーション中にドラゴンもどきが250000\n　以上のダメージを受けるとスキルが中断され\n　【火の実】が30減少する。\n・バトル開始直後に、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309000, "ランドスロース", 309000, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】夢うつつの狭間で惰眠を貪るナマケモノ。\n眠りを妨げると怒り狂い、超能力で暴れまわる。\n\n・敵全体にキャラの最大ＨＰに応じた魔法割合ダ\n　メージを与え、さらに物理攻撃力と魔法攻撃力\n　を大ダウン。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・敵全体に魔法小ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309001, "ランドスロース", 309001, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】夢うつつの狭間で惰眠を貪るナマケモノ。\n眠りを妨げると怒り狂い、超能力で暴れまわる。\n\n・敵全体にキャラの最大ＨＰに応じた魔法割合ダ\n　メージを与え、さらに物理攻撃力と魔法攻撃力\n　を大ダウン。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・敵全体に魔法小ダメージを与え、スタンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309100, "ドロゲーター", 309100, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】大河に棲む大ワニの魔物。\nマヌケな顔で、不思議な槍で大地を\n融解させ冒険者の動きを封じる。\n\n・敵全体に物理大ダメージを与え、\n　物理防御力と行動速度をダウン\n　させる。\n\n・前から３番目の敵を中心にした\n　小範囲に物理小ダメージを与え、\n　束縛状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309200, "スカイワルキューレ", 309200, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】戦空を駆け舞う、天上の戦乙女。\n目にも留まらぬ連射で、敵の進行を射止める。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、前方範囲内の最大４キャ\n　ラに物理大ダメージを与え、ＴＰを特大ダウン、\n　行動速度を大ダウンさせる。\n・前から３キャラに物理中ダメージを与え、自身\n　の行動速度を大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309201, "スカイワルキューレ", 309201, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】戦空を駆け舞う、天上の戦乙女。\n目にも留まらぬ連射で、敵の進行を射止める。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・ユニオンバーストは、前方範囲内の最大４キャ\n　ラに物理大ダメージを与え、ＴＰを特大ダウン、\n　行動速度を大ダウンさせる。\n・前から４キャラに物理中ダメージを与え、物理\n　攻撃力と魔法攻撃力を大ダウンさせる。\n　さらに自身の行動速度を大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309300, "トナカイ・ヴェンデッタ", 309300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309301, "トナカイ・ヴェンデッタ", 309300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】主人へ反逆を決めた、エリートトナカイ。\n欲深いサンタたちへ、従者の心の鉄槌を下す。\n\n・ユニオンバーストは、召喚キャラを消滅させた\n　あと、敵全体にキャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n　このダメージを受けたあとにＨＰが40％を\n　切ったキャラを一定時間トナカイに変え、\n　さらに物理クリティカルと魔法クリティカルを\n　下げる。トナカイになったキャラは、通常攻撃\n　しか使用できなくなる。\n　一定時間、自身の物理防御力を大きく下げる。\n・一番前のキャラを中心として、一定範囲に\n　キャラの最大ＨＰに応じた物理割合ダメージを\n　与える。さらに自身の物理攻撃力をアップ\n　させる。\n・一番前のキャラに物理ダメージを与えて\n　ノックバックさせ、さらにスタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309302, "トナカイ・ヴェンデッタ", 309300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】主人へ反逆を決めた、エリートトナカイ。\n欲深いサンタたちへ、従者の心の鉄槌を下す。\n\n・ユニオンバーストは、召喚キャラを消滅させた\n　あと、敵全体にキャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n　このダメージを受けたあとにＨＰが40％を\n　切ったキャラを一定時間トナカイに変え、\n　さらに物理クリティカルと魔法クリティカルを\n　下げる。トナカイになったキャラは、通常攻撃\n　しか使用できなくなる。\n　一定時間、自身の物理防御力を大きく下げる。\n・一番前のキャラを中心として、一定範囲に\n　キャラの最大ＨＰに応じた物理割合ダメージを\n　与える。さらに自身の物理攻撃力をアップ\n　させる。\n・一番前のキャラに物理ダメージを与えて\n　ノックバックさせ、さらにスタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309303, "トナカイ・ヴェンデッタ", 309300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】主人へ反逆を決めた、エリートトナカイ。\n欲深いサンタたちへ、従者の心の鉄槌を下す。\n\n・ユニオンバーストは、召喚キャラを消滅させた\n　あと、敵全体にキャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n　このダメージを受けたあとにＨＰが40％を\n　切ったキャラを一定時間トナカイに変え、\n　さらに物理クリティカルと魔法クリティカルを\n　下げる。トナカイになったキャラは、通常攻撃\n　しか使用できなくなる。\n　一定時間、自身の物理防御力を大きく下げる。\n・一番前のキャラを中心として、一定範囲に\n　キャラの最大ＨＰに応じた物理割合ダメージを\n　与える。さらに自身の物理攻撃力をアップ\n　させる。\n・一番前のキャラに物理ダメージを与えて\n　ノックバックさせ、さらにスタンさせる。\n・トナカイ・ヴェンデッタ自身のＨＰが50％を\n　切ると、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309304, "トナカイ・ヴェンデッタ", 309300, 0, 16, 270, 3000, 1, 4.2, 0, 0, 0, "【ＭＯＤＥ１】クリスティーナ、ノゾミ、\nイリヤのシャドウを召喚。３人の歪んだ欲望と\n御節介が、かたちとなり聖夜を渾沌に変えていく。\n\n・一番前のキャラに物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309305, "トナカイ・ヴェンデッタ", 309300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【ＭＯＤＥ２】聖夜の街に絶望が雪のように\n降り積る。染まる欲望の袋より、積念の憎悪が\n溢れだす。\n\n・ユニオンバーストは、召喚キャラを消滅させた\n　あと、敵全体にキャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n　このダメージを受けたあとにＨＰが40％を\n　切ったキャラを一定時間トナカイに変え、\n　さらに物理クリティカルと魔法クリティカルを\n　下げる。トナカイになったキャラは、通常攻撃\n　しか使用できなくなる。\n　一定時間、自身の物理防御力を大きく下げる。\n・一番前のキャラを中心として、一定範囲に\n　キャラの最大ＨＰに応じた物理割合ダメージを\n　与える。さらに自身の物理攻撃力をアップ\n　させる。\n・一定時間、前方にフィールドを発生させる。\n　このフィールド上にいるキャラに対して、\n　物理攻撃力と物理クリティカルと\n　ＴＰ上昇を大きく下げる。\n・一番前のキャラに物理ダメージを与えて\n　ノックバックさせ、さらにスタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309306, "トナカイ・ヴェンデッタ", 309300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【ＭＯＤＥ３】手負いの巨獣が、反撃の狼煙を\n上げる。憎悪と憤怒に身を落とし、残虐の限りを\n尽くす。\n\n・ユニオンバーストは、召喚キャラを消滅させた\n　あと、敵全体にキャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n　このダメージを受けたあとにＨＰが35％を\n　切ったキャラを一定時間トナカイに変え、\n　さらに物理クリティカルと魔法クリティカルを\n　下げる。トナカイになったキャラは、通常攻撃\n　しか使用できなくなる。\n　一定時間、自身の物理防御力を大きく下げる。\n・一番前のキャラを中心として、一定範囲に\n　キャラの最大ＨＰに応じた物理割合ダメージを\n　与える。さらに自身の物理攻撃力をアップ\n　させる。\n・一番前のキャラに物理ダメージを与えて\n　ノックバックさせ、さらにスタンさせる。\n・バトル開始直後に、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309400, "サーヴァント・ブレド（物理）", 309400, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】覇瞳皇帝が生み出した動く力の貯蔵庫。\n膂力の権能を司り、極大の剣戟で全てを斬破する。\n\n・スタンと吹き飛ばし効果が有効。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた物理割合ダメージを与える。\n\n・目の前の敵を中心に、範囲内の敵すべてに\n　キャラの最大ＨＰに応じた物理割合\n　ダメージを与える。\n\n・サーヴァント・ブレド（物理）自身の\n　ＨＰが40％を切ると、さらに攻撃が\n　激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309500, "サーヴァント・マギ（魔法）", 309500, 0, 16, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】覇瞳皇帝が生み出した動く力の貯蔵庫。\n魔道の権能を司り、無尽の魔力で全てを滅却する。\n\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与える。\n　さらに、物理攻撃力と魔法攻撃力を小ダウン。\n\n・ランダムな１キャラに魔法ダメージを与え、\n　さらに呪い、麻痺状態にしてＴＰを大ダウン。\n\n・サーヴァント・マギ（魔法）自身の\n　ＨＰが40％を切ると、さらに攻撃が\n　激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309600, "サーヴァント・ロクス（複部位）", 309600, 0, 16, 270, 1000, 1, 1.8, 0, 0, 0, "【物理】覇瞳皇帝が生み出した動く力の貯蔵庫。\n双肩の権能を司り、広闊たる領域で全てを屠る。\n\n・ユニオンバーストは、目の前の敵を中心に、\n　範囲内の敵すべてにキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、さらに\n　目の前の敵に物理小ダメージを与える。\n\n・目の前の敵を中心にキャラの\n　最大ＨＰに応じた物理割合ダメージを\n　与える。\n\n・サーヴァント・ロクス（複部位）自身の\n　ＨＰが40％を切ると、さらに防御力が\n　上がり頑強になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309700, "サーヴァント・ウォル（防衛）", 309700, 0, 16, 270, 1000, 2, 1.8, 0, 0, 0, "【魔法】覇瞳皇帝が生み出した動く力の貯蔵庫。\n守護の権能を司り、不侵の壁で全てを拒絶する。\n\n・ユニオンバーストは、自身の物理防御力、\n　魔法防御力を大アップ。\n\n・目の前の敵を中心に、範囲内の敵すべてに\n　魔法ダメージ。さらに、自身の物理防御力、\n　魔法防御力を小アップ。\n\n・サーヴァント・ウォル（防衛）自身の\n　ＨＰが40％を切ると、さらに防御力が\n　上がり頑強になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309800, "覇瞳皇帝", 309800, 0, 16, 270, 1000, 1, 3.6, 309800, 309800, 0, "王都終末決戦_ベースユニット");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309801, "覇瞳皇帝", 309801, 0, 16, 270, 1000, 1, 2.4, 309800, 309800, 0, "【MODE１】全てを、拒絶する悲しき王女。\n自らを神とし、禍禍しき力にその身をのまれる。\nそして狂乱の刃をアストルムの全てに向ける。\n欺瞞の王女を守護する壁を、数多の刃で打ち破れ。\n\n・バリアを張り、敵の攻撃を受け付けなくなる。\n　バリアはダメージ量に関係なく、攻撃を\n　命中させるたびに徐々に耐久性を失っていき、\n　280回攻撃を命中させるとバリアは破壊\n　される。\n\n・ユニオンバーストは、敵全体に残りＨＰに\n　応じた割合特大ダメージを与える。\n\n・敵全体に、物理小ダメージと魔法\n　小ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309802, "覇瞳皇帝", 309800, 0, 16, 270, 1000, 1, 1.8, 309800, 309800, 0, "【MODE２】小さき者の反抗に僅かな焦燥を見せる。\n希望を抱き、対向する全てに自らの理を科す。\n悲憤の剣を突き立て、その魂を塵芥へと挫く。\n仮初の神の放つ黒刃に、正しき魔法を以て\n対抗せよ。\n\n・ユニオンバーストは、敵全体に残りＨＰに\n　応じた割合特大ダメージを与える。\n\n・目の前の敵１キャラに物理特大ダメージを与え、\n　さらにその周囲の敵すべてに魔法中ダメージを\n　与え、気絶させる。気絶したキャラは、\n　次に攻撃を受けるまで行動不能になる。\n\n・敵全体に、物理小ダメージと魔法\n　小ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309803, "覇瞳皇帝", 309800, 0, 16, 270, 1000, 1, 1.6, 309800, 309800, 0, "【MODE３】世界を創りし神の、最期の叫声。\n怨嗟が放つ拒絶の言の葉は呪詛となり、\n躰を、精神を、魂を削りすべてを闇に帰す。\n遂に決着の時。皆、剣を取りその手で明日を\n切り拓け。\n\n・ユニオンバーストは、敵全体に残りＨＰに\n　応じた割合特大ダメージを与える。\n\n・目の前の敵１キャラに物理特大ダメージを与え、\n　さらにその周囲の敵すべてに魔法中ダメージを\n　与え、気絶させる。気絶したキャラは、\n　次に攻撃を受けるまで行動不能になる。\n\n・敵全体に、物理小ダメージと魔法\n　小ダメージを与える。\n\n・最も後ろの敵１キャラを中心に、物理防御力と\n　魔法防御力を中ダウンさせるフィールドを\n　展開し、さらに魔法小ダメージを与え、\n　呪詛を付与する。呪詛による継続ダメージは、\n　毎秒ごとに増加する。\n\n・バトル開始直後に、自分の行動速度を\n　大アップさせ、さらに魔法防御力を\n　小アップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309804, "覇瞳皇帝", 309804, 0, 16, 270, 1000, 1, 1.8, 309800, 309800, 0, "マップ表示用");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (309900, "ゴブリンメイスター", 309900, 0, 17, 270, 1100, 2, 1.8, 0, 0, 0, "【魔法】塔の魔力を我が物に画策する小鬼学者。\n禁術で土塊の人形を操り、全ての自由を強奪する。\n\n・敵全体に魔法大ダメージを与え、\n　すべての召喚体、分身を即死させる。\n・前方広範囲に残りＨＰに応じた割合物理\n　中ダメージを与え、大きく吹き飛ばす。\n　さらに、泥人形を１体召喚する。\n　泥人形は最前衛または前から２番目のキャラに\n　物理ダメージを与え、行動速度を下げる。\n・前から２番目のキャラを中心とした小範囲に\n　物理中ダメージと猛毒、スタンを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310000, "山神様", 310000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】駆走る神と伝承される山の土着神。\n太古より好敵手を求め大地を雄々しく競奔する。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、\n　ノックバックさせる。\n　先頭のキャラにはさらに追加で物理\n　特大ダメージを与え、大きく吹き飛ばして\n　スタンさせる。\n　山神様がユニオンバーストを発動するたび\n　自身の物理防御力がダウンする。\n　この効果は累積する。\n・魔法攻撃力の最も高い１キャラに、キャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　ＴＰを大きくダウンさせる。\n・自身のＴＰと行動速度をアップさせる。\n・山神様自身のＨＰが55％を切ると、さらに\n　攻撃が激しく凶暴になる代わりに\n　自身の物理防御力がダウンする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310001, "山神様", 310000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】駆走る神と伝承される山の土着神。\n太古より好敵手を求め大地を雄々しく競奔する。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、\n　ノックバックさせる。\n　先頭のキャラにはさらに追加で物理特大\n　ダメージを与え、ノックバックさせて\n　スタンさせる。\n　山神様がユニオンバーストを発動するたび\n　自身の物理防御力がダウンする。\n　この効果は累積する。\n・自身のＴＰと行動速度をアップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310002, "山神様", 310000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】駆走る神と伝承される山の土着神。\n太古より好敵手を求め大地を雄々しく競奔する。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、\n　ノックバックさせる。\n　先頭のキャラにはさらに追加で物理特大\n　ダメージを与え、ノックバックさせて\n　スタンさせる。\n　山神様がユニオンバーストを発動するたび\n　自身の物理防御力がダウンする。\n　この効果は累積する。\n・魔法攻撃力の最も高い１キャラに、キャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　ＴＰをダウンさせる。\n・自身のＴＰと行動速度をアップさせる。\n・山神様自身のＨＰが55％を切ると、さらに\n　攻撃が激しく凶暴になる代わりに\n　自身の物理防御力がダウンする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310003, "山神様", 310000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】駆走る神と伝承される山の土着神。\n太古より好敵手を求め大地を雄々しく競奔する。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、\n　ノックバックさせる。\n　先頭のキャラにはさらに追加で物理特大\n　ダメージを与え、ノックバックさせて\n　スタンさせる。\n　山神様がユニオンバーストを発動するたび\n　自身の物理防御力がダウンする。\n　この効果は累積する。\n・魔法攻撃力の最も高い１キャラに、キャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　ＴＰをダウンさせる。\n・自身のＴＰと行動速度をアップさせる。\n・山神様自身のＨＰが55％を切ると、さらに\n　攻撃が激しく凶暴になる代わりに\n　自身の物理防御力がダウンする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310004, "山神様", 310000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ１】冒険者の力を試す、内なる影を\n召喚。寒風吹き荒ぶ天下の険、自身の脆さが\n試される。\n\n・一番前のキャラに物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310005, "山神様", 310000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ２】益荒男の疾駆に大地が揺れる。\nその様を祝賀するが如く、目出鯛は巌山を舞う。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、\n　ノックバックさせる。\n　先頭のキャラにはさらに追加で物理特大\n　ダメージを与え、大きく吹き飛ばして\n　スタンさせる。\n　山神様がユニオンバーストを発動するたび\n　自身の物理防御力がダウンする。\n　この効果は累積する。\n・魔法攻撃力の最も高い２キャラに、キャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　ＴＰを大きくダウンさせる。\n・後方に物理防御力ダウンフィールドを展開し、\n　さらに敵全体に物理中ダメージを与える。\n　目出鯛が背中を離れている間は、山神様の\n　魔法防御力が特大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310006, "山神様", 310000, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ３】神と競いし強者への、終の試煉。\n互いの全てを以て、想い人へ駆け抜ける。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、\n　ノックバックさせる。\n　先頭のキャラにはさらに追加で物理特大\n　ダメージを与え、大きく吹き飛ばして\n　スタンさせる。\n　山神様がユニオンバーストを発動するたび\n　自身の物理防御力がダウンする。\n　この効果は累積する。\n・魔法攻撃力の最も高い１キャラに、キャラの\n　最大ＨＰに応じた魔法割合ダメージを与え、\n　ＴＰを大きくダウンさせる。\n・自身のＴＰと行動速度をアップさせる。\n・バトル開始直後に、さらに攻撃が激しく\n　凶暴になる代わりに、自身の物理防御力が\n　ダウンする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310100, "ラースドラゴン", 310100, 0, 14, 270, 1000, 1, 2.6, 0, 0, 0, "【物理】忘却の秘境に、住まう若き巨竜。\n禁忌に踏み入る冒険者を灼熱の業火で焼き払う。\n\n・ユニオンバーストは敵全体に物理割合ダメージ\n　を与え、さらにＴＰをダウンさせる。\n・バトル開始時に、自身のＴＰを特大ダウン。\n・前方1キャラを中心に一定範囲内のキャラに\n　魔法ダメージを与え、さらに物理防御力を\n　ダウンさせる。\n・敵全体に物理ダメージを与え、さらに火傷\n　状態にする。\n・敵全体に物理ダメージを与え、ノックバック\n　させる、さらに、ステータスアップ効果を\n　打ち消す。\n\n・全ターゲットがブレイクされると、自身のＴＰ\n　を特大ダウン。\n・ラースドラゴン自身の残りＨＰが10％を切る\n　とさらに攻撃が激しく強暴になり、ブレイク\n　されなくなる。\n・バトルがタイムアップすると、敵全体を戦闘\n　不能にする。\n");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310200, "シャークヘッドレイ", 310200, 0, 16, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】海蝕洞の支配者として\n君臨する、サメエイの魔物。凶猛な\n欲望を全て捕食に注ぐ海の大悪党。\n\n・敵全体に物理特大ダメージを与え\n　物理防御力と魔法攻撃力を\n　ダウンさせる。\n\n・前方範囲内の敵すべてに\n　魔法小ダメージを与え、ＴＰと\n　ＴＰ上昇率をダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310201, "シャークグリード", 310201, 0, 16, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】塔の魔力を吸収した、暴食の巨大鮫鱏。\n音波で感覚を狂わせ、鈍った獲物を喰らい尽くす。\n\n・敵全体に物理特大ダメージを与え、物理防御力\n　と魔法攻撃力をダウンさせる。\n・最もＴＰの高い敵１キャラに魔法中ダメージを\n　与え、麻痺させる。\n　さらに挑発状態にする。\n・挑発を無視して、最もＨＰの高い敵１キャラに\n　毎秒増加する継続ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310300, "アンチビースト", 310300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310301, "アンチビースト", 310300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】愛の力を求め顕現した、負の魔法生物。\n皆の心の中の愛の力を歪め世界に災いをもたらす。\n\n・ユニオンバーストは、異次元より取り出した\n　アイテムで攻撃を仕掛ける。アイテムによって\n　効果が変化する。\n　ハンマーの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、物理攻撃力を\n　大幅にダウンさせる。\n　シンバルの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、魔法攻撃力を\n　大幅にダウンさせる。\n　ボムの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、\n　呪い状態にする。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・一番前の敵を中心に、範囲内の敵すべてに\n　物理中ダメージを与え、さらにノックバック\n　させる。\n・一定範囲内の敵すべてに物理大ダメージを\n　与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310302, "アンチビースト", 310300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】愛の力を求め顕現した、負の魔法生物。\n皆の心の中の愛の力を歪め世界に災いをもたらす。\n\n・ユニオンバーストは、異次元より取り出した\n　アイテムで攻撃を仕掛ける。アイテムによって\n　効果が変化する。\n　ハンマーの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、物理攻撃力を\n　大幅にダウンさせる。\n　シンバルの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、魔法攻撃力を\n　大幅にダウンさせる。\n　ボムの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、\n　呪い状態にする。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・一番前の敵を中心に、範囲内の敵すべてに\n　物理中ダメージを与え、さらにノックバック\n　させる。\n・一定範囲内の敵すべてに物理大ダメージを\n　与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310303, "アンチビースト", 310300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】愛の力を求め顕現した、負の魔法生物。\n皆の心の中の愛の力を歪め世界に災いをもたらす。\n\n・ユニオンバーストは、異次元より取り出した\n　アイテムで攻撃を仕掛ける。アイテムによって\n　効果が変化する。\n　ハンマーの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、物理攻撃力を\n　大幅にダウンさせる。\n　シンバルの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、魔法攻撃力を\n　大幅にダウンさせる。\n　ボムの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、\n　呪い状態にする。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・一番前の敵を中心に、範囲内の敵すべてに\n　物理中ダメージを与え、さらにノックバック\n　させる。\n・一定範囲内の敵すべてに物理大ダメージを\n　与える。\n・アンチビースト自身のＨＰが50％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310304, "アンチビースト", 310304, 0, 16, 270, 3000, 1, 4.2, 0, 0, 0, "【ＭＯＤＥ１】闇の力によって染め上げられた\n愛と欲望が形となった負の魔法生物。世界を\n無慈悲にただ歪めはじめる。\n\n・ユニオンバーストは、異次元より取り出した\n　アイテムで攻撃を仕掛ける。アイテムによって\n　効果が変化する。\n　ハンマーの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、物理攻撃力を\n　大幅にダウンさせる。\n　シンバルの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、魔法攻撃力を\n　大幅にダウンさせる。\n　ボムの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、\n　呪い状態にする。\n・一番前の敵を中心に、範囲内の敵すべてに\n　物理中ダメージを与え、さらにノックバック\n　させる。\n・一定範囲内の敵すべてに物理大ダメージを\n　与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310305, "アンチビースト", 310300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【ＭＯＤＥ２】魔法少女のシャドウを召喚。\n歪んだ負の絶望影が、魔法少女たちの愛と\n希望の力を試す。\n\n・シャドウの戦いを静かに見守る。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310306, "アンチビースト", 310300, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【ＭＯＤＥ３】憤怒する負の魔法生物はとうとう\n真の力を解放する。魔法少女の心を打ち砕かん\nと、歪んだ愛の力ですべてを捻じ伏せる。\n\n・ユニオンバーストは、異次元より取り出した\n　アイテムで攻撃を仕掛ける。アイテムによって\n　効果が変化する。\n　ハンマーの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、物理攻撃力を\n　大幅にダウンさせる。\n　シンバルの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、魔法攻撃力を\n　大幅にダウンさせる。\n　ボムの場合、敵全体にキャラの最大ＨＰに\n　応じた物理割合ダメージを与え、\n　呪い状態にする。\n・一番前の敵を中心に、範囲内の敵すべてに\n　物理中ダメージを与え、さらにノックバック\n　させる。\n・一定範囲内の敵すべてに物理大ダメージを\n　与える。\n・バトル開始直後に、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310400, "カメレオプス", 310400, 0, 11, 270, 1000, 1, 2.4, 0, 0, 0, "【物理】湿林に潜み獲物を付け狙う\nカメレオンの魔物。臆病で狡猾な気\n性だが、怒るとツノを向け猛突進。\n\n・ユニオンバーストは、敵全体に物\n　理大ダメージを与え、物理防御力\n　を大ダウンさせる。\n\n・ランダムな１キャラに\n　物理中ダメージを与える。\n\n・カメレオプスが一定時間背景に擬\n　態し、回避を極大アップ、行動速\n　度を特大アップ、物理防御力が大\n　ダウンする。\n\n・前方３キャラに物理中ダメージを\n　与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310401, "カメレオプス", 310401, 0, 11, 270, 1000, 1, 2.4, 0, 0, 0, "【物理】湿林に潜み獲物を付け狙う\nカメレオンの魔物。臆病で狡猾な気\n性だが、怒るとツノを向け猛突進。\n\n・ユニオンバーストは、敵全体に物\n　理大ダメージを与え、物理防御力\n　を大ダウンさせる。\n\n・ランダムな１キャラに\n　物理中ダメージを与える。\n\n・カメレオプスが一定時間背景に擬\n　態し、回避を極大アップ、行動速\n　度を特大アップ、物理防御力が大\n　ダウンする。\n\n・前方３キャラに物理中ダメージを\n　与える。");
