INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310501, "ラウドラパーン", 310500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】ポップな体色をした大ウサギの魔物。\n見た目とは裏腹に迷惑極まりないその歌声は、\n大地を震わせ冒険者の心をも折る。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、\n　ノックバックさせる。その後、目を\n　回している間、自身の物理・魔法防御力が\n　大幅にダウンする。\n・一番前のキャラを中心として、一定範囲に\n　物理中ダメージを与え、さらに行動速度を\n　ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310502, "ラウドラパーン", 310500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】ポップな体色をした大ウサギの魔物。\n見た目とは裏腹に迷惑極まりないその歌声は、\n大地を震わせ冒険者の心をも折る。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、\n　ノックバックさせる。その後、目を\n　回している間、自身の物理・魔法防御力が\n　大幅にダウンする。\n・一番前のキャラを中心として、一定範囲に\n　物理中ダメージを与え、さらに行動速度を\n　ダウンさせる。\n・前から３キャラに物理小ダメージを与え、\n　さらに物理防御力を大ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310503, "ラウドラパーン", 310500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】ポップな体色をした大ウサギの魔物。\n見た目とは裏腹に迷惑極まりないその歌声は、\n大地を震わせ冒険者の心をも折る。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、\n　ノックバックさせる。その後、目を\n　回している間、自身の物理・魔法防御力が\n　大幅にダウンする。\n・一番前のキャラを中心として、一定範囲に\n　物理中ダメージを与え、さらに行動速度を\n　ダウンさせる。\n・前から３キャラに物理小ダメージを与え、\n　さらに物理防御力を大ダウンさせる。\n・ラウドラパーン自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310504, "ラウドラパーン", 310500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ１】ニュージェネレーションズの\nシャドウを召喚。森で出会った大ウサギ。\n３人は夢をあきらめない心を貫き通せるか、\n大ウサギは各個の弱さを見せつける。\n\n・一番前のキャラに物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310505, "ラウドラパーン", 310500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ２】森の人気者の歌声に魔物たちが\n大挙する。血沸き肉躍る野生の宴会が今、\n開幕する。\n\n・ブルーゴーレム、スリーピィオウル、\n　ツキツキを倒すと次のＭＯＤＥに移行する。\n\n・ラウドラパーンは、一番前のキャラに\n　物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310506, "ラウドラパーン", 310500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ３】宴も終焉、大兎が最後の力を振り\n絞る。咆哮にも似た壊震の歌声が、３人の夢道を\n阻む。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、\n　ノックバックさせる。その後、目を\n　回している間、自身の物理・魔法防御力が\n　大幅にダウンする。\n・一番前のキャラを中心として、一定範囲に\n　物理中ダメージを与え、さらに行動速度を\n　ダウンさせる。\n・前から３キャラに物理小ダメージを与え、\n　さらに物理防御力を大ダウンさせる。\n・バトル開始直後に、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310600, "葛藤のうえきちゃん", 310600, 0, 16, 270, 3000, 1, 1.6, 310600, 310600, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310601, "葛藤のうえきちゃん", 310600, 0, 16, 270, 3000, 1, 1.6, 310600, 310600, 0, "【魔法】魔物かはたまた精霊なのか、謎多き巨躯\nのいきもの。如何ともし難いその表情のまま謎の\n花粉を噴霧し、市中を混乱へと誘い落とす。\n\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、物理防御力と魔法防御力をダウンさせ\n　る。\n・前方範囲内の敵に物理ダメージを与え、ノック\n　バックさせる。\n・左右の葉っぱは、ブレイクすると一定時間消滅\n　する。\n・向かって左側の葉っぱのブレイク時、物理防御\n　力と魔法防御力が小ダウン。\n・本体のブレイク時、物理防御力と魔法防御力が\n　大ダウン。\n・向かって右側の葉っぱのブレイク時、物理防御\n　力と魔法防御力が小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310602, "葛藤のうえきちゃん", 310600, 0, 16, 270, 3000, 1, 1.6, 310600, 310600, 0, "【魔法】魔物かはたまた精霊なのか、謎多き巨躯\nのいきもの。如何ともし難いその表情のまま謎の\n花粉を噴霧し、市中を混乱へと誘い落とす。\n\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、物理防御力と魔法防御力をダウンさせ\n　る。\n・前方範囲内の敵に物理ダメージを与え、ノック\n　バックさせる。\n・きゅうこんちゃんを召喚。\n　きゅうこんちゃんは攻撃の対象にならず、一定\n　時間が経つと自爆して前方範囲内のキャラに魔\n　法ダメージを与える。\n・左右の葉っぱは、ブレイクすると一定時間消滅\n　する。\n・向かって左側の葉っぱのブレイク時、物理防御\n　力と魔法防御力が小ダウン。\n・本体のブレイク時、物理防御力と魔法防御力が\n　大ダウン。\n・向かって右側の葉っぱのブレイク時、物理防御\n　力と魔法防御力が小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310603, "葛藤のうえきちゃん", 310603, 0, 16, 270, 3000, 1, 1.6, 310600, 310600, 0, "【魔法】魔物かはたまた精霊なのか、謎多き巨躯\nのいきもの。如何ともし難いその表情のまま謎の\n花粉を噴霧し、市中を混乱へと誘い落とす。\n\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、物理防御力と魔法防御力をダウンさせ\n　る。\n・前方範囲内の敵に物理ダメージを与え、ノック\n　バックさせる。\n・きゅうこんちゃんを召喚。\n　きゅうこんちゃんは攻撃の対象にならず、一定\n　時間が経つと自爆して前方範囲内のキャラに魔\n　法ダメージを与える。\n・左右の葉っぱは、ブレイクすると一定時間消滅\n　する。\n・向かって左側の葉っぱのブレイク時、物理防御\n　力と魔法防御力が小ダウン。\n・本体のブレイク時、物理防御力と魔法防御力が\n　大ダウン。\n・向かって右側の葉っぱのブレイク時、物理防御\n　力と魔法防御力が小ダウン。\n・うえきちゃん自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310604, "葛藤のうえきちゃん", 310604, 0, 16, 270, 3000, 1, 1.6, 310600, 310600, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310605, "葛藤のうえきちゃん", 310604, 0, 16, 270, 3000, 1, 1.6, 310600, 310600, 0, "【MODE１】終に極大化した謎のいきもの。\nまたしても如何ともし難い表情で、大滝の涙が\n大地を濡らしその涙は意思なく皆を蝕んでゆく。\n\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、物理防御力と魔法防御力をダウンさせ\n　る。\n・敵全体のＴＰを上昇させたのち、継続魔法ダメ\n　ージを与えるフィールドを展開する。\n・左右の葉っぱは、ブレイクすると一定時間消滅\n　する。\n・向かって左側の葉っぱのブレイク時、物理防御\n　力と魔法防御力が小ダウン。\n・本体のブレイク時、物理防御力と魔法防御力が\n　大ダウン。\n・向かって右側の葉っぱのブレイク時、物理防御\n　力と魔法防御力が小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310606, "葛藤のうえきちゃん", 310604, 0, 16, 270, 3000, 1, 1.6, 310600, 310600, 0, "【MODE２】冒険者の抵抗に怯んだか、両葉と\nその巨躯を晒しつつ佇む。だが、その表情は相も\n変わらず、如何ともし難い表情のまま。\n\n・全てのターゲットがブレイク無効。\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、物理防御力と魔法防御力をダウンさせ\n　る。\n・前方範囲内の敵に物理ダメージを与え、ノック\n　バックさせる。\n・きゅうこんちゃんを召喚。\n　きゅうこんちゃんは攻撃の対象にならず、一定\n　時間が経つと自爆して前方範囲内のキャラに魔\n　法ダメージを与える。\n");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310607, "葛藤のうえきちゃん", 310604, 0, 16, 270, 3000, 1, 1.6, 310600, 310600, 0, "【MODE３】その変わらぬ表情は、終にも\n変わらず冒険者は、そのいきものの狂気と畏怖に\n慄く。果たしていきものの謎は解かれるのか…。\n\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、物理防御力と魔法防御力をダウンさせ\n　る。\n・前方範囲内の敵に物理ダメージを与え、ノック\n　バックさせる。\n・きゅうこんちゃんを召喚。\n　きゅうこんちゃんは攻撃の対象にならず、一定\n　時間が経つと自爆して前方範囲内のキャラに魔\n　法ダメージを与える。\n・左右の葉っぱは、ブレイクすると一定時間消滅\n　する。\n・向かって左側の葉っぱのブレイク時、物理防御\n　力と魔法防御力が小ダウン。\n・本体のブレイク時、物理防御力と魔法防御力が\n　大ダウン。\n・向かって右側の葉っぱのブレイク時、物理防御\n　力と魔法防御力が小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310700, "なかよしＸ", 310700, 0, 16, 270, 3000, 1, 1.4, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310701, "なかよしＸ", 310700, 0, 16, 270, 3000, 1, 1.4, 0, 0, 0, "【物理】規格外のアイデアと歪んだ情熱から爆誕\nした鋼鉄の巨人。礎となった者の特性を、異常な\n解釈で再構築し敵の言語中枢と精神を破壊する。\n\n・自身が毒、猛毒、呪い、呪詛、火傷の効果を\n　受けると、自身の物理防御力と魔法防御力と\n　行動速度が大ダウンする。\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与える。\n・自身の物理攻撃力をアップさせたあと、\n　敵全体に物理ダメージを与える。\n・前方３キャラに最大ＨＰに応じた魔法割合\n　ダメージを与え、行動速度をダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310702, "なかよしＸ", 310700, 0, 16, 270, 3000, 1, 1.4, 0, 0, 0, "【物理】規格外のアイデアと歪んだ情熱から爆誕\nした鋼鉄の巨人。礎となった者の特性を、異常な\n解釈で再構築し敵の言語中枢と精神を破壊する。\n\n・自身が毒、猛毒、呪い、呪詛、火傷の効果を\n　受けると、自身の物理防御力と魔法防御力と\n　行動速度が大ダウンする。\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与える。\n・自身の物理攻撃力をアップさせたあと、\n　敵全体に物理ダメージを与える。\n・前方３キャラに最大ＨＰに応じた魔法割合\n　ダメージを与え、行動速度をダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310703, "なかよしＸ", 310700, 0, 16, 270, 3000, 1, 1.4, 0, 0, 0, "【物理】規格外のアイデアと歪んだ情熱から爆誕\nした鋼鉄の巨人。礎となった者の特性を、異常な\n解釈で再構築し敵の言語中枢と精神を破壊する。\n\n・自身が毒、猛毒、呪い、呪詛、火傷の効果を\n　受けると、自身の物理防御力と魔法防御力と\n　行動速度が大ダウンする。\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与える。\n・自身の物理攻撃力をアップさせたあと、\n　敵全体に物理ダメージを与える。\n・前方３キャラに最大ＨＰに応じた魔法割合\n　ダメージを与え、行動速度をダウンさせる。\n・なかよしＸ自身のＨＰが40％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310704, "なかよしＸ", 310700, 0, 16, 270, 3000, 1, 4.2, 0, 0, 0, "【ＭＯＤＥ１】【メルクリウス財団】の\nシャドウを召喚。自分たちの過ちを\n嘲笑うかのように、影の姿で皆を翻弄する。\n\n・自身が毒、猛毒、呪い、火傷の効果を受けると、\n　自身の物理防御力と魔法防御力と行動速度\n　が大ダウンする。\n・目の前の敵１キャラに物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310705, "なかよしＸ", 310700, 0, 16, 270, 3000, 1, 1.4, 0, 0, 0, "【ＭＯＤＥ２】鋼鉄の球体が、完璧なちぇる語で\n囁きかける。「ちぇる～ん」。心を掴み離さない\n洗脳の言の葉は、確実に世界をちぇるへと誘う。\n\n・ランダムな１キャラに魔法中ダメージを与え、\n　沈黙と誘惑状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310706, "なかよしＸ", 310700, 0, 16, 270, 3000, 1, 1.4, 0, 0, 0, "【ＭＯＤＥ３】鋼鉄の絡繰が再び大地に立つ。\n諸刃の剣・ファイナルモードを解放し、\nなかよし部の３人を追い詰める。\n\n・自身が毒、猛毒、呪い、火傷の効果を受けると、\n　自身の物理防御力と魔法防御力と行動速度\n　が大ダウンする。\n・ユニオンバーストは、敵全体にキャラの\n　最大ＨＰに応じた魔法割合ダメージを与える。\n・自身の物理攻撃力をアップさせたあと、\n　敵全体に物理ダメージを与える。\n・前方３キャラに最大ＨＰに応じた魔法割合\n　ダメージを与え、行動速度をダウンさせる。\n・バトル開始直後に、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310800, "忍びの頭領ハンゾウ", 310800, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【物理】悪徳監査官に雇われた忍びの頭領。\n義を失った忍びは、その身を金に落とす。だが\nしかし、円熟の業は健在で皆の行く手を阻む。\n\n・バトル開始後、監査官が登場する。監査官がダ\n　メージを受けると、その直後に忍びの頭領ハン\n　ゾウの物理防御力と魔法防御力を特大ダウンさ\n　せる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n・大ガマに変化して毒を吐き、敵全体を毒状態に\n　する。この攻撃は必ず命中する。\n・敵全体に物理中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310801, "忍びの頭領ハンゾウ", 310800, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【物理】悪徳監査官に雇われた忍びの頭領。\n義を失った忍びは、その身を金に落とす。だが\nしかし、円熟の業は健在で皆の行く手を阻む。\n\n・バトル開始後、監査官が登場する。監査官がダ\n　メージを受けると、その直後に忍びの頭領ハン\n　ゾウの物理防御力と魔法防御力を特大ダウンさ\n　せる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n・大ガマに変化して毒を吐き、敵全体を毒状態に\n　する。この攻撃は必ず命中する。\n・敵全体に物理中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310802, "忍びの頭領ハンゾウ", 310800, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【物理】悪徳監査官に雇われた忍びの頭領。\n義を失った忍びは、その身を金に落とす。だが\nしかし、円熟の業は健在で皆の行く手を阻む。\n\n・バトル開始後、監査官が登場する。監査官がダ\n　メージを受けると、その直後に忍びの頭領ハン\n　ゾウの物理防御力と魔法防御力を特大ダウンさ\n　せる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n・大ガマに変化して毒を吐き、敵全体を毒状態に\n　する。自身のＨＰが30%以下の場合、敵全体\n　を猛毒状態にする。この攻撃は必ず命中する。\n・敵全体に物理中ダメージを与える。自身のＨＰ\n　が30%以下の場合、さらに敵全体をスタンさ\n　せる。\n・忍びの頭領ハンゾウ自身のＨＰが30％を切る\n　と、スキルの効果が変化する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310803, "忍びの頭領ハンゾウ", 310800, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【物理】悪徳監査官に雇われた忍びの頭領。\n義を失った忍びは、その身を金に落とす。だが\nしかし、円熟の業は健在で皆の行く手を阻む。\n\n・バトル開始後、監査官が登場する。監査官がダ\n　メージを受けると、その直後に忍びの頭領ハン\n　ゾウの物理防御力と魔法防御力を特大ダウンさ\n　せる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n・大ガマに変化して毒を吐き、敵全体を毒状態に\n　する。自身のＨＰが30%以下の場合、敵全体\n　を猛毒状態にする。この攻撃は必ず命中する。\n・敵全体に物理中ダメージを与える。自身のＨＰ\n　が30%以下の場合、さらに敵全体をスタンさ\n　せる。\n・忍びの頭領ハンゾウ自身のＨＰが30％を切る\n　と、スキルの効果が変化する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310804, "忍びの頭領ハンゾウ", 310801, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【ＭＯＤＥ１】【牧場（エリザベスパーク）】の\nシャドウを召喚。幻術で造りだした四農士の幻影\nが皆の帰る場所を再び窮地に陥れる。\n\n・目の前の敵１キャラに物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310805, "忍びの頭領ハンゾウ", 310800, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【ＭＯＤＥ２】秘伝の口寄せで忍蛙に化け、\nガマの猛毒をあたり一帯に噴霧する。その猛毒は\nひと吸いで全身を蝕み、徐々に躰を爛れ落とす。\n\n・バトル開始後、監査官が登場する。監査官がダ\n　メージを受けると、その直後に忍びの頭領ハン\n　ゾウの物理防御力と魔法防御力を特大ダウンさ\n　せる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n・大ガマに変化して猛毒を吐き、敵全体を猛毒状\n　態にする。この攻撃は必ず命中する。\n・敵全体に物理中ダメージを与え、さらに敵全体\n　をスタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310806, "忍びの頭領ハンゾウ", 310800, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【ＭＯＤＥ３】最期は、忍びとしての尊厳を取り\n戻し、己が真の力を発揮する。紫電一閃の早業に\n叫声を上げる間もなく屍と化す。\n\n・バトル開始直後に、自身のスキル威力をアップ\n　させる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた物理割合ダメージを与える。\n・大ガマに変化して猛毒を吐き、敵全体を猛毒状\n　態にする。この攻撃は必ず命中する。\n・敵全体に物理中ダメージを与え、さらに敵全体\n　をスタンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (310900, "ランドソル各地に襲来した謎の円盤", 310900, 0, 16, 270, 3000, 1, 0.1, 0, 0, 0, "【物理】平和な収穫祭を急襲する、謎の飛行物体。\nランドソル各地に突如現れ、破壊と略奪を行う。\n\n・ユニオンバーストは、敵全体に物理大ダメージ。\n・前方１キャラに物理小ダメージ。\n・残りＨＰの高い１キャラに物理小ダメージ。\n・ランダムな１キャラに物理小ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311000, "トレントキャッスル", 311000, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【物理】塔の魔力で変異し要塞と化した巨大魔樹。\n大地の力を砲弾に変え、堅牢なその身を以って\n破壊の限りを尽くす。\n\n・敵全体に物理大ダメージを与える。\n・範囲内の敵すべてに継続魔法ダメージを与え\n　物理防御力を下げるフィールドを展開する。\n・後ろから２番目のキャラを中心とした小範囲内\n　に物理中ダメージを与え、ＴＰを下げる。\n　その後、味方全体のＴＰを回復する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311100, "黒の王ジャバウォック", 311100, 0, 16, 270, 1000, 1, 2.1, 0, 0, 0, "【物理】世界を歪ませ狭界より顕現した黒の王。\n暗黒の瘴気を纏い不思議の国を蹂躙せんとする。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、毒状態に\n　し、さらにノックバックさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から２キャラに物理中ダメージを与え、物理\n　防御力とＴＰをダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311101, "黒の王ジャバウォック", 311100, 0, 16, 270, 1000, 1, 2.1, 0, 0, 0, "【物理】世界を歪ませ狭界より顕現した黒の王。\n暗黒の瘴気を纏い不思議の国を蹂躙せんとする。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、毒状態に\n　し、さらにノックバックさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から２キャラに物理中ダメージを与え、物理\n　防御力とＴＰをダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311102, "黒の王ジャバウォック", 311100, 0, 16, 270, 1000, 1, 2.1, 0, 0, 0, "【物理】世界を歪ませ狭界より顕現した黒の王。\n暗黒の瘴気を纏い不思議の国を蹂躙せんとする。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、毒状態に\n　し、さらにノックバックさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から２キャラに物理中ダメージを与え、物理\n　防御力とＴＰをダウンさせる。\n・前方範囲内のキャラに魔法中ダメージを与え、\n　魔法防御力を大ダウンさせる。\n　さらにキャラのＨＰが50％未満の場合、行動\n　速度をダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311103, "黒の王ジャバウォック", 311100, 0, 16, 270, 1000, 1, 2.1, 0, 0, 0, "【物理】世界を歪ませ狭界より顕現した黒の王。\n暗黒の瘴気を纏い不思議の国を蹂躙せんとする。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、毒状態に\n　し、さらにノックバックさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から２キャラに物理中ダメージを与え、物理\n　防御力とＴＰをダウンさせる。\n・前方範囲内のキャラに魔法中ダメージを与え、\n　魔法防御力を大ダウンさせる。\n　さらにキャラのＨＰが50％未満の場合、行動\n　速度をダウンさせる。\n・黒の王ジャバウォック自身のＨＰが35％を切\n　ると、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311104, "黒の王ジャバウォック", 311101, 0, 16, 270, 1000, 1, 2.1, 0, 0, 0, "【ＭＯＤＥ１】瘴黒の幕を身に纏い、黒の王が再\n臨する。闇と混沌を集約した障壁は、救世主の光\nの一射をも耐えるという。\n\n・バリアを張り、敵の攻撃を受け付けなくなる。\n　バリアはダメージを与えるたびに徐々に耐久性\n　を失っていき、2400000ダメージを与え\n　るとバリアは破壊される。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、毒状態に\n　し、さらにノックバックさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前方範囲内のキャラに魔法中ダメージを与え、\n　魔法防御力を大ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311105, "黒の王ジャバウォック", 311100, 0, 16, 270, 1000, 1, 2.1, 0, 0, 0, "【ＭＯＤＥ２】リノ、アユミ、ヒヨリのシャドウ\nを召喚。心の闇が具現化し、自己の弱さを露見さ\nせる。希望の心を取り戻せるか？今、問われる。\n\n・目の前の敵１キャラに物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311106, "黒の王ジャバウォック", 311100, 0, 16, 270, 1000, 1, 2.1, 0, 0, 0, "【ＭＯＤＥ３】黒の王が終の力を解放し、世界は\n常闇へと堕ちていく。本の殆どの頁は黒に染まり\n救世主の物語は終焉を迎えようとする。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、毒状態に\n　し、さらにノックバックさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・前から２キャラに物理中ダメージを与え、物理\n　防御力とＴＰをダウンさせる。\n・前方範囲内のキャラに魔法中ダメージを与え、\n　魔法防御力を大ダウンさせる。\n　さらにキャラのＨＰが50％未満の場合、行動\n　速度を大ダウンさせる。\n・バトル開始直後に、さらに攻撃が激しく\n　凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311200, "フラワーシュバリエ", 311200, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【物理】大輪の花に擬態する魔物。\nその美しさに惹かれた、不用意な\n獲物の前に絶望の光が花開く。\n\n・前方３キャラに物理大ダメージを\n　与え、さらに敵全体に物理大\n　ダメージを与える。\n\n・前方２キャラに物理小ダメージを\n　与え、さらに自分の物理攻撃力を\n　中アップさせる。\n\n・前から１番目のキャラに物理中\n　ダメージを与え、物理防御力を\n　中ダウンさせる。\n\n・前から２番目のキャラに物理中\n　ダメージを与え、物理防御力を\n　中ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311201, "フラワーシュバリエ", 311200, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【物理】大輪の花に擬態する魔物。\nその美しさに惹かれた、不用意な\n獲物の前に絶望の光が花開く。\n\n・前方３キャラに物理大ダメージを\n　与え、さらに敵全体に物理大\n　ダメージを与える。\n\n・前方２キャラに物理小ダメージを\n　与え、さらに自分の物理攻撃力を\n　中アップさせる。\n\n・前から１番目のキャラに物理中\n　ダメージを与え、物理防御力を\n　中ダウンさせる。\n\n・前から２番目のキャラに物理中\n　ダメージを与え、物理防御力を\n　中ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311300, "覚醒・浮気星", 311300, 0, 16, 270, 3000, 2, 2.8, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311301, "覚醒・浮気星", 311300, 0, 16, 270, 3000, 2, 2.8, 0, 0, 0, "【魔法】ぽっかり空いた心のスキマに取り憑く\n星の精霊。過剰な自意識とピュアな下心で相手\nを惑わせる。\n\n・ユニオンバーストは、敵全体に浮気星が保持し\n　ている【ふた心】の数に応じた魔法割合ダメー\n　ジを与える。\n　また、浮気星の残りＨＰが50％未満の場合、\n　さらに与えるダメージがアップする。\n　ダメージを与えた後、浮気星が保持している\n　【ふた心】の数は０になる。\n・一番後ろの敵を中心として、一定範囲に\n　魔法ダメージを与え、さらに誘惑状態にして\n　物理攻撃力と魔法攻撃力をアップさせる。\n　このスキルでダメージを与えた敵の数だけ、\n　浮気星に一定時間【ふた心】を追加する。\n・前方範囲内の敵をノックバックさせ、\n　魔法ダメージを与える。\n　さらに誘惑状態にして物理攻撃力と魔法攻撃力\n　をアップさせる。\n　このスキルでダメージを与えた敵の数だけ、\n　浮気星に一定時間【ふた心】を追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311302, "覚醒・浮気星", 311300, 0, 16, 270, 3000, 2, 3.0, 0, 0, 0, "【魔法】ぽっかり空いた心のスキマに取り憑く\n星の精霊。過剰な自意識とピュアな下心で相手\nを惑わせる。\n\n・ユニオンバーストは、敵全体に浮気星が保持し\n　ている【ふた心】の数に応じた魔法割合ダメー\n　ジを与える。\n　また、浮気星の残りＨＰが50％未満の場合、\n　さらに与えるダメージがアップする。\n　ダメージを与えた後、浮気星が保持している\n　【ふた心】の数は０になる。\n・一番後ろの敵を中心として、一定範囲に\n　魔法ダメージを与え、さらに誘惑状態にして\n　物理攻撃力と魔法攻撃力をアップさせる。\n　このスキルでダメージを与えた敵の数だけ、\n　浮気星に一定時間【ふた心】を追加する。\n・前方範囲内の敵をノックバックさせ、\n　魔法ダメージを与える。\n　さらに誘惑状態にして物理攻撃力と魔法攻撃力\n　をアップさせる。\n　このスキルでダメージを与えた敵の数だけ、\n　浮気星に一定時間【ふた心】を追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311303, "覚醒・浮気星", 311300, 0, 16, 270, 3000, 2, 3.0, 0, 0, 0, "【魔法】ぽっかり空いた心のスキマに取り憑く\n星の精霊。過剰な自意識とピュアな下心で相手\nを惑わせる。\n\n・ユニオンバーストは、敵全体に浮気星が保持し\n　ている【ふた心】の数に応じた魔法割合ダメー\n　ジを与える。\n　また、浮気星の残りＨＰが50％未満の場合、\n　さらに与えるダメージがアップする。\n　ダメージを与えた後、浮気星が保持している\n　【ふた心】の数は０になる。\n・敵全体にキャラの最大ＨＰに応じた魔法割合\n　ダメージを与える。\n・一番後ろの敵を中心として、一定範囲に\n　魔法ダメージを与え、さらに誘惑状態にして\n　物理攻撃力と魔法攻撃力をアップさせる。\n　このスキルでダメージを与えた敵の数だけ、\n　浮気星に一定時間【ふた心】を追加する。\n・前方範囲内の敵をノックバックさせ、\n　魔法ダメージを与える。\n　さらに誘惑状態にして物理攻撃力と魔法攻撃力\n　をアップさせる。\n　このスキルでダメージを与えた敵の数だけ、\n　浮気星に一定時間【ふた心】を追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311304, "覚醒・浮気星", 311300, 0, 16, 270, 3000, 2, 3.0, 0, 0, 0, "【ＭＯＤＥ１】自身のハーレムドリームを築き\n上げるため手当たり次第、乙女たちを強制的に\n惑わす。\n\n・ユニオンバーストは、敵全体に浮気星が保持し\n　ている【ふた心】の数に応じた魔法割合ダメー\n　ジを与える。\n　ダメージを与えた後、浮気星が保持している\n　【ふた心】の数は０になる。\n・敵全体にキャラの最大ＨＰに応じた魔法割合\n　ダメージを与える。\n・挑発を無視して、最も後ろの敵１キャラに魔法\n　ダメージを与え、さらに引き寄せる。\n・一番前の敵を中心として、一定範囲に\n　魔法ダメージを与え、さらに誘惑状態にして\n　物理攻撃力と魔法攻撃力をアップさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n　このスキルの攻撃対象の数だけ、浮気星に\n　一定時間【ふた心】を追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311305, "覚醒・浮気星", 311300, 0, 16, 270, 3000, 2, 3.0, 0, 0, 0, "【ＭＯＤＥ２】綺羅星すらも霞ませると、己の\n輝きに自信をのぞかせ、その盲信と乙女への思い\nが銀河を巻き込み、全てを幻惑させる。\n\n・ユニオンバーストは、敵全体に浮気星が保持し\n　ている【ふた心】の数に応じた魔法割合ダメー\n　ジを与える。\n　また、浮気星の残りＨＰが60％未満の場合、\n　さらに与えるダメージがアップする。\n　ダメージを与えた後、浮気星が保持している\n　【ふた心】の数は０になる。\n・一番前の敵を中心として、一定範囲に\n　魔法ダメージを与え、さらに誘惑状態にして\n　物理攻撃力と魔法攻撃力をアップさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n　このスキルの攻撃対象の数だけ、浮気星に\n　一定時間【ふた心】を追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311306, "覚醒・浮気星", 311300, 0, 16, 270, 3000, 2, 3.0, 0, 0, 0, "【ＭＯＤＥ３】夢見たハーレムが潰え、全てを\n無に還そうと真の力を解放する。銀河の星々を\n天の川に沈めるべく、全ての下心をブチ撒ける。\n\n・ユニオンバーストは、敵全体に浮気星が保持し\n　ている【ふた心】の数に応じた魔法割合ダメー\n　ジを与える。\n　また、バトル開始直後に、さらに与えるダメー\n　ジがアップする。\n　ダメージを与えた後、浮気星が保持している\n　【ふた心】の数は０になる。\n・敵全体にキャラの最大ＨＰに応じた魔法割合\n　ダメージを与える。\n・一番後ろの敵を中心として、一定範囲に\n　魔法ダメージを与え、さらに誘惑状態にして\n　物理攻撃力と魔法攻撃力をアップさせる。\n　このスキルでダメージを与えた敵の数だけ、\n　浮気星に一定時間【ふた心】を追加する。\n・前方範囲内の敵をノックバックさせ、\n　魔法ダメージを与える。\n　さらに誘惑状態にして物理攻撃力と魔法攻撃力\n　をアップさせる。\n　このスキルでダメージを与えた敵の数だけ、\n　浮気星に一定時間【ふた心】を追加する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311400, "渚の暴君・鮫吉", 311400, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311401, "渚の暴君・鮫吉", 311400, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【物理】ビーチ一帯の近海をシメる海洋族の暴君。\n売られた喧嘩には、ただの一度も背を向けず、\nシマを荒らすヤツは絶対に許さない。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、物理\n　防御力をダウンさせ、物理攻撃力をアップさ\n　せる。\n・前方範囲内の敵すべてに物理大ダメージを与え、\n　物理防御力をダウンさせる。\n・敵全体をノックバックさせる。その後一定時間、\n　雷を身にまとい、自身の物理防御力と魔法防御\n　力を極大アップさせる。\n　鮫吉が毒、猛毒、呪い、火傷の効果を受けてい\n　ると、自身の物理防御力と魔法防御力がアップ\n　する時間が短くなる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311402, "渚の暴君・鮫吉", 311400, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【物理】ビーチ一帯の近海をシメる海洋族の暴君。\n売られた喧嘩には、ただの一度も背を向けず、\nシマを荒らすヤツは絶対に許さない。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、物理\n　防御力をダウンさせ、物理攻撃力をアップさ\n　せる。\n・前方範囲内の敵すべてに物理大ダメージを与え、\n　物理防御力をダウンさせる。\n・敵全体をノックバックさせる。その後一定時間、\n　雷を身にまとい、自身の物理防御力と魔法防御\n　力を極大アップさせる。\n　鮫吉が毒、猛毒、呪い、火傷の効果を受けてい\n　ると、自身の物理防御力と魔法防御力がアップ\n　する時間が短くなる。\n・鮫吉自身のＨＰが20％を切ると、敵全体に\n　キャラの最大ＨＰに応じた物理割合ダメージを\n　与え、一定時間、ユニオンバーストのみ使用で\n　きない状態にし、魔法攻撃力をダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311403, "渚の暴君・鮫吉", 311400, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【物理】ビーチ一帯の近海をシメる海洋族の暴君。\n売られた喧嘩には、ただの一度も背を向けず、\nシマを荒らすヤツは絶対に許さない。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、物理\n　防御力を大ダウンさせ、物理攻撃力をアップ\n　させる。\n・前方範囲内の敵すべてに物理大ダメージを与え、\n　物理防御力をダウンさせる。\n・敵全体をノックバックさせる。その後一定時間、\n　雷を身にまとい、自身の物理防御力と魔法防御\n　力を極大アップさせる。\n　鮫吉が毒、猛毒、呪い、火傷の効果を受けてい\n　ると、自身の物理防御力と魔法防御力がアップ\n　する時間が短くなる。\n・鮫吉自身のＨＰが20％を切ると、敵全体に\n　キャラの最大ＨＰに応じた物理割合ダメージを\n　与え、一定時間、ユニオンバーストのみ使用で\n　きない状態にし、魔法攻撃力をダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311404, "渚の暴君・鮫吉", 311404, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【ＭＯＤＥ１】シマを荒らす不届きモノには、幾\n千もの抗争を潜り抜けた鋼の肉体から繰り出す、\n全身全霊のガチンコタックルをブチかます。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、物理\n　防御力をダウンさせ、物理攻撃力をアップさ\n　せる。\n・前方範囲内の敵すべてに物理大ダメージを与え、\n　物理防御力を大ダウンさせる。\n・前方３キャラに物理大ダメージを与える。さら\n　に、自身にも物理ダメージを与え、物理防御力\n　と魔法防御力を一定時間極大ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311405, "渚の暴君・鮫吉", 311405, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【ＭＯＤＥ２】圧倒的なカリスマ性と絶望的な暴\n力につき従う、舎弟たちが集結する。海洋族の精\n鋭によるカチコミが、いま幕を開ける。\n\n・鮫吉は目の前の敵１キャラへの物理攻撃を行う。\n・前方３キャラに物理大ダメージを与える。さら\n　に、自身にも物理ダメージを与え、物理防御力\n　と魔法防御力を一定時間極大ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311406, "渚の暴君・鮫吉", 311404, 0, 16, 270, 3000, 1, 2.8, 0, 0, 0, "【ＭＯＤＥ３】獰猛な雄叫びとともに、暴君は追\n撃を繰り出す。刃向かう者を完膚なきまでに殴り\n潰すまで、降り注ぐ轟拳の嵐は決してやまない。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、物理\n　防御力を大ダウンさせ、物理攻撃力をアップ\n　させる。\n・前方範囲内の敵すべてに物理大ダメージを与え、\n　物理防御力をダウンさせる。\n・敵全体をノックバックさせる。その後一定時間、\n　雷を身にまとい、自身の物理防御力と魔法防御\n　力を極大アップさせる。\n　鮫吉が毒、猛毒、呪い、火傷の効果を受けてい\n　ると、自身の物理防御力と魔法防御力がアップ\n　する時間が短くなる。\n・鮫吉自身のＨＰが10％を切ると、敵全体に\n　キャラの最大ＨＰに応じた物理割合ダメージを\n　与え、一定時間、ユニオンバーストのみ使用で\n　きない状態にし、魔法攻撃力をダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311500, "暴走のイノセントボウ", 311500, 0, 16, 270, 3000, 2, 2.4, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311501, "暴走のイノセントボウ", 311500, 0, 16, 270, 3000, 2, 2.4, 0, 0, 0, "【魔法】過大な無垢なる願いにより暴走した聖弓。\nその矢に貫かれると、非力なエンジェルと化す。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、エンジェ\n　ル状態のキャラに呪いを付与する。\n　この効果により付与された呪いのダメージでは、\n　ＴＰが回復しない。\n・ＨＰが低い３キャラに最大ＨＰに応じた魔法\n　割合ダメージを与え、さらにＨＰが60％を\n　切ったキャラを一定時間エンジェル状態にする。\n　エンジェルになったキャラは、通常攻撃しか使\n　用できなくなり、かかっているステータスアッ\n　プ効果を解除される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311502, "暴走のイノセントボウ", 311500, 0, 16, 270, 3000, 2, 2.4, 0, 0, 0, "【魔法】過大な無垢なる願いにより暴走した聖弓。\nその矢に貫かれると、非力なエンジェルと化す。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、エンジェ\n　ル状態のキャラに呪いを付与する。\n　この効果により付与された呪いのダメージでは、\n　ＴＰが回復しない。\n・ＨＰが低い３キャラに最大ＨＰに応じた魔法\n　割合ダメージを与え、さらにＨＰが60％を\n　切ったキャラを一定時間エンジェル状態にする。\n　エンジェルになったキャラは、通常攻撃しか使\n　用できなくなり、かかっているステータスアッ\n　プ効果を解除される。\n・ＨＰが高い２キャラに魔法中ダメージを与え、\n　行動速度をダウンさせる。\n・イノセントボウ自身のＨＰが50％を切ると、\n　魔法攻撃力がアップし、さらに攻撃が激しく凶\n　暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311503, "暴走のイノセントボウ", 311500, 0, 16, 270, 3000, 2, 2.4, 0, 0, 0, "【魔法】過大な無垢なる願いにより暴走した聖弓。\nその矢に貫かれると、非力なエンジェルと化す。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、エンジェ\n　ル状態のキャラに呪いを付与する。\n　この効果により付与された呪いのダメージでは、\n　ＴＰが回復しない。\n・ＨＰが低い３キャラに最大ＨＰに応じた魔法\n　割合ダメージを与え、さらにＨＰが60％を\n　切ったキャラを一定時間エンジェル状態にする。\n　エンジェルになったキャラは、通常攻撃しか使\n　用できなくなり、かかっているステータスアッ\n　プ効果を解除される。\n・ＨＰが高い２キャラに魔法中ダメージを与え、\n　行動速度をダウンさせる。\n・イノセントボウ自身のＨＰが50％を切ると、\n　魔法攻撃力とＴＰがアップし、さらに攻撃が激\n　しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311504, "暴走のイノセントボウ", 311500, 0, 16, 270, 3000, 2, 2.4, 0, 0, 0, "【ＭＯＤＥ１】歪みし願いは結晶となり、人々を\n狂わせる。その結晶はすべての進攻を封殺する。\n\n・バトル開始時に歪願のクリスタルを呼び出す。\n・歪願のクリスタルがバトル中に存在している間、\n　イノセントボウの物理防御力と魔法防御力を大\n　幅にアップさせる。\n・歪願のクリスタルが破壊されると、イノセント\n　ボウの物理防御力と魔法防御力を大幅にダウン\n　させる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n・ＨＰが高い２キャラに魔法中ダメージを与え、\n　行動速度をダウンさせ、さらに魔法防御力を\n　ダウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311505, "暴走のイノセントボウ", 311500, 0, 16, 270, 3000, 2, 2.4, 0, 0, 0, "【ＭＯＤＥ２】ヨリとアカリのシャドウを召喚。\n自分たちの負の姿に、双子の真の絆が試される。\n\n・ＨＰが低い３キャラに最大ＨＰに応じた魔法\n　割合ダメージを与え、さらにＨＰが60％を\n　切ったキャラを一定時間エンジェル状態にする。\n　エンジェルになったキャラは、通常攻撃しか使\n　用できなくなり、かかっているステータスアッ\n　プ効果を解除される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311506, "暴走のイノセントボウ", 311500, 0, 16, 270, 3000, 2, 2.4, 0, 0, 0, "【ＭＯＤＥ３】叶わぬ願いに囚われ、聖弓の権能\nは極致に至る。解放された力は天地を揺るがし、\n一切の邪念を滅却する。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与え、エンジェ\n　ル状態のキャラに呪いを付与する。\n　この効果により付与された呪いのダメージでは、\n　ＴＰが回復しない。\n・ＨＰが低い３キャラに最大ＨＰに応じた魔法\n　割合ダメージを与え、さらにＨＰが60％を\n　切ったキャラを一定時間エンジェル状態にする。\n　エンジェルになったキャラは、通常攻撃しか使\n　用できなくなり、かかっているステータスアッ\n　プ効果を解除される。\n・ＨＰが高い２キャラに魔法中ダメージを与え、\n　行動速度をダウンさせ、さらに魔法防御力を\n　ダウンさせる。\n・残り時間が35秒を切ると、魔法攻撃力とＴＰ\n　がアップし、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311600, "叫怖のゴーストファーザー", 311600, 0, 16, 270, 3000, 2, 4.0, 0, 0, 0, "【魔法】人間を恐怖に慄かせるお化けたちの首領。\n手下をけしかけ、シマの拡大を密かに画策する。\n\n・ユニオンバーストは、敵全体にキャラの元々の\n　最大ＨＰに応じた魔法割合ダメージを与える。\n　さらに、敵全体のキャラの最大ＨＰを10％減\n　少させる。減少したＨＰは、バトル終了まで解\n　除できない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311601, "叫怖のゴーストファーザー", 311600, 0, 16, 270, 3000, 2, 4.0, 0, 0, 0, "【魔法】人間を恐怖に慄かせるお化けたちの首領。\n手下をけしかけ、シマの拡大を密かに画策する。\n\n・ユニオンバーストは、敵全体にキャラの元々の\n　最大ＨＰに応じた魔法割合ダメージを与える。\n　さらに、敵全体のキャラの最大ＨＰを10％減\n　少させる。減少したＨＰは、バトル終了まで解\n　除できない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311602, "叫怖のゴーストファーザー", 311600, 0, 16, 270, 3000, 2, 4.0, 0, 0, 0, "【魔法】人間を恐怖に慄かせるお化けたちの首領。\n手下をけしかけ、シマの拡大を密かに画策する。\n\n・ユニオンバーストは、敵全体にキャラの元々の\n　最大ＨＰに応じた魔法割合ダメージを与える。\n　さらに、敵全体のキャラの最大ＨＰを10％減\n　少させる。減少したＨＰは、バトル終了まで解\n　除できない。\n・ゴーストファーザー自身のＨＰが40％を切る\n　と、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311603, "叫怖のゴーストファーザー", 311600, 0, 16, 270, 3000, 2, 4.0, 0, 0, 0, "【魔法】人間を恐怖に慄かせるお化けたちの首領。\n手下をけしかけ、シマの拡大を密かに画策する。\n\n・ユニオンバーストは、敵全体にキャラの元々の\n　最大ＨＰに応じた魔法割合ダメージを与える。\n　さらに、敵全体のキャラの最大ＨＰを10％減\n　少させる。減少したＨＰは、バトル終了まで解\n　除できない。\n・ゴーストファーザー自身のＨＰが40％を切る\n　と、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311604, "叫怖のゴーストファーザー", 311600, 0, 16, 270, 3000, 2, 4.0, 0, 0, 0, "【ＭＯＤＥ１】美味な魂を求め、お化けたちの首\n領が再び姿を現す。残虐なファミリーを従え、\n人々を蹂躙することで街を極上の悲鳴で満たす。\n\n・バトル開始時、ゴーストミニオンズを３体召喚\n　する。\n・ゴーストミニオンズを１体倒すたびに、残り\n　ゴーストミニオンズ数が１減少する。\n　その後、ゴーストミニオンズが再度召喚される。\n・ゴーストミニオンズは、目の前の敵１キャラの\n　ＴＰを減少させ、ゴーストファーザーのＴＰを\n　回復させる。\n・ユニオンバーストは、敵全体にキャラの元々の\n　最大ＨＰに応じた魔法割合ダメージを与える。\n　さらに、敵全体のキャラの最大ＨＰを10％減\n　少させる。減少したＨＰは、バトル終了まで解\n　除できない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311605, "叫怖のゴーストファーザー", 311600, 0, 16, 270, 3000, 2, 999.0, 0, 0, 0, "【ＭＯＤＥ２】シマを荒らす、すべてに制裁を\n下す。ひとたび彼のシマに踏み入れば、はびこる\n魍魎が命を蝕み、生きながら地獄の苦しみを\n与える。\n\n・バトル開始時、キャラの最大ＨＰが35％減少\n　する。減少したＨＰは、バトル終了まで解除\n　できない。\n・ユニオンバーストは、敵全体にキャラの元々の\n　最大ＨＰに応じた魔法割合ダメージを与える。\n　さらに、敵全体のキャラの最大ＨＰを10％減\n　少させる。減少したＨＰは、バトル終了まで解\n　除できない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311606, "叫怖のゴーストファーザー", 311600, 0, 16, 270, 3000, 2, 4.0, 0, 0, 0, "【ＭＯＤＥ３】蓄えた力をすべて吐き出し、真の\n力を解放する。この世界を支配すべく、残虐非道\nの限りを尽くし、地獄へと染め上げる。\n\n・ユニオンバーストは、敵全体にキャラの元々の\n　最大ＨＰに応じた魔法割合ダメージを与える。\n　さらに、敵全体のキャラの最大ＨＰを10％減\n　少させる。減少したＨＰは、バトル終了まで解\n　除できない。\n・自身に物理/魔法無効バリアを展開する。\n・ゴーストファーザー自身のＨＰが40％を\n　切ると、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311700, "ゴーストブラザーズ", 311700, 0, 16, 270, 3000, 2, 999.0, 0, 0, 0, "ゴーストファーザーの側近の手下。\n自身の体を盾にして、一切の攻撃から首領を守る。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311701, "ゴーストブラザーズ", 311700, 0, 16, 270, 3000, 2, 999.0, 0, 0, 0, "ゴーストファーザーの側近の手下。\n鍛え上げた鉄砲玉で、街に特攻をしかける。血気\n盛んに突撃し、逃げ惑う人々を恐怖の底に陥れる。\n\n・ゴーストブラザーズは攻撃の対象にならない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311702, "ゴーストブラザーズ", 311700, 0, 16, 270, 3000, 2, 999.0, 0, 0, 0, "ゴーストファーザーの側近の手下。\n鉄砲玉たちと集めた上質な精気を首領へ献上する。\n\n・ゴーストブラザーズは攻撃の対象にならない。\n・ゴーストファーザーのＴＰを回復させる。\n　ゴーストファーザーが行動不能状態のときは、\n　ＴＰを回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311703, "ゴーストブラザーズ", 311700, 0, 16, 270, 3000, 2, 999.0, 0, 0, 0, "いよいよ訪れた出番に、鼻息荒く推参する。\n気合十分の最強の盾が、歯向かう相手の心を折る。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311800, "ゴーストブラザーズ", 311800, 0, 16, 270, 3000, 2, 999.0, 0, 0, 0, "ゴーストファーザーの側近の手下。\n取り立てた精気を首領へ渡し、補佐を務めあげる。\n\n・ゴーストファーザーのＴＰを回復させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311801, "ゴーストブラザーズ", 311800, 0, 16, 270, 3000, 2, 999.0, 0, 0, 0, "ゴーストファーザーの側近の手下。\n首領の近辺を警護し、一分の隙も見せない。裏で\nは密かに街の人々を絶望へ追い込もうと暗躍する。\n\n・ゴーストブラザーズは攻撃の対象にならない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311802, "ゴーストブラザーズ", 311800, 0, 16, 270, 3000, 2, 999.0, 0, 0, 0, "ゴーストファーザーの側近の手下。\n部下と取り立てた極上の精気を首領へ差し出す。\n\n・ゴーストブラザーズは攻撃の対象にならない。\n・ゴーストファーザーのＴＰを回復させる。\n　ゴーストファーザーが行動不能状態のときは、\n　ＴＰを回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311803, "ゴーストブラザーズ", 311800, 0, 16, 270, 3000, 2, 999.0, 0, 0, 0, "ファミリーの危機を守るべく、冷静に戦況を見極\nめる。命尽きる直前まで、首領の忠実なる右腕と\nして補佐に徹する。\n\n・ゴーストファーザーのＴＰを回復させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (311900, "ブライトホーン", 311900, 0, 13, 270, 1000, 1, 2.0, 0, 0, 0, "【物理】霞を食み、自身の姿も霞の\n如く掴みどころがない。人を嫌い、\n近づく者は容赦なく踏み潰す。\n\n・敵全体に魔法大ダメージを与え\n　る。さらに、火傷状態の敵はダ\n　メージがアップする。\n\n・最も物理攻撃力が高い敵を中心に\n　した範囲内に魔法中ダメージを与\n　え、火傷状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312000, "オブシダンワイバーン", 312000, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "【物理】魔力を宿せし黒曜の結晶竜。美しい体躯\nの輝きは冥府を彷徨いし魂の嘆きといわれている。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・オブシダンワイバーンから受けるすべてのダメ\n　ージで発生する、パーティキャラのＴＰ回復量\n　を中ダウンさせる。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　キャラのＨＰが60％未満の場合、ＴＰを大ダ\n　ウン。\n・敵全体のＨＰ吸収を特大ダウンし、さらに物理\n　防御力を大ダウン。\n・最も魔法攻撃力が高い１キャラに物理大ダメー\n　ジ。\n　さらに、最も魔法攻撃力が高い１キャラを中心\n　とした範囲内の敵すべてに物理中ダメージを与\n　え、ＴＰを中ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312100, "アンチビースト de M", 312100, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【物理】人々の夢を奪い去る、負の魔法生物。\n陰鬱な黒い霧で希望を覆い、人々の心を蝕む。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312101, "アンチビースト de M", 312100, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【物理】人々の夢を奪い去る、負の魔法生物。\n陰鬱な黒い霧で希望を覆い、人々の心を蝕む。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　魔法中ダメージを与える。さらに、物理防御力\n　を小ダウン、魔法防御力を中ダウンさせ、\n　一定時間ＨＰ回復量を70％ダウンさせる。\n・前方２キャラに物理中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312102, "アンチビースト de M", 312100, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【物理】人々の夢を奪い去る、負の魔法生物。\n陰鬱な黒い霧で希望を覆い、人々の心を蝕む。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　魔法中ダメージを与える。さらに、物理防御力\n　を小ダウン、魔法防御力を中ダウンさせ、\n　一定時間ＨＰ回復量を70％ダウンさせる。\n・前方２キャラに物理中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312103, "アンチビースト de M", 312100, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【物理】人々の夢を奪い去る、負の魔法生物。\n陰鬱な黒い霧で希望を覆い、人々の心を蝕む。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　魔法中ダメージを与える。さらに、物理防御力\n　と魔法防御力を中ダウンさせ、一定時間ＨＰ回\n　復量を70％ダウンさせる。\n・前方２キャラに物理大ダメージを与える。\n・アンチビースト de M自身のＨＰが15％\n　を切ると、自分のＴＰを中アップさせ、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312104, "アンチビースト de M", 312100, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【ＭＯＤＥ１】街から愛と希望を吸い上げ奪う\nアンチビースト。魔法少女たちをもねじ伏せ、\n街中の全ての輝く力を取り込もうとする。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　魔法大ダメージを与える。さらに、物理防御力\n　と魔法防御力を大ダウンさせ、一定時間ＨＰ回\n　復量を70％ダウンさせる。\n・最も後ろの敵１キャラに最大ＨＰに応じた物理\n　割合ダメージを与え、束縛状態にし、ＴＰを\n　特大ダウンさせる。\n　さらに、アンチビースト de M自身のＴＰ\n　を中アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312105, "アンチビースト de M", 312100, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【ＭＯＤＥ２】魔法少女たちの猛攻をも取り込み\nさらに膨れ上がるアンチビーストの渇望。更には\n人々を守るための勇気までも溶蝕されてゆく。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　魔法大ダメージを与える。さらに、物理防御力\n　と魔法防御力を大ダウンさせ、一定時間ＨＰ回\n　復量を70％ダウンさせる。\n・敵全体のバリアを解除し、最大ＨＰに応じた\n　魔法割合ダメージを与え、毒状態にする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312106, "アンチビースト de M", 312100, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【ＭＯＤＥ３】負の情念は最高潮に達し、歪んだ\n渇望が一帯を包み込む。魔法少女たちの信念を\n挫き、守護者なき街を我が一部とせんとする。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　魔法大ダメージを与える。さらに、物理防御力\n　と魔法防御力を大ダウンさせ、一定時間ＨＰ回\n　復量を70％ダウンさせる。\n・前方２キャラに物理大ダメージを与える。\n・アンチビースト de M自身のＨＰが12％\n　を切ると、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312200, "ドミネイテッドスノーマン", 312200, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【物理】でっぷりとした眼光鋭い最恐雪ダルマ。\n狂気をその身に纏いながら聖夜の街中を縷々転々。\n年に一度の特別な夜がブラッククリスマスと化す。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312201, "ドミネイテッドスノーマン", 312200, 0, 16, 270, 3000, 1, 4.0, 0, 0, 0, "【物理】でっぷりとした眼光鋭い最恐雪ダルマ。\n狂気をその身に纏いながら聖夜の街中を縷々転々。\n年に一度の特別な夜がブラッククリスマスと化す。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、大きく\n　吹き飛ばす。さらに、自身のターゲットがブレ\n　イクしていない場合、物理防御力を中アップ、\n　魔法防御力を小アップ。\n・敵全体にキャラの最大ＨＰに応じた物理割合ダ\n　メージを与える。自身のターゲットがブレイク\n　していない場合、追加でスタン状態を付与。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・残り時間が20秒を切ると、プレゼント型爆弾\n　を取り出し、その後一定時間が経過で、敵全体\n　にキャラの最大ＨＰに応じた物理割合ダメージ\n　を与える。\n　さらに、ドミネイテッドスノーマンにも自身の\n　残りＨＰに応じた物理割合ダメージを与え、\n　ＴＰを特大ダウンさせる。\n・頭部のブレイク時、物理防御力と魔法防御力\n　が小ダウン。\n・胴部のブレイク時、物理防御力と魔法防御力\n　が小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312202, "ドミネイテッドスノーマン", 312200, 0, 16, 270, 3000, 1, 3.6, 0, 0, 0, "【物理】でっぷりとした眼光鋭い最恐雪ダルマ。\n狂気をその身に纏いながら聖夜の街中を縷々転々。\n年に一度の特別な夜がブラッククリスマスと化す。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、大きく\n　吹き飛ばす。さらに、自身のターゲットがブレ\n　イクしていない場合、物理防御力を中アップ、\n　魔法防御力を小アップ。\n・敵全体にキャラの最大ＨＰに応じた物理割合ダ\n　メージを与える。自身のターゲットがブレイク\n　していない場合、追加でスタン状態を付与。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・残り時間が20秒を切ると、プレゼント型爆弾\n　を取り出し、その後一定時間が経過で、敵全体\n　にキャラの最大ＨＰに応じた物理割合ダメージ\n　を与える。\n　さらに、ドミネイテッドスノーマンにも自身の\n　残りＨＰに応じた物理割合ダメージを与え、\n　ＴＰを特大ダウンさせる。\n・頭部のブレイク時、物理防御力と魔法防御力\n　が小ダウン。\n・胴部のブレイク時、物理防御力と魔法防御力\n　が小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312203, "ドミネイテッドスノーマン", 312200, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【物理】でっぷりとした眼光鋭い最恐雪ダルマ。\n狂気をその身に纏いながら聖夜の街中を縷々転々。\n年に一度の特別な夜がブラッククリスマスと化す。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、大きく\n　吹き飛ばす。さらに、自身のターゲットがブレ\n　イクしていない場合、物理防御力を中アップ、\n　魔法防御力を小アップ。\n・敵全体にキャラの最大ＨＰに応じた物理割合\n　ダメージを与える。自身のターゲットがブレ\n　イクしていない場合、追加でスタン状態を付与。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・残り時間が30秒を切ると、さらに攻撃が激し\n　く凶暴になる。\n・残り時間が20秒を切ると、プレゼント型爆弾\n　を取り出し、その後一定時間が経過で、敵全\n　体にキャラの最大ＨＰに応じた物理割合ダメ\n　ージを与える。\n　さらに、ドミネイテッドスノーマンにも自身\n　の残りＨＰに応じた物理割合ダメージを与え、\n　ＴＰを特大ダウンさせる。\n・頭部のブレイク時、物理防御力と魔法防御力\n　が小ダウン。\n・胴部のブレイク時、物理防御力と魔法防御力\n　が小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312204, "ドミネイテッドスノーマン", 312200, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【ＭＯＤＥ１】パーティー会場を大混乱の渦に落\nとす巨大雪ダルマ。もとは人々から愛された心優\nしきマスコット。みんなの声援が攻略のカギとなる。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、大きく\n　吹き飛ばす。さらに、自身のターゲットがブレ\n　イクしていない場合、物理防御力を中アップ、\n　魔法防御力を小アップ。\n・敵全体に魔法大ダメージを与え、凍結状態にす\n　る。\n　さらに、行動速度と物理防御力を大ダウンさせ\n　る。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・頭部のブレイク時、物理防御力と魔法防御力が\n　小ダウン。\n・胴部のブレイク時、物理防御力と魔法防御力が\n　小ダウン。\n・バトル中、ドミネイテッドスノーマン自身に付\n　与されている状態異常効果およびステータスダ\n　ウン効果の数に応じて、与えられるダメージの\n　量が大きく上昇する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312205, "ドミネイテッドスノーマン", 312200, 0, 16, 270, 3000, 1, 20.0, 0, 0, 0, "【ＭＯＤＥ２】聖夜に浮かれる３人娘のシャドウ\nを召喚。それは巨大雪ダルマの作った虚像。\n自身の名誉のために、今こそ立ち上がれ乙女たち！\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、大きく\n　吹き飛ばす。さらに、自身のターゲットがブレ\n　イクしていない場合、物理防御力を中アップ、\n　魔法防御力を小アップ。\n・敵全体にキャラの最大ＨＰに応じた物理割合ダ\n　メージを与える。自身のターゲットがブレイク\n　していない場合、追加でスタン状態を付与。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・頭部のブレイク時、物理防御力と魔法防御力が\n　小ダウン。\n・胴部のブレイク時、物理防御力と魔法防御力が\n　小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312206, "ドミネイテッドスノーマン", 312200, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【ＭＯＤＥ３】すべての思いを轢殺せんと転がり\n続ける巨大雪ダルマ。すべての寂しき人々へ、爆\n炎の贈物を優しくプレゼントフォー・ユー♪\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、大きく\n　吹き飛ばす。さらに、自身のターゲットがブレ\n　イクしていない場合、物理防御力を中アップ、\n　魔法防御力を小アップ。\n・敵全体にキャラの最大ＨＰに応じた物理割合\n　ダメージを与える。自身のターゲットがブレ\n　イクしていない場合、追加でスタン状態を付\n　与。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・残り時間が30秒を切ると、さらに攻撃が激し\n　く凶暴になる。\n・残り時間が20秒を切ると、プレゼント型爆弾\n　を取り出し、その後一定時間が経過で、敵全\n　体にキャラの最大ＨＰに応じた物理割合ダメ\n　ージを与える。\n　さらに、ドミネイテッドスノーマンにも自身\n　の残りＨＰに応じた物理割合ダメージを与え、\n　ＴＰを特大ダウンさせる。\n・頭部のブレイク時、物理防御力と魔法防御力\n　が小ダウン。\n・胴部のブレイク時、物理防御力と魔法防御力\n　が小ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312300, "グレートトゥンヌス", 312300, 0, 16, 270, 3000, 1, 1.1, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312301, "グレートトゥンヌス", 312300, 0, 16, 270, 3000, 1, 4.0, 0, 0, 0, "【物理】オーマの漁師に古くから伝わる幻の巨魚。\n巨躯超速の突進は、全ての船を海の藻屑と化す。\nしかしその身はこの世のものと思えぬ絶品らしい。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与える。\n　さらにノックバックさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312302, "グレートトゥンヌス", 312302, 0, 16, 270, 3000, 1, 3.3, 0, 0, 0, "【物理】オーマの漁師に古くから伝わる幻の巨魚。\n巨躯超速の突進は、全ての船を海の藻屑と化す。\nしかしその身はこの世のものと思えぬ絶品らしい。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与える。\n　さらにノックバックさせる。\n・残り時間が35秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312303, "グレートトゥンヌス", 312302, 0, 16, 270, 3000, 1, 1.1, 0, 0, 0, "【物理】オーマの漁師に古くから伝わる幻の巨魚。\n巨躯超速の突進は、全ての船を海の藻屑と化す。\nしかしその身はこの世のものと思えぬ絶品らしい。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与える。\n　さらにノックバックさせる。\n・残り時間が35秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312304, "グレートトゥンヌス", 312302, 0, 16, 270, 3000, 1, 0.0, 0, 0, 0, "【ＭＯＤＥ１】数多の漁師を波間に沈めた海の王。\n黄金に輝くヒレで大漁船の竜骨をも圧し折る。\nその様はさながら大海原の解体ショー\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与える。\n　さらにノックバックさせる。\n・前方範囲内の敵すべてに物理大ダメージを与え、\n　さらに後ろから２キャラに物理中ダメージを\n　与える。また、自身の物理攻撃力を小アップ\n　させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312305, "グレートトゥンヌス", 312305, 0, 16, 270, 3000, 1, 1.0, 0, 0, 0, "【ＭＯＤＥ２】海を駆ける怪魚はさらに力を増す。\nひと泳ぎで自身を鼓舞するかのように大渦をおこ\nし大海を分かつ巨大な砲弾となって敵に激突する。\n\n・ユニオンバーストは、前から３キャラに\n　物理特大ダメージを与え\n　さらにノックバックさせる。\n・自身の物理攻撃力を大アップ、行動速度を\n　中アップ、ＴＰを小アップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312306, "グレートトゥンヌス", 312302, 0, 16, 270, 3000, 1, 1.0, 0, 0, 0, "【ＭＯＤＥ３】幾度もその黒い巨体に銛を受けよ\nうとも、伝説の巨魚の猛進は止められない。\n永きにわたる海の漢たちとの勝負の決着の時。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与える。\n　さらにノックバックさせる。\n・自身の物理攻撃力を大アップ、行動速度を\n　中アップ、ＴＰを大アップさせる。\n・残り時間が35秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312400, "アイスグリフォン", 312400, 0, 11, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】氷翼を広げ、冒険者を威嚇\nする大鷲。縄張りに踏み込んだ者\nを、容赦なく氷漬けにし子どもたち\nの贄とする。\n\n・ユニオンバーストは、前方小範囲\n　に物理大ダメージを与え、さらに\n　大きく吹き飛ばし、氷結状態に\n　する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312401, "アイスグリフォン", 312400, 0, 11, 270, 1000, 1, 1.6, 0, 0, 0, "【物理】氷翼を広げ、冒険者を威嚇\nする大鷲。縄張りに踏み込んだ者\nを、容赦なく氷漬けにし子どもたち\nの贄とする。\n\n・ユニオンバーストは、前方小範囲\n　に物理大ダメージを与え、さらに\n　大きく吹き飛ばし、氷結状態に\n　する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312500, "マダムエレクトラ", 312500, 0, 6, 270, 1000, 2, 1.6, 0, 0, 0, "【魔法】塔の魔力を蓄え雷撃として放電する怪鳥。\n雷雲と共に顕現し、天災の如き雷で敵を葬り去る。\n\n・敵全体に魔法大ダメージを与え、自分の魔法\n　攻撃力と、行動速度を小アップさせる。\n　物理攻撃をする敵にはさらに追加ダメージ。\n・前方範囲内の敵すべてに魔法中ダメージを与え\n　物理防御力と魔法防御力を中ダウンさせる。\n・物理攻撃力が最も高い敵１キャラに魔法大\n　ダメージを与え、長時間麻痺状態にする。\n　自分のＨＰが85％を切ると、魔法攻撃力が\n　最も高い敵にもこの攻撃を行う。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312600, "ジェネラルホーン", 312600, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312601, "ジェネラルホーン", 312600, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【物理】立派な麋角をもつ大型魔物。大岩をも\n軽々粉砕する大角で冒険者をまとめて薙ぎ払う。\n\n・通常攻撃は、前方１キャラを中心とした範囲内\n　に物理小ダメージを与える。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　さらに、自身の物理・魔法防御力を中ダウンさ\n　せる。\n・前方範囲内に物理中ダメージを与え、スタンさ\n　せる。さらに、自身の物理・魔法防御力を大ダ\n　ウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312602, "ジェネラルホーン", 312600, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【物理】立派な麋角をもつ大型魔物。大岩をも\n軽々粉砕する大角で冒険者をまとめて薙ぎ払う。\n\n・通常攻撃は、前方１キャラを中心とした範囲内\n　に物理小ダメージを与える。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　さらに、自身の物理・魔法防御力を中ダウンさ\n　せる。\n・前方範囲内に物理中ダメージを与え、スタンさ\n　せる。さらに、自身の物理・魔法防御力を大ダ\n　ウンさせる。\n・残り時間が25秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312603, "ジェネラルホーン", 312600, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【物理】立派な麋角をもつ大型魔物。大岩をも\n軽々粉砕する大角で冒険者をまとめて薙ぎ払う。\n\n・通常攻撃は、前方１キャラを中心とした範囲内\n　に物理小ダメージを与える。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　さらに、自身の物理・魔法防御力を中ダウンさ\n　せる。\n・前方範囲内に物理中ダメージを与え、スタンさ\n　せる。さらに、自身の物理・魔法防御力を大ダ\n　ウンさせる。\n・残り時間が25秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312604, "ジェネラルホーン", 312600, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【ＭＯＤＥ１】首領の雄たけびで、手先の牡鹿が\n群れを成し押し寄せる。捨て身の突進を食い止め\nられるか？\n\n・バトル開始時、ワイルドホーンを３体召喚し、\n　さらにノックバックさせる。\n・ワイルドホーンを１体倒すたびに、残りワイル\n　ドホーン数が１減少する。\n　その後、ワイルドホーンが再度召喚され、ノッ\n　クバックさせる。\n・通常攻撃は、前方１キャラを中心とした範囲内\n　に物理小ダメージを与える。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　さらに、自身の物理・魔法防御力を中ダウンさ\n　せる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312605, "ジェネラルホーン", 312600, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【ＭＯＤＥ２】朽木の魔物を従え、冒険者を追い\n詰める。共生の朽木を失うとその身もともに破滅\nへと向かう。朽木の撃滅が攻略のカギとなる。\n\n・バトル開始時、トレントを２体召喚し、さらに\n　ノックバックさせる。\n・前方のトレントのＨＰが０になった時、ジェネ\n　ラルホーンの物理・魔法防御力を小ダウンさせ\n　る。\n・後方のトレントのＨＰが０になった時、ジェネ\n　ラルホーンの物理・魔法防御力を極大ダウンさ\n　せる。\n・通常攻撃は、前方１キャラを中心とした範囲内\n　に物理小ダメージを与える。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　さらに、自身の物理・魔法防御力を中ダウンさ\n　せる。\n・前方範囲内に物理中ダメージを与え、スタンさ\n　せる。さらに、自身の物理・魔法防御力を大ダ\n　ウンさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312606, "ジェネラルホーン", 312600, 0, 16, 270, 3000, 1, 2.7, 0, 0, 0, "【ＭＯＤＥ３】手負いの角獣が死力を振り絞る。\n命を賭した突進は体躯を紫電に変え、光の如き\n一閃は歴戦の冒険者一行を瓦解させる。\n\n・通常攻撃は、前方１キャラを中心とした範囲内\n　に物理小ダメージを与える。\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。\n　さらに、自身の物理・魔法防御力を中ダウンさ\n　せる。\n・前方範囲内に物理中ダメージを与え、スタンさ\n　せる。さらに、自身の物理・魔法防御力を大ダ\n　ウンさせる。\n・残り時間が25秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312700, "黒風の精霊", 312700, 0, 16, 270, 3000, 2, 2.7, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312701, "黒風の精霊", 312700, 0, 16, 270, 3000, 2, 2.7, 0, 0, 0, "【魔法】使役者の真の力を試す黒き風の精霊。\nそこには悪意はなく、純粋に己の内に秘めた想い\nと絆が試される。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。さらに、\n　残りＨＰが最も低い１キャラにカウントダウン\n　を付与し、５秒後に最大ＨＰの80%の魔法\n　割合ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312702, "黒風の精霊", 312700, 0, 16, 270, 3000, 2, 2.7, 0, 0, 0, "【魔法】使役者の真の力を試す黒き風の精霊。\nそこには悪意はなく、純粋に己の内に秘めた想い\nと絆が試される。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。さらに、\n　残りＨＰが最も低い１キャラにカウントダウン\n　を付与し、５秒後に最大ＨＰの80%の魔法\n　割合ダメージを与える。\n・敵全体を猛毒状態にし、さらに物理・魔法攻撃\n　力を大ダウンさせる。\n・残り時間が25秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312703, "黒風の精霊", 312700, 0, 16, 270, 3000, 2, 2.7, 0, 0, 0, "【魔法】使役者の真の力を試す黒き風の精霊。\nそこには悪意はなく、純粋に己の内に秘めた想い\nと絆が試される。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。さらに、\n　残りＨＰが最も低い１キャラにカウントダウン\n　を付与し、５秒後に最大ＨＰの80%の魔法\n　割合ダメージを与える。\n・敵全体を猛毒状態にし、さらに物理・魔法攻撃\n　力を大ダウンさせる。\n・残り時間が25秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312704, "黒風の精霊", 312700, 0, 16, 270, 3000, 2, 2.7, 0, 0, 0, "【ＭＯＤＥ１】第一の試練。黒き風の精霊の暴風\nの継ぎ目を見切れば、自ずと己の進むべき道が\n切り拓かれん。\n\n・敵全体に物理ダメージとスタンを与え、ノック\n　バックさせる。\n　黒風の精霊が眠っている間、自身の物理防御力\n　が大幅にダウンし、その間に100000以上\n　のダメージを与えると、防御力ダウンが延長さ\n　れ行動速度もダウンする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312705, "黒風の精霊", 312705, 0, 16, 270, 3000, 2, 2.7, 0, 0, 0, "【ＭＯＤＥ２】第二の試練。己の弱き心と対峙\nせよ。いつも答えは己の内にある。今一度、仲間\nの力を信じ立ち向かえ。\n\n・前から２キャラに物理小ダメージを与え、さら\n　にノックバックさせ、スタンを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312706, "黒風の精霊", 312700, 0, 16, 270, 3000, 2, 2.7, 0, 0, 0, "【ＭＯＤＥ３】第三の試練。終の試練は、己の\nすべてを懸け黒き風の精霊に本当の想いと絆を\n顕現し、己の想いを確かめよ。\n\n・ユニオンバーストは、敵全体にキャラの最大Ｈ\n　Ｐに応じた魔法割合ダメージを与える。さらに、\n　残りＨＰが最も低い１キャラにカウントダウン\n　を付与し、５秒後に最大ＨＰの80%の魔法\n　割合ダメージを与える。\n・敵全体を猛毒状態にし、さらに物理・魔法攻撃\n　力を大ダウンさせる。\n・残り時間が25秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312800, "魔物の姫", 312800, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312801, "魔物の姫", 312800, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】辺境の城に座する、孤高な魔物の姫君。\n悲哀なる恋慕を胸に、自らに挑む者を打ち砕く。\n\n・ユニオンバーストは、前方２キャラに最大ＨＰ\n　に応じた物理割合ダメージを与える。\n　力を溜めることに成功した場合、ダメージが\n　アップし、敵全体を畏怖状態にする。\n　畏怖状態のキャラは、一定時間攻撃およびＨＰ\n　回復のユニオンバーストとスキルの効果が\n　ダウン。\n・物理防御力と魔法防御力が大幅にダウンした後、\n　一定時間、力を溜める。\n　力が溜まると、ＴＰが特大回復する。\n　力を溜めている間に魔物の姫が7000以上の\n　ダメージを受けると、力を溜めることに失敗し、\n　ＴＰが大ダウン。 \n・目の前の敵１キャラに物理ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・前方３キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312802, "魔物の姫", 312800, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】辺境の城に座する、孤高な魔物の姫君。\n悲哀なる恋慕を胸に、自らに挑む者を打ち砕く。\n\n・ユニオンバーストは、前方２キャラに最大ＨＰ\n　に応じた物理割合ダメージを与える。\n　力を溜めることに成功した場合、ダメージが\n　アップし、敵全体を畏怖状態にする。\n　畏怖状態のキャラは、一定時間攻撃およびＨＰ\n　回復のユニオンバーストとスキルの効果が\n　ダウン。\n・物理防御力と魔法防御力が大幅にダウンした後、\n　一定時間、力を溜める。\n　力が溜まると、ＴＰが特大回復する。\n　力を溜めている間に魔物の姫が21000以上\n　のダメージを受けると、力を溜めることに失敗\n　し、ＴＰが大ダウン。 \n・目の前の敵１キャラに物理ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・前方３キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312803, "魔物の姫", 312800, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【物理】辺境の城に座する、孤高な魔物の姫君。\n悲哀なる恋慕を胸に、自らに挑む者を打ち砕く。\n\n・ユニオンバーストは、前方２キャラに最大ＨＰ\n　に応じた物理割合ダメージを与える。\n　力を溜めることに成功した場合、ダメージが\n　アップし、敵全体を畏怖状態にする。\n　畏怖状態のキャラは、一定時間攻撃およびＨＰ\n　回復のユニオンバーストとスキルの効果が\n　ダウン。\n・物理防御力と魔法防御力が大幅にダウンした後、\n　一定時間、力を溜める。\n　力が溜まると、ＴＰが特大回復する。\n　力を溜めている間に魔物の姫が260000\n　以上のダメージを受けると、力を溜めることに\n　失敗し、ＴＰが大ダウン。 \n・目の前の敵１キャラに物理ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・前方３キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・魔物の姫自身のＨＰが25％を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312804, "魔物の姫", 312800, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【ＭＯＤＥ１】高潔なる姫君は従兵を以て対敵を\n拒絶する。さながら内なる嘆きを虚飾するが如く。\n\n・ユニオンバーストは、前方２キャラに最大ＨＰ\n　に応じた物理割合ダメージを与える。\n・目の前の敵１キャラに物理ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・前方３キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312805, "魔物の姫", 312800, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【ＭＯＤＥ２】姫君は更なる力を解き放つ。\n歪曲した強き恋慕で、全てを拒み屠らんとする。\n\n・敵からの攻撃による麻痺、スタン、束縛、凍結、\n　時間停止、行動速度低下効果への耐性を持たな\n　い。\n・ユニオンバーストは、前方２キャラに最大ＨＰ\n　に応じた物理割合ダメージを与える。\n・目の前の敵１キャラに物理ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・前方３キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・短時間無敵状態になり、敵全体のステータス\n　アップ効果を解除した後、一定時間バトルフ\n　ィールドを展開する。\n\n【バトルフィールド効果】\n・敵全体の物理攻撃力と魔法攻撃力を100％\n　ダウンした後、物理攻撃力と魔法攻撃力を\n　特大アップ。\n・魔物の姫の物理攻撃力を特大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312806, "魔物の姫", 312800, 0, 16, 270, 3000, 1, 1.8, 0, 0, 0, "【ＭＯＤＥ３】大いなる悲哀に呼応して、姫君の\n進攻は苛烈を極める。乙女の熱情を以て、その\n悲しみに救いをもたらさん。\n\n・ユニオンバーストは、前方２キャラに最大ＨＰ\n　に応じた物理割合ダメージを与える。\n　力を溜めることに成功した場合、ダメージが\n　アップし、敵全体を畏怖状態にする。\n　畏怖状態のキャラは、一定時間攻撃およびＨＰ\n　回復のユニオンバーストとスキルの効果が\n　ダウン。\n・物理防御力と魔法防御力が大幅にダウンした後、\n　一定時間、力を溜める。\n　力が溜まると、ＴＰが特大回復する。\n　力を溜めている間に魔物の姫が1500000\n　以上のダメージを受けると、力を溜めることに\n　失敗し、ＴＰが大ダウン。 \n・目の前の敵１キャラに物理ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・前方３キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・魔物の姫自身のＨＰが25％を切ると、さらに\n　攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (312900, "黒月の守護像", 312900, 0, 16, 270, 3000, 1, 2.5, 0, 0, 0, "【物理】天上の聖域を護る、黒月に祝福されし像。\n聖域に踏み入る、冒険者を常世の闇に葬り去る。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与える。\n・敵全体に物理大ダメージを与え、ステータス\n　アップ効果を解除する。このスキルの効果は\n　ダメージを無効化しても付与される。\n・自身の物理攻撃力と魔法攻撃力を大アップさ\n　せる。白陽の守護像が討伐されている場合、\n　このスキルを使用する。\n・黒月の守護像のＨＰが50％を切ると、物理\n　攻撃力を大アップさせ、物理防御力を中アップ\n　する。\n・黒月の守護像のターゲットがブレイクしてい\n　る場合、物理防御力と魔法防御力が小ダウンす\n　る。\n・白陽の守護像が討伐されていた場合、バトルス\n　タートの際、もしくは黒月の守護像が通常攻撃\n　を行った際に、黒月の守護像の攻撃行動を変更\n　する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313000, "白陽の守護像", 313000, 0, 16, 270, 3000, 2, 2.5, 0, 0, 0, "【魔法】天上の聖域を護る、白陽に祝福されし像。\n全てを浄化する白雷で、冒険者に審判を下す。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた魔法割合ダメージを与える。\n・敵全体に魔法大ダメージを与え、ステータス\n　アップ効果を解除する。さらに白陽の守護像の\n　魔法攻撃力を大アップする。このスキルの効果\n　はダメージを無効化しても付与される。黒月の\n　守護像が討伐されている場合、このスキルを使\n　用する。\n・味方全体の物理防御力と魔法防御力を中アップ\n　させる。\n・白陽の守護像のＨＰが50％を切ると、魔法攻\n　撃力を特大アップさせ、魔法防御力を小アップ\n　する。\n・白陽の守護像のターゲットがブレイクしている\n　場合、物理防御力と魔法防御力が小ダウンする。\n・黒月の守護像が討伐されていた場合、バトルス\n　タートの際、もしくは白陽の守護像が通常攻撃\n　を行った際に、白陽の守護像の攻撃行動を変更\n　する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313100, "バースト・タイムラーベ", 313100, 0, 16, 270, 3000, 2, 1.4, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313101, "バースト・タイムラーベ", 313100, 0, 16, 270, 3000, 2, 1.4, 0, 0, 0, "【魔法】ホマレ所蔵の魔道具が、臨界を超え暴走\nした姿。本来の役目も忘れ、冒険者を混沌へと\n導く水先案内人と化す。\n\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、さらに行動速度を中ダウン、魔法防御\n　力を中ダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・自分の魔法攻撃力を中アップ、行動速度を大\n　アップさせる。\n・向かって左側のターゲットのブレイク時、\n　物理/魔法防御力が中ダウン。\n・中央下部のターゲットのブレイク時、\n　物理/魔法防御力が大ダウン。\n・中央上部のターゲットのブレイク時、\n　物理/魔法防御力が大ダウン。\n・向かって右側のターゲットのブレイク時、\n　物理/魔法防御力が特大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313102, "バースト・タイムラーベ", 313100, 0, 16, 270, 3000, 2, 1.4, 0, 0, 0, "【魔法】ホマレ所蔵の魔道具が、臨界を超え暴走\nした姿。本来の役目も忘れ、冒険者を混沌へと\n導く水先案内人と化す。\n\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、さらに行動速度を中ダウン、魔法防御\n　力を中ダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・自分の魔法攻撃力を中アップ、行動速度を大\n　アップさせる。\n・向かって左側のターゲットのブレイク時、\n　物理/魔法防御力が中ダウン。\n・中央下部のターゲットのブレイク時、\n　物理/魔法防御力が大ダウン。\n・中央上部のターゲットのブレイク時、\n　物理/魔法防御力が大ダウン。\n・向かって右側のターゲットのブレイク時、\n　物理/魔法防御力が特大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313103, "バースト・タイムラーベ", 313100, 0, 16, 270, 3000, 2, 1.4, 0, 0, 0, "【魔法】ホマレ所蔵の魔道具が、臨界を超え暴走\nした姿。本来の役目も忘れ、冒険者を混沌へと\n導く水先案内人と化す。\n\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、さらに行動速度を中ダウン、魔法防御\n　力を中ダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・自分の魔法攻撃力を中アップ、行動速度を大\n　アップさせる。\n・残り時間が25秒を切ると、自分のTPを大アッ\n　プさせ、さらに攻撃が激しく凶暴になる。\n・向かって左側のターゲットのブレイク時、\n　物理/魔法防御力が中ダウン。\n・中央下部のターゲットのブレイク時、\n　物理/魔法防御力が大ダウン。\n・中央上部のターゲットのブレイク時、\n　物理/魔法防御力が大ダウン。\n・向かって右側のターゲットのブレイク時、\n　物理/魔法防御力が特大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313104, "バースト・タイムラーベ", 313104, 0, 16, 270, 3000, 2, 1.4, 0, 0, 0, "【ＭＯＤＥ１】暴走した魔道具は、すべてのもの\nを自身の領域に留めようとする。幾重もの障壁に\nも屈せず、己を信じ未来を切り拓け。\n\n・このバトルでは、全てのターゲットがブレイク\n　無効。\n・バリアを張り、敵の攻撃を受け付けなくなる。\n　バリアはダメージを与えるたびに徐々に耐久性\n　を失っていき、一定量のダメージを与えるとバ\n　リアは破壊される。\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、さらに行動速度を中ダウン、魔法防御\n　力を中ダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・自分の魔法攻撃力を中アップ、行動速度を大\n　アップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313105, "バースト・タイムラーベ", 313100, 0, 16, 270, 3000, 2, 1.4, 0, 0, 0, "【ＭＯＤＥ２】イノリとカヤのシャドウを召喚。\n自身の「もしも」の姿に二人は何を見るのか。\n虚構を打ち破り己の道筋の正しさを証明する時。\n\n・このバトルでは、全てのターゲットがブレイク\n　無効。\n・自分の魔法攻撃力を中アップ、行動速度を大\n　アップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313106, "バースト・タイムラーベ", 313100, 0, 16, 270, 3000, 2, 0.8, 0, 0, 0, "【ＭＯＤＥ３】主を失った魔道具はコントロール\nを失い、暴走を続ける。降り注ぐ絶望に抗い続け\nれば、一筋の希望の光の道が開かれん。\n\n・ユニオンバーストは、敵全体に魔法大ダメージ\n　を与え、さらに行動速度を中ダウン、魔法防御\n　力を中ダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・自分の魔法攻撃力を中アップ、行動速度を大\n　アップさせる。\n・残り時間が25秒を切ると、自分のTPを大アッ\n　プさせ、さらに攻撃が激しく凶暴になる。\n・向かって左側のターゲットのブレイク時、\n　物理/魔法防御力が中ダウン。\n・中央下部のターゲットのブレイク時、\n　物理/魔法防御力が大ダウン。\n・中央上部のターゲットのブレイク時、\n　物理/魔法防御力が大ダウン。\n・向かって右側のターゲットのブレイク時、\n　物理/魔法防御力が特大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313200, "名もなき芸術", 313200, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313201, "名もなき芸術", 313200, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "【物理】制作者の深淵が表出した？異形の芸術\n作品の魔物。その風貌は常人の尺度では到底理解\n不能で、分かる人には分かる、とは制作者の談。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた魔法割合ダメージを与える。\n　さらに、キャラのＨＰが50％未満の場合、\n　火傷状態にする。\n　このスキルにより付与された火傷のダメージ\n　では、ＴＰがアップしない。\n・前から３番目のキャラを中心とした範囲に、\n　最大ＨＰに応じた物理割合ダメージを与える。\n　さらに、火傷状態のキャラには追加で最大\n　ＨＰに応じた物理割合ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313202, "名もなき芸術", 313200, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "【物理】制作者の深淵が表出した？異形の芸術\n作品の魔物。その風貌は常人の尺度では到底理解\n不能で、分かる人には分かる、とは制作者の談。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた魔法割合ダメージを与える。\n　さらに、キャラのＨＰが50％未満の場合、\n　火傷状態にする。\n　このスキルにより付与された火傷のダメージ\n　では、ＴＰがアップしない。\n・前から３番目のキャラを中心とした範囲に、\n　最大ＨＰに応じた物理割合ダメージを与える。\n　さらに、火傷状態のキャラには追加で最大\n　ＨＰに応じた物理割合ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313203, "名もなき芸術", 313200, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "【物理】制作者の深淵が表出した？異形の芸術\n作品の魔物。その風貌は常人の尺度では到底理解\n不能で、分かる人には分かる、とは制作者の談。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた魔法割合ダメージを与える。\n　さらに、キャラのＨＰが50％未満の場合、\n　火傷状態にする。\n　このスキルにより付与された火傷のダメージ\n　では、ＴＰがアップしない。\n・前から３番目のキャラを中心とした範囲に、\n　最大ＨＰに応じた物理割合ダメージを与える。\n　さらに、火傷状態のキャラには追加で最大\n　ＨＰに応じた物理割合ダメージを与える。\n・残り時間が30秒を切ると、自分のＴＰを\n　小アップさせ、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313204, "名もなき芸術", 313200, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "【ＭＯＤＥ１】命を宿した粘土人形は止まらない。\n内なる異形の魔力を放出し、繰り出される光線に\n少女たちは、レジスト済みの校舎は耐えられるか？\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた魔法割合ダメージを与える。\n　さらに、キャラのＨＰが50％未満の場合、\n　火傷状態にする。\n　このスキルにより付与された火傷のダメージ\n　では、ＴＰがアップしない。\n・前方範囲内の敵のバリアを解除し、最大ＨＰに\n　応じた魔法割合ダメージを与える。\n　さらに、束縛状態にする。\n　ただし、名もなき芸術が毒、猛毒、呪い、火傷\n　の効果を受けている場合、束縛は付与されない。\n・自分が毒、猛毒、呪い、火傷の効果を受けると、\n　自分の物理・魔法防御力が特大ダウンする。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313205, "名もなき芸術", 313200, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "【ＭＯＤＥ２】粘土人形が描くはこれまた独創的\nなデザインの魔法陣。そのビジュアルに騙される\nことなかれ、気を抜けば一瞬にしてぺしゃんこに。\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた魔法割合ダメージを与える。\n　さらに、キャラのＨＰが50％未満の場合、\n　火傷状態にする。\n　このスキルにより付与された火傷のダメージ\n　では、ＴＰがアップしない。\n・通常攻撃は、前方１キャラに物理中ダメージを\n　与える。\n　名もなき芸術が保持している【せんす】の数が\n　多いほどダメージがアップする。\n・前から３番目のキャラを中心とした範囲に\n　物理中ダメージを与える。\n　名もなき芸術が保持している【せんす】の数が\n　多いほどダメージがアップする。\n・バトル開始時、魔法陣を展開する。\n\n【魔法陣効果】\n・名もなき芸術に毎秒【せんす】を5つ追加する。\n・名もなき芸術がダメージを受けるたびに\n　名もなき芸術の【せんす】を1つ減少させる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313206, "名もなき芸術", 313200, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "【ＭＯＤＥ３】残された力を振り絞り、最期の狂\n気をまき散らす粘土人形。彼女らの輝かしい学生\n生活は守れるのか。立ち向かえ、なかよし部！\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた魔法割合ダメージを与える。\n　さらに、キャラのＨＰが50％未満の場合、\n　火傷状態にする。\n　このスキルにより付与された火傷のダメージ\n　では、ＴＰがアップしない。\n・前から３番目のキャラを中心とした範囲に、\n　最大ＨＰに応じた物理割合ダメージを与える。\n　さらに、火傷状態のキャラには追加で最大\n　ＨＰに応じた物理割合ダメージを与える。\n・残り時間が30秒を切ると、自分のＴＰを\n　大アップさせ、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313300, "究極玩具王 メガトイキング", 313300, 0, 16, 270, 3000, 1, 3.0, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313301, "究極玩具王 メガトイキング", 313300, 0, 16, 270, 3000, 1, 3.0, 0, 0, 0, "【物理】忘れられ暴走する悲しき玩具の王さま。\n三度、子供たちに忘れられる、恐怖と悲しみに\n震える。さぁ！今こそBB団の立ち上がるとき！\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、目の\n　前の敵１キャラの物理攻撃力と魔法攻撃力を\n　特大ダウン。\n　このスキルの効果はダメージを無効化しても\n　付与される。\n・目の前の敵１キャラにキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n・物理攻撃力、魔法攻撃力いずれかで、攻撃力\n　が高い２キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313302, "究極玩具王 メガトイキング", 313300, 0, 16, 270, 3000, 1, 3.0, 0, 0, 0, "【物理】忘れられ暴走する悲しき玩具の王さま。\n三度、子供たちに忘れられる、恐怖と悲しみに\n震える。さぁ！今こそBB団の立ち上がるとき！\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、目の\n　前の敵１キャラの物理攻撃力と魔法攻撃力を\n　特大ダウン。\n　このスキルの効果はダメージを無効化しても\n　付与される。\n・目の前の敵１キャラにキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n・物理攻撃力、魔法攻撃力いずれかで、攻撃力\n　が高い２キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313303, "究極玩具王 メガトイキング", 313300, 0, 16, 270, 3000, 1, 3.0, 0, 0, 0, "【物理】忘れられ暴走する悲しき玩具の王さま。\n三度、子供たちに忘れられる、恐怖と悲しみに\n震える。さぁ！今こそBB団の立ち上がるとき！\n\n・究極玩具王 メガトイキング自身のＨＰが40％\n　を切ると両腕が輝き出し、攻撃が激しく凶暴\n　になる。\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、目の\n　前の敵１キャラの物理攻撃力と魔法攻撃力を\n　特大ダウン。\n　このスキルの効果はダメージを無効化しても\n　付与される。\n　両腕が輝いている場合、ダメージがアップし、\n　さらに目の前の敵１キャラに物理大ダメージ\n　を与える\n・目の前の敵１キャラにキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n　両腕が輝いている場合、ダメージがアップし、\n　このスキルによるダメージではＴＰが回復し\n　ない。\n・物理攻撃力、魔法攻撃力いずれかで、攻撃力\n　が高い２キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。\n　両腕が輝いている場合、このスキルによる\n　ダメージではＴＰが回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313304, "究極玩具王 メガトイキング", 313300, 0, 16, 270, 3000, 1, 3.0, 0, 0, 0, "【ＭＯＤＥ１】暴走する友の前に小さきヒーロー\nが立ちはだかる。彼を悲しみから救い出せるか？\nマイフレくんと共にさぁ立ち向かえ、BB団！\n\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、目の\n　前の敵１キャラの物理攻撃力と魔法攻撃力を\n　特大ダウン。\n　このスキルの効果はダメージを無効化しても\n　付与される。\n・目の前の敵１キャラにキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n・物理攻撃力、魔法攻撃力いずれかで、攻撃力\n　が高い２キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。\n・マイフレンドくんがキャラの味方として一定\n　時間現れ、究極玩具王 メガトイキングが行動\n　不能になる。\n　さらにマイフレンドくんを中心に、範囲内の\n　キャラの物理攻撃力と物理クリティカルと\n　ＴＰ上昇を特大アップさせるフィールドを\n　展開する。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313305, "究極玩具王 メガトイキング", 313305, 0, 16, 270, 3000, 1, 3.0, 0, 0, 0, "【ＭＯＤＥ２】悲しき玩具王がみせる虚像。自分\n自身と向き合うのは怖いもの。一人じゃない！\nそんな強い思いを胸に、負けるな、BB団！\n\n・アオイ、ミフユ、タマキのシャドウを召喚。\n・目の前の敵１キャラにキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313306, "究極玩具王 メガトイキング", 313300, 0, 16, 270, 3000, 1, 3.0, 0, 0, 0, "【ＭＯＤＥ３】悲しき玩具王の最後の抵抗。\n忘却の寂しさに支配された力は破滅的で強大。\n友を思う気持ちを力に変え、救い出せ、BB団！\n\n・究極玩具王 メガトイキング自身のＨＰが20％\n　を切ると両腕が輝き出す。物理防御力と魔法\n　防御力が特大ダウンし、攻撃が激しく凶暴に\n　なる。\n・ユニオンバーストは、敵全体にキャラの最大\n　ＨＰに応じた物理割合ダメージを与え、目の\n　前の敵１キャラの物理攻撃力と魔法攻撃力を\n　特大ダウン。\n　このスキルの効果はダメージを無効化しても\n　付与される。\n　両腕が輝いている場合、ダメージがアップし、\n　さらに目の前の敵１キャラに物理大ダメージ\n　を与える。\n・目の前の敵１キャラにキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n　両腕が輝いている場合、ダメージがアップし、\n　このスキルによるダメージではＴＰが回復し\n　ない。\n・物理攻撃力、魔法攻撃力いずれかで、攻撃力\n　が高い２キャラに最大ＨＰに応じた物理割合\n　ダメージを与える。\n　両腕が輝いている場合、このスキルによる\n　ダメージではＴＰが回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313400, "ソードコブラ", 313400, 0, 16, 270, 3000, 1, 3.0, 0, 0, 0, "【物理】紅き邪剣を尾に宿す、凶暴な大毒蛇。\n獲物を毒息で弱らせ、一撃必殺の剣で葬り去る。\n\n・ユニオンバーストは、最も魔法攻撃力の高い敵\n　１キャラに物理大ダメージを与える。\n　猛毒状態の場合はさらに追加ダメージ。\n　その後、敵全体のＨＰ吸収を特大ダウン。\n・敵全体に魔法小ダメージを与え、毒状態を付与\n　する。\n　既に毒状態の敵には猛毒状態を付与する。\n・前から１番目の敵に物理中ダメージを与え、毒\n　状態を付与する。\n・ソードコブラの付与する毒および猛毒のダメー\n　ジでは、キャラのＴＰが回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313500, "カリザ", 313500, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "魔物を意のままに操り、強化する辣鞭の少年。\n赤青黄のスライムを従え、機敏なる猛攻を行う。\n\n・ユニオンバーストは、前方範囲内の敵にカリザ\n　の物理攻撃力に応じた物理割合ダメージを与え\n　る。\n・カリザの物理攻撃力を大アップ。\n・前から１番目のキャラにカリザの物理攻撃力に\n　応じた物理割合ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313501, "カリザ", 313501, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "魔物を意のままに操り、強化する辣鞭の少年。\n赤青黄のスライムを従え、機敏なる猛攻を行う。\n\n・ユニオンバーストは、前方範囲内の敵にカリザ\n　の物理攻撃力に応じた物理割合ダメージを与え\n　る。\n・カリザの物理攻撃力を大アップ。\n・前から１番目のキャラにカリザの物理攻撃力に\n　応じた物理割合ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313600, "ランファ", 313600, 0, 16, 270, 3001, 2, 3.0, 0, 0, 0, "天稟の才と過敏な感覚に懊悩する、幽寂の歌姫。\n争いは好まないが、願いと仲間のため奮戦する。\n\n・ユニオンバーストは、前方範囲内の敵に魔法中\n　ダメージを与え、結晶化状態にする。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n　結晶化状態では行動不能になり、継続ダメージ\n　を受ける。\n　結晶化状態はＨＰが全回復するか、一定時間経\n　過すると解除される。\n・前方範囲内の敵に猛毒状態を付与する。\n　結晶化状態の敵には追加の魔法大ダメージを与\n　える。\n・前から１番目のキャラに魔法小ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313601, "ランファ", 313601, 0, 16, 270, 3001, 2, 3.0, 0, 0, 0, "天稟の才と過敏な感覚に懊悩する、幽寂の歌姫。\n争いは好まないが、願いと仲間のため奮戦する。\n\n・ユニオンバーストは、前方範囲内の敵に魔法中\n　ダメージを与え、結晶化状態にする。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n　結晶化状態では行動不能になり、継続ダメージ\n　を受ける。\n　結晶化状態はＨＰが全回復するか、一定時間経\n　過すると解除される。\n・前方範囲内の敵に猛毒状態を付与する。\n　結晶化状態の敵には追加の魔法大ダメージを与\n　える。\n・前から１番目のキャラに魔法小ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313700, "ミソラ", 313700, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "常に明朗快活、誰とでも友達になれる溌溂少女。\n回転式銃を愛用し、単独で飽和攻撃を仕掛ける。\n\n・バトル開始時、ぺんぽこりんを召喚する。\n　召喚時、前方範囲内の敵全てをノックバックす\n　る。\n　ぺんぽこりんは前から２キャラに物理大ダメー\n　ジを与える。\n・ユニオンバーストは、敵全体に物理割合ダメー\n　ジを与える。\n　さらに、ぺんぽこりんの物理攻撃力と行動速度\n　を大アップ。\n・ぺんぽこりんのＨＰを回復する。\n・前から１番目のキャラに物理小ダメージを与え\n　る。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313701, "ミソラ", 313701, 0, 16, 270, 3000, 1, 2.0, 0, 0, 0, "常に明朗快活、誰とでも友達になれる溌溂少女。\n回転式銃を愛用し、単独で飽和攻撃を仕掛ける。\n\n・バトル開始時、ぺんぽこりんを召喚する。\n　召喚時、前方範囲内の敵全てをノックバックす\n　る。\n　ぺんぽこりんは前から２キャラに物理大ダメー\n　ジを与える。\n・ユニオンバーストは、敵全体に物理割合ダメー\n　ジを与える。\n　さらに、ぺんぽこりんの物理攻撃力と行動速度\n　を大アップ。\n　このスキルによるダメージでは、ＴＰ回復量は\n　減少する。\n・ぺんぽこりんのＨＰを回復する。\n・前から１番目のキャラに物理小ダメージを与え\n　る。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313800, "アゾールド", 313800, 0, 16, 270, 3000, 1, 1.5, 0, 0, 0, "常に幾つもの奥の手を隠し持つ、大食の紳士。\n万能人形を駆使し、知略戦略で敵を追い詰める。\n\n・ユニオンバーストは、敵全体にアゾールドの物\n　理攻撃力に応じた物理割合ダメージを与える。\n　さらに、アゾールドの物理防御力と魔法防御力\n　を大ダウン。\n・万能人形を召喚し敵全体をノックバックさせる。\n　万能人形は前から１番目のキャラに物理小ダメー\n　ジを与える。\n　万能人形のＨＰが一定値以下になった時、アゾー\n　ルドの物理防御力と魔法防御力を大ダウンさせ\n　る。\n・前から１番目のキャラに物理小ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313801, "アゾールド", 313801, 0, 16, 270, 3000, 1, 1.5, 0, 0, 0, "常に幾つもの奥の手を隠し持つ、大食の紳士。\n万能人形を駆使し、知略戦略で敵を追い詰める。\n\n・ユニオンバーストは、敵全体にアゾールドの物\n　理攻撃力に応じた物理割合ダメージを与える。\n　さらに、アゾールドの物理防御力と魔法防御力\n　を大ダウン。\n・万能人形を召喚し敵全体をノックバックさせる。\n　万能人形は前から１番目のキャラに物理小ダメー\n　ジを与える。\n　万能人形のＨＰが一定値以下になった時、アゾー\n　ルドの物理防御力と魔法防御力を大ダウンさせ\n　る。\n・前から１番目のキャラに物理小ダメージ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313900, "ゼーン", 313900, 0, 16, 270, 3000, 1, 1.0, 313900, 313900, 0, "一騎当千、万夫不当の実力を揮う寡黙な剣士。\n覚醒することで、龍は更なる高みへと昇る。\n\n・ユニオンバーストは、敵全体にゼーンの物理\n　攻撃力と残りＨＰに応じた物理割合ダメージ\n　を与える。\n　このスキルによるダメージでは、ＴＰ回復量\n　は減少する。\n・敵全体に物理中ダメージを与え、スタンさせ\n　る。\n・ゼーンのＴＰ上昇、行動速度、物理攻撃力を\n　大アップ。\n　このスキルの効果は発動するたびにアップす\n　る。\n　３回目の発動時は、さらにＴＰ1000アップ。\n・前から１番目のキャラに物理中ダメージを与\n　え、小さく吹き飛ばす。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (313901, "ゼーン", 313901, 0, 16, 270, 3000, 1, 1.0, 313900, 313900, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314000, "宿題", 314000, 0, 16, 270, 3000, 1, 1.0, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314001, "得意な宿題", 314001, 0, 16, 270, 3000, 1, 1.0, 0, 0, 0, "まずは手始めに得意な宿題を終わらせよう。\nここでつまづいてはいられない。夏休みの宿題は\nほかにもまだまだあるぞ！！\n\n・バトル開始後、大量の宿題が降り注ぎ、\n　敵全体にダメージ。\n・バトル中、一定時間が経過するごとに\n　モンスターが押し寄せてくる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314002, "ちょっと苦手な宿題", 314002, 0, 16, 270, 3000, 1, 1.0, 0, 0, 0, "誰にでもある苦手科目の宿題。ついつい後回しに\nしがちで、溜まってしまうとなかなか大変。\nここで立ち止まるわけにはいかないぞ！\n\n・バトル開始後、大量の宿題が降り注ぎ、\n　敵全体にダメージ。\n・バトル中、一定時間が経過するごとに\n　モンスターが押し寄せてくる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314003, "すごく苦手な宿題", 314003, 0, 16, 270, 3000, 1, 1.0, 0, 0, 0, "眺めているだけで眩暈のするいや～な宿題。\nペンを置いて外に飛び出したくなる衝動を耐え、\nコツコツ進めていくことが攻略のカギ！\n\n・バトル開始後、大量の宿題が降り注ぎ、\n　敵全体にダメージ。\n・バトル中、一定時間が経過するごとに\n　モンスターが押し寄せてくる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314004, "夏休み最後まで残りし宿題", 314004, 0, 16, 270, 3000, 1, 1.0, 0, 0, 0, "SP MODE1");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314005, "夏休み最後まで残りし宿題", 314005, 0, 16, 270, 3000, 1, 1.0, 0, 0, 0, "SP MODE2");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314006, "夏休み最後まで残りし宿題", 314006, 0, 16, 270, 3000, 1, 1.0, 0, 0, 0, "夏休みの間ずっと、目を背けてきた最後の宿題。\nここまで放置してきた後悔が一気に襲い掛かる。\nすべてやり遂げて笑顔で登校できるか！？\n\n・バトル開始後、大量の宿題が降り注ぎ、\n　敵全体にダメージ。\n・バトル中、一定時間が経過するごとに\n　モンスターが押し寄せてくる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314100, "クイーンウタクラゲ", 314100, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314101, "クイーンウタクラゲ", 314100, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】華のように大海をゆらめき、歌声を奏で\nるウタクラゲの女王。美しく飾られたその姿の内\nには猛毒の体液を隠し持つ。\n\n・ユニオンバーストは、敵全体にキャラのＨＰに\n　応じた魔法割合ダメージを与える。\n　猛毒状態の敵にはダメージがアップする。\n　さらに敵に毒状態を付与し、既に毒か猛毒状態\n　の敵には猛毒状態を付与する。\n・目の前の敵１キャラに魔法大ダメージを与える。\n・敵全体に魔法小ダメージを与え、毒状態を付与\n　する。\n　敵が猛毒状態の場合、スタンさせる。\n・クイーンウタクラゲの付与する毒および猛毒の\n　ダメージでは、キャラのＴＰが回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314102, "クイーンウタクラゲ", 314100, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】華のように大海をゆらめき、歌声を奏で\nるウタクラゲの女王。美しく飾られたその姿の内\nには猛毒の体液を隠し持つ。\n\n・ユニオンバーストは、敵全体にキャラのＨＰに\n　応じた魔法割合ダメージを与える。\n　猛毒状態の敵にはダメージがアップする。\n　さらに敵に毒状態を付与し、既に毒か猛毒状態\n　の敵には猛毒状態を付与する。\n・目の前の敵１キャラに魔法大ダメージを与える。\n・敵全体に魔法小ダメージを与え、毒状態を付与\n　する。\n　敵が猛毒状態の場合、スタンさせる。\n・クイーンウタクラゲの付与する毒および猛毒の\n　ダメージでは、キャラのＴＰが回復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314103, "クイーンウタクラゲ", 314100, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】華のように大海をゆらめき、歌声を奏で\nるウタクラゲの女王。美しく飾られたその姿の内\nには猛毒の体液を隠し持つ。\n\n・ユニオンバーストは、敵全体にキャラのＨＰに\n　応じた魔法割合ダメージを与える。\n　猛毒状態の敵にはダメージがアップする。\n　さらに敵に毒状態を付与し、既に毒か猛毒状態\n　の敵には猛毒状態を付与する。\n・目の前の敵１キャラに魔法大ダメージを与える。\n・敵全体に魔法小ダメージを与え、毒状態を付与\n　する。\n　敵が猛毒状態の場合、スタンさせる。\n・クイーンウタクラゲの付与する毒および猛毒の\n　ダメージでは、キャラのＴＰが回復しない。\n・残り時間が25秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314104, "クイーンウタクラゲ", 314104, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【ＭＯＤＥ１】襲い来る無数の魔物たち。その歌\n声は轟然とこだまし舞台を脅かす。ファンの笑顔\nを守るため、少女たちは歌い踊り、そして戦う。\n\n・バトル開始時、ウタクラゲを３体召喚する。\n・ウタクラゲを１体倒すたびに、残りウタクラゲ\n　数が１減少する。\n　その後、ウタクラゲが再度召喚され、パーティ\n　キャラ全体をノックバックさせる。\n・ウタクラゲは、残りＨＰが最も高い敵１キャラ\n　に魔法中ダメージを与え、毒状態を付与する。\n・ユニオンバーストは、敵全体にキャラのＨＰに\n　応じた魔法割合ダメージを与える。\n　猛毒状態の敵にはダメージがアップする。\n　さらに敵に毒状態を付与し、既に毒か猛毒状態\n　の敵には猛毒状態を付与する。\n・目の前の敵１キャラに魔法大ダメージを与える。\n・クイーンウタクラゲとウタクラゲの付与する毒\n　および猛毒のダメージでは、キャラのＴＰが回\n　復しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314105, "クイーンウタクラゲ", 314105, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【ＭＯＤＥ２】目の前に現れたのは、過去の\n自分たち。成長の果て、少女たちは過去を越え、\nその一瞬一瞬の輝きを歌声に乗せる。\n\n・カルミナのシャドウを召喚。\n・目の前の敵１キャラに魔法大ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314106, "クイーンウタクラゲ", 314104, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【ＭＯＤＥ３】優艶なる華は乱れ、内なる魔性\nを解き放つ。劇毒の雨音をメロディーに、\n歌姫は歌う――最期の歌を。\n\n・ユニオンバーストは、敵全体にキャラのＨＰに\n　応じた魔法割合ダメージを与える。\n　猛毒状態の敵にはダメージがアップする。\n　さらに敵に毒状態を付与し、既に毒か猛毒状態\n　の敵には猛毒状態を付与する。\n・目の前の敵１キャラに魔法大ダメージを与える。\n・敵全体に魔法小ダメージを与え、毒状態を付与\n　する。\n　敵が猛毒状態の場合、スタンさせる。\n・クイーンウタクラゲの付与する毒および猛毒の\n　ダメージでは、キャラのＴＰが回復しない。\n・残り時間が25秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314200, "ドクターギグル", 314200, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314201, "ドクターギグル", 314200, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】卑劣なる本性を現したオーエドの怪医。\n研究で手にした究極の肉体で、世界への復讐を\n果たさんとする。\n\n・ユニオンバーストは、敵全体にドクターギグル\n　の物理攻撃力に応じた物理割合ダメージを与え、\n　毒状態にする。\n・デモンフラスコを召喚し敵全体をノックバック\n　させる。\n・デモンフラスコは、一定時間経過すると\n　ドクターギグルの物理攻撃力を中アップさせ、\n　ＴＰを特大回復させたあと、消滅する。\n　ただしデモンフラスコのＨＰが一定値以下に\n　なった場合は、パーティ全体の物理攻撃力と魔\n　法攻撃力を特大アップさせ、ＴＰを特大回復さ\n　せたあと、消滅する。\n　またその時に、次にドクターギグルが召喚する\n　デモンフラスコが1段階強化される。\n・物理攻撃力、魔法攻撃力いずれかで、攻撃力が\n　最も高い敵１キャラに物理大ダメージを与え、\n　さらに行動速度をダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314202, "ドクターギグル", 314200, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】卑劣なる本性を現したオーエドの怪医。\n研究で手にした究極の肉体で、世界への復讐を\n果たさんとする。\n\n・ユニオンバーストは、敵全体にドクターギグル\n　の物理攻撃力に応じた物理割合ダメージを与え、\n　毒状態にする。\n・デモンフラスコを召喚し敵全体をノックバック\n　させる。\n・デモンフラスコは、一定時間経過すると\n　ドクターギグルの物理攻撃力を中アップさせ、\n　ＴＰを特大回復させたあと、消滅する。\n　ただしデモンフラスコのＨＰが一定値以下に\n　なった場合は、パーティ全体の物理攻撃力と魔\n　法攻撃力を特大アップさせ、ＴＰを特大回復さ\n　せたあと、消滅する。\n　またその時に、次にドクターギグルが召喚する\n　デモンフラスコが1段階強化される。\n・物理攻撃力、魔法攻撃力いずれかで、攻撃力が\n　最も高い敵１キャラに物理大ダメージを与え、\n　さらに行動速度をダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314203, "ドクターギグル", 314200, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】卑劣なる本性を現したオーエドの怪医。\n研究で手にした究極の肉体で、世界への復讐を\n果たさんとする。\n\n・ユニオンバーストは、敵全体にドクターギグル\n　の物理攻撃力に応じた物理割合ダメージを与え、\n　毒状態にする。\n・デモンフラスコを召喚し敵全体をノックバック\n　させる。\n・デモンフラスコは、一定時間経過すると\n　ドクターギグルの物理攻撃力を特大アップさせ、\n　ＴＰを特大回復させたあと、消滅する。\n　ただしデモンフラスコのＨＰが一定値以下に\n　なった場合は、パーティ全体の物理攻撃力と魔\n　法攻撃力を特大アップさせ、ＴＰを特大回復さ\n　せたあと、消滅する。\n　またその時に、次にドクターギグルが召喚する\n　デモンフラスコが1段階強化される。\n・物理攻撃力、魔法攻撃力いずれかで、攻撃力が\n　最も高い敵１キャラに物理大ダメージを与え、\n　さらに行動速度をダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・ドクターギグル自身のＨＰが30％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314204, "ドクターギグル", 314204, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ１】幻薬により見せられるは己の虚像。\n眼前に立ち塞がる邪道の具現を、誠なる医道を\n以って打ち崩せ。\n\n・ミツキとユキのシャドウと魔物を召喚。\n・目の前の敵１キャラに物理中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314205, "ドクターギグル", 314205, 0, 16, 270, 3000, 1, 0.0, 0, 0, 0, "【ＭＯＤＥ２】魔腕から放たれる妖光が地を駆け\nる。その魔性に呑まれし実験体たちは、我を忘れ\nて猛り狂う。\n\n・魔物を召喚し、敵全体をノックバックさせる。\n・召喚された魔物を１体倒すたびに、\n　残りターゲット数が１減少する。\n　その後、魔物が再度召喚され、敵全体をノック\n　バックさせる。\n・ドクターギグルを除く味方全体の物理防御力と\n　魔法防御力を特大アップ。\n　ドクターギグルのＨＰが、バトル開始から\n　5000以上と10000以上減少すると、ド\n　クターギグルの姿が変化し、このスキルの効果\n　がダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314206, "ドクターギグル", 314200, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ３】肉体の進化は極限へと昇華する。\n進化の果て、野望の果て、この魔腕で世界を掴ま\nんと、怪医の激憤が轟く。\n\n・ユニオンバーストは、敵全体にドクターギグル\n　の物理攻撃力に応じた物理割合ダメージを与え、\n　毒状態にする。\n・デモンフラスコを召喚し敵全体をノックバック\n　させる。\n・デモンフラスコは、一定時間経過すると\n　ドクターギグルの物理攻撃力と物理防御力と魔\n　法防御力を特大アップさせ、ＴＰを特大回復さ\n　せたあと、消滅する。\n　ただしデモンフラスコのＨＰが一定値以下に\n　なった場合は、パーティ全体の物理攻撃力と魔\n　法攻撃力をバトル終了まで中アップさせ、\n　ＴＰを特大回復させたあと、消滅する。\n　またその時に、次にドクターギグルが召喚する\n　デモンフラスコが1段階強化される。\n・物理攻撃力、魔法攻撃力いずれかで、攻撃力が\n　最も高い敵１キャラに物理特大ダメージを与え、\n　さらに行動速度をダウンさせる。\n　このスキルの状態異常はダメージを無効化して\n　も付与される。\n・ドクターギグル自身のＨＰが30％を切ると、\n　さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314300, "哀暴のわたあめちゃん", 314300, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314301, "哀暴のわたあめちゃん", 314301, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】独り心細いなか、金儲けの道具にされ\n悲哀の感情が暴走し、真の力を解き放った魔犬。\nその暴走は全てを押し潰すまで止まらない。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　物理大ダメージを与える。さらに自身の物理攻\n　撃力を小アップさせる。\n・目の前の敵１キャラに物理ダメージを与える。\n・前から３キャラの物理/魔法攻撃力を大ダウン\n　させ、さらにバトル終了まで物理防御力を大\n　ダウンさせる。\n・自身の物理攻撃力を小アップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314302, "哀暴のわたあめちゃん", 314301, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】独り心細いなか、金儲けの道具にされ\n悲哀の感情が暴走し、真の力を解き放った魔犬。\nその暴走は全てを押し潰すまで止まらない。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　物理大ダメージを与える。さらに自身の物理攻\n　撃力を小アップさせる。\n・目の前の敵１キャラに物理ダメージを与える。\n・前から３キャラの物理/魔法攻撃力を大ダウン\n　させ、さらにバトル終了まで物理防御力を大\n　ダウンさせる。\n・自身の物理攻撃力を小アップさせる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314303, "哀暴のわたあめちゃん", 314300, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】独り心細いなか、金儲けの道具にされ\n悲哀の感情が暴走し、真の力を解き放った魔犬。\nその暴走は全てを押し潰すまで止まらない。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　物理大ダメージを与える。さらに自身の物理攻\n　撃力を小アップさせる。この攻撃は物理攻撃力\n　アップ・ダウン効果の影響を受けやすい。\n・目の前の敵１キャラに物理ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・前から３キャラの物理/魔法攻撃力を大ダウン\n　させ、さらにバトル終了まで物理防御力を大\n　ダウンさせる。\n・自身の物理攻撃力を大アップさせる。\n・残り時間が30秒を切ると、敵全体の物理防御\n　力を大ダウン、自身の物理/魔法防御力を大\n　アップさせ、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314304, "哀暴のわたあめちゃん", 314304, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ１】異界から迷い込んだ霊が写し鏡\nの如く皆に化け立ちはだかる。見事勝利をおさ\nめ世界を救えるか、ハロウィンセイバーズ。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　物理大ダメージを与える。さらに自身の物理攻\n　撃力を小アップさせる。この攻撃は物理攻撃力\n　アップ・ダウン効果の影響を受けやすい。\n・目の前の敵１キャラに物理ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314305, "哀暴のわたあめちゃん", 314305, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ２】暴走から一転、球体のように丸\nまってあらゆる攻撃を遮断する。全力を賭した\n一撃も、この姿の前では一撫でに等しいだろう。\n\n・バトル開始時、自身の物理/魔法防御力を大幅\n　に上昇させる。\n・バトル中、哀暴のわたあめちゃんは行動しない。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314306, "哀暴のわたあめちゃん", 314300, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ３】超特級妖魔としての霊力を最大\n解放し、世界の均衡を崩す勢いでじゃれる\nわたあめちゃん。その愛情を全て包み込めるか。\n\n・ユニオンバーストは、敵全体のバリアを解除し、\n　物理大ダメージを与える。さらに自身の物理攻\n　撃力を小アップさせる。この攻撃は物理攻撃力\n　アップ・ダウン効果の影響を受けやすい。\n・目の前の敵１キャラに物理ダメージを与える。\n　この攻撃は物理攻撃力アップ・ダウン効果の\n　影響を受けやすい。\n・前から３キャラの物理/魔法攻撃力を大ダウン\n　させ、さらにバトル終了まで物理防御力を大\n　ダウンさせる。\n・自身の物理攻撃力を大アップさせる。\n・残り時間が30秒を切ると、敵全体の物理防御\n　力を大ダウン、自身の物理/魔法防御力を大\n　アップさせ、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314400, "アンチビースト・トリニティ", 314400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314401, "アンチビースト・トリニティ", 314400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】魔法少女たちのパワーを吸い取って進化\nしたアンチビースト。ランドソルはこのまま魔の\n手に堕ちてしまうのか！？負けるなノワールズ！\n\n・ユニオンバーストは、前方３キャラのうち、\n　ＨＰが80％以下のキャラを誘惑状態にする。\n　その後、前方３キャラにキャラの最大ＨＰに\n　応じた魔法割合ダメージを与える。\n　誘惑状態の敵にはダメージがアップする。\n・アンチビーストの下僕を召喚し敵全体をノック\n　バックさせる。\n　アンチビーストの下僕は、一定時間経過すると\n　目の前の敵１キャラを誘惑状態にしたあと、消\n　滅する。\n　ただしアンチビーストの下僕のＨＰが一定値\n　以下になった場合は、パーティ全体の物理攻撃\n　力と魔法攻撃力を特大アップさせたあと、消滅\n　する。\n・前方２キャラに魔法中ダメージを与える。\n　さらに、自分に物理無効バリアを展開する。\n・前方２キャラにキャラの最大ＨＰに応じた\n　魔法割合ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314402, "アンチビースト・トリニティ", 314400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】魔法少女たちのパワーを吸い取って進化\nしたアンチビースト。ランドソルはこのまま魔の\n手に堕ちてしまうのか！？負けるなノワールズ！\n\n・ユニオンバーストは、前方３キャラのうち、\n　ＨＰが80％以下のキャラを誘惑状態にする。\n　その後、前方３キャラにキャラの最大ＨＰに\n　応じた魔法割合ダメージを与える。\n　誘惑状態の敵にはダメージがアップする。\n・アンチビーストの下僕を召喚し敵全体をノック\n　バックさせる。\n　アンチビーストの下僕は、一定時間経過すると\n　目の前の敵１キャラを誘惑状態にしたあと、消\n　滅する。\n　ただしアンチビーストの下僕のＨＰが一定値\n　以下になった場合は、パーティ全体の物理攻撃\n　力と魔法攻撃力を特大アップさせたあと、消滅\n　する。\n・前方２キャラに魔法中ダメージを与える。\n　さらに、自分に物理無効バリアを展開する。\n・前方２キャラにキャラの最大ＨＰに応じた\n　魔法割合ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314403, "アンチビースト・トリニティ", 314400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【魔法】魔法少女たちのパワーを吸い取って進化\nしたアンチビースト。ランドソルはこのまま魔の\n手に堕ちてしまうのか！？負けるなノワールズ！\n\n・ユニオンバーストは、前方３キャラのうち、\n　ＨＰが80％以下のキャラを誘惑状態にする。\n　その後、前方３キャラにキャラの最大ＨＰに\n　応じた魔法割合ダメージを与える。\n　誘惑状態の敵にはダメージがアップする。\n・アンチビーストの下僕を召喚し敵全体をノック\n　バックさせる。\n　アンチビーストの下僕は、一定時間経過すると\n　目の前の敵１キャラを誘惑状態にしたあと、消\n　滅する。\n　ただしアンチビーストの下僕のＨＰが一定値\n　以下になった場合は、パーティ全体の物理攻撃\n　力と魔法攻撃力を特大アップさせたあと、消滅\n　する。\n・前方２キャラに魔法中ダメージを与える。\n　さらに、自分に物理無効バリアを展開する。\n・前方２キャラにキャラの最大ＨＰに応じた\n　魔法割合ダメージを与える。\n・アンチビースト・トリニティ自身のＨＰが\n　30％を切ると、さらに攻撃が激しく凶暴にな\n　る。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314404, "アンチビースト・トリニティ", 314405, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【ＭＯＤＥ１】闇の渦に囚われ希望を失いかけた\n魔法少女たち―そのとき聞こえてきたのは大事\nな人からのエールの声。立ち上がれ魔法少女よ！\n\n・ユニオンバーストは、前方３キャラのうち、\n　ＨＰが75%以下のキャラを誘惑状態にする。\n　その後、前方３キャラにキャラの最大ＨＰに\n　応じた魔法割合ダメージを与える。\n　誘惑状態の敵にはダメージがアップする。\n・バトル開始時、敵全体を呪い状態にする。\n　このスキルにより付与された呪いのダメージ\n　では、ＴＰが回復しない。\n　さらに、何らかの効果でＨＰを回復しようと\n　した場合、本来の回復量の60%をダウンさせ\n　る。\n・前方２キャラに魔法中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314405, "アンチビースト・トリニティ", 314405, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【ＭＯＤＥ２】再び闇のパワーを蓄え出した仇敵。\nしかし、暴走し始めていたのは敵だけではなかっ\nた―！？もう誰も、この３人を止められない！\n\n・バリアを張り、敵の攻撃を受け付けなくなる。\n　バリアはダメージ量に関係なく、攻撃を命中\n　させるたびに徐々に耐久性を失っていき、\n　490回攻撃を命中させるとバリアは破壊され\n　る。\n・前方２キャラに魔法中ダメージを与える。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314406, "アンチビースト・トリニティ", 314400, 0, 16, 270, 3000, 2, 1.6, 0, 0, 0, "【ＭＯＤＥ３】戦いはついにクライマックスへ。\nいとしき生徒の、弟くんの、ドＳさんのために\n愛と希望と闇を抱いて、突き進めノワールズ！\n\n・ユニオンバーストは、前方３キャラのうち、\n　ＨＰが80％以下のキャラを誘惑状態にする。\n　その後、前方３キャラにキャラの最大ＨＰに\n　応じた魔法割合ダメージを与える。\n　誘惑状態の敵にはダメージがアップする。\n・アンチビーストの下僕を召喚し敵全体をノック\n　バックさせる。\n　アンチビーストの下僕は、一定時間経過すると\n　目の前の敵１キャラを誘惑状態にしたあと、消\n　滅する。\n　ただしアンチビーストの下僕のＨＰが一定値\n　以下になった場合は、パーティ全体の物理攻撃\n　力と魔法攻撃力を特大アップさせたあと、消滅\n　する。\n・前方２キャラに魔法中ダメージを与える。\n　さらに、自分に物理無効バリアを展開する。\n・前方２キャラにキャラの最大ＨＰに応じた\n　魔法割合ダメージを与える。\n・アンチビースト・トリニティ自身のＨＰが\n　30％を切ると、さらに攻撃が激しく凶暴にな\n　る。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314500, "ひとりぼっちの聖夜の妖精", 314500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314501, "ひとりぼっちの聖夜の妖精", 314500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】遠い昔に人々から忘れられた悲しき妖精。\n信仰を失い、寂しさを紛らわすかのように悪戯を\n働き人目を集めようとする。コンテスト会場の混\n乱を治め、再び信仰を取り戻せるのか！？\n\n・ユニオンバーストは、敵全体にひとりぼっちの\n　聖夜の妖精の物理攻撃力とキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n・前から３キャラにひとりぼっちの聖夜の妖精の\n　魔法攻撃力とキャラの最大ＨＰに応じた魔法割\n　合ダメージを与え、大きく吹き飛ばす。このス\n　キルの状態異常はダメージを無効化しても付与\n　される。\n・ひとりぼっちの聖夜の妖精自身の物理/魔法防\n　御力を極大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314502, "ひとりぼっちの聖夜の妖精", 314500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】遠い昔に人々から忘れられた悲しき妖精。\n信仰を失い、寂しさを紛らわすかのように悪戯を\n働き人目を集めようとする。コンテスト会場の混\n乱を治め、再び信仰を取り戻せるのか！？\n\n・ユニオンバーストは、敵全体にひとりぼっちの\n　聖夜の妖精の物理攻撃力とキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n・前から３キャラにひとりぼっちの聖夜の妖精の\n　魔法攻撃力とキャラの最大ＨＰに応じた魔法割\n　合ダメージを与え、大きく吹き飛ばす。このス\n　キルの状態異常はダメージを無効化しても付与\n　される。\n・ひとりぼっちの聖夜の妖精自身の物理/魔法防\n　御力を極大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314503, "ひとりぼっちの聖夜の妖精", 314500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】遠い昔に人々から忘れられた悲しき妖精。\n信仰を失い、寂しさを紛らわすかのように悪戯を\n働き人目を集めようとする。コンテスト会場の混\n乱を治め、再び信仰を取り戻せるのか！？\n\n・ユニオンバーストは、敵全体にひとりぼっちの\n　聖夜の妖精の物理攻撃力とキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n・前から３キャラにひとりぼっちの聖夜の妖精の\n　魔法攻撃力とキャラの最大ＨＰに応じた魔法割\n　合ダメージを与え、大きく吹き飛ばす。このス\n　キルの状態異常はダメージを無効化しても付与\n　される。\n・ひとりぼっちの聖夜の妖精自身の物理/魔法防\n　御力を極大アップ。\n・ひとりぼっちの聖夜の妖精自身のＨＰが40％\n　を切ると、自身の物理/魔法防御力を大ダウン\n　させ、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314504, "ひとりぼっちの聖夜の妖精", 314500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ１】妖精がお菓子で形作ったミヤコた\nちの甘い猛攻と妖精の悪戯が押し寄せる。聖夜に\n育んだ輝く絆でニセモノたちを打ち砕け！\n\n・ミヤコ、マヒル、リノのシャドウを召喚。\n・前から３キャラに魔法中ダメージを与え、物理\n　防御力を特大ダウン。このスキルの効果はダ\n　メージを無効化しても付与される。\n\n");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314505, "ひとりぼっちの聖夜の妖精", 314500, 0, 16, 270, 3000, 1, 0.0, 0, 0, 0, "【ＭＯＤＥ２】妖精が袋から取り出したるは魅惑\nのお菓子。一瞬でも気を許したが最期、甘味な罠\nに堕ちていく。プリンパワーで甘い幻想を打ち砕\nけ！\n\n・ユニオンバーストは、敵全体にひとりぼっちの\n　聖夜の妖精の物理攻撃力とキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n・前から３キャラにひとりぼっちの聖夜の妖精の\n　魔法攻撃力とキャラの最大ＨＰに応じた魔法割\n　合ダメージを与え、大きく吹き飛ばす。このス\n　キルの状態異常はダメージを無効化しても付与\n　される。\n・敵全体にキャラの最大ＨＰに応じた物理割合ダ\n　メージを与え、キャラのＨＰが60%を切って\n　いる場合、誘惑状態にする。このスキルの状態\n　異常はダメージを無効化しても付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314506, "ひとりぼっちの聖夜の妖精", 314500, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ３】聖夜に独り妖精の哀叫が鳴り響く。\n傍若無人に暴れる妖精をなだめ、プリンの絆で皆\nの幸せのクリスマスと妖精の笑顔を取り戻せ！\n\n・ユニオンバーストは、敵全体にひとりぼっちの\n　聖夜の妖精の物理攻撃力とキャラの最大ＨＰに\n　応じた物理割合ダメージを与える。\n・前から３キャラにひとりぼっちの聖夜の妖精の\n　魔法攻撃力とキャラの最大ＨＰに応じた魔法割\n　合ダメージを与え、大きく吹き飛ばす。このス\n　キルの状態異常はダメージを無効化しても付与\n　される。\n・ひとりぼっちの聖夜の妖精自身の物理/魔法防\n　御力を極大アップ。\n・ひとりぼっちの聖夜の妖精自身のＨＰが30％\n　を切ると、さらに攻撃が激しく凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314600, "邪牛神モーモン", 314600, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314601, "邪牛神モーモン", 314600, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】縁起物を取り込み、願いの力を吸収して\n猛り荒ぶる牛の魔物。怒りに身を落とした猛牛が\n周囲の願いを打ち砕く。\n\n・ユニオンバーストは、敵全体に邪牛神モーモン\n　の物理攻撃力とキャラの最大ＨＰに応じた\n　物理割合ダメージを与え、火傷状態にする。\n・最も魔法攻撃力の高い敵１キャラに物理割合\n　ダメージを与え、ノックバックさせると同時に\n　スタンさせる。\n・前から１番目と２番目のキャラに物理大ダメー\n　ジを与える。スキル発動後、自身の物理攻撃力\n　を大アップさせ、物理/魔法防御力が大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314602, "邪牛神モーモン", 314600, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】縁起物を取り込み、願いの力を吸収して\n猛り荒ぶる牛の魔物。怒りに身を落とした猛牛が\n周囲の願いを打ち砕く。\n\n・ユニオンバーストは、敵全体に邪牛神モーモン\n　の物理攻撃力とキャラの最大ＨＰに応じた\n　物理割合ダメージを与え、火傷状態にする。\n・最も魔法攻撃力の高い敵１キャラに物理割合\n　ダメージを与え、ノックバックさせると同時に\n　スタンさせる。\n・前から１番目と２番目のキャラに物理大ダメー\n　ジを与える。スキル発動後、自身の物理攻撃力\n　を大アップさせ、物理/魔法防御力が大ダウン。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314603, "邪牛神モーモン", 314600, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【物理】縁起物を取り込み、願いの力を吸収して\n猛り荒ぶる牛の魔物。怒りに身を落とした猛牛が\n周囲の願いを打ち砕く。\n\n・ユニオンバーストは、敵全体に邪牛神モーモン\n　の物理攻撃力とキャラの最大ＨＰに応じた\n　物理割合ダメージを与え、火傷状態にする。\n・通常攻撃は、目の前の敵１キャラに邪牛神モー\n　モンの物理攻撃力とキャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n・最も魔法攻撃力の高い敵１キャラに物理割合\n　ダメージを与え、ノックバックさせると同時に\n　スタンさせる。\n・前から１番目と２番目のキャラに物理大ダメー\n　ジを与える。スキル発動後、自身の物理攻撃力\n　を大アップさせ、物理/魔法防御力が大ダウン。\n・残り時間が30秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314604, "邪牛神モーモン", 314600, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ１】力への渇望から魔物は子分を率\nい、再び略奪へ踏みだす。迫り来るならず者た\nちを打倒し、おせちの具材を守り抜け。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・邪牛神モーモンおよびハイオークから受けるす\n　べてのダメージで発生する、パーティキャラの\n　ＴＰ回復量を中ダウンさせる。\n・バトル開始時、ハイオークを３体召喚する。\n・ハイオークを１体倒すたびに、残りハイオーク\n　数が１減少する。その後、ハイオークが再度\n　召喚される。\n・目の前の敵１キャラに魔法小ダメージを与え、　物理防御力を大ダウンさせる。このスキルの状\n　態異常はダメージを無効化しても付与される。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314605, "邪牛神モーモン", 314605, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ２】猛牛の強靭な肉体が爆ぜる。\n怪腕から繰り出される殴打をまともに受けると\n肉体と、そこに宿る全ての煩悩をも吹き飛ばす。\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・邪牛神モーモンから受けるすべてのダメージで\n　発生する、パーティキャラのＴＰ回復量を中ダ\n　ウンさせる。\n・ユニオンバーストは、敵全体に邪牛神モーモン\n　の物理攻撃力とキャラの最大ＨＰに応じた\n　物理割合ダメージを与え、火傷状態にする。\n・通常攻撃は、目の前の敵１キャラに邪牛神モー\n　モンの物理攻撃力とキャラの最大ＨＰに応じた\n　物理割合ダメージを与える。\n・前から１番目と２番目のキャラに物理大ダメー\n　ジを与える。スキル発動後、自身の物理攻撃力\n　を大アップさせ、物理/魔法防御力が大ダウン。\n・敵全体のステータスアップ効果を解除し、一定\n　時間バトルフィールドを展開する。\n【バトルフィールド効果】\n・敵全体の物理攻撃力と魔法攻撃力を100％\n　ダウンした後、物理攻撃力と魔法攻撃力を極大\n　アップ。\n・邪牛神モーモンの物理攻撃力を100％ダウン\n　した後、物理攻撃力を極大アップ。");
INSERT OR IGNORE INTO `unit_enemy_data` VALUES (314606, "邪牛神モーモン", 314605, 0, 16, 270, 3000, 1, 1.6, 0, 0, 0, "【ＭＯＤＥ３】猛牛は痛手を負おうとも、鼻息\nを荒げ立ちはだかる。妄執に取りつかれた迷惑\nな魔物を打ち倒し、謹賀新年を取り戻せ！\n\n・バトル開始時、自身の物理防御力と魔法防御力\n　を小アップさせる。\n　この防御力アップ効果で上昇した防御力は、バ\n　トル中に受ける防御力ダウンスキルの影響を受\n　けない。\n・邪牛神モーモンから受けるすべてのダメージで\n　発生する、パーティキャラのＴＰ回復量を中ダ\n　ウンさせる。\n・ユニオンバーストは、敵全体に邪牛神モーモン\n　の物理攻撃力とキャラの最大ＨＰに応じた\n　物理割合ダメージを与え、火傷状態にする。\n・最も魔法攻撃力の高い敵１キャラに物理割合\n　ダメージを与え、ノックバックさせると同時に\n　スタンさせる。\n・前から１番目と２番目のキャラに物理大ダメー\n　ジを与える。スキル発動後、自身の物理攻撃力\n　を大アップさせ、物理/魔法防御力が大ダウン。\n・残り時間が30秒を切ると、さらに攻撃が激し\n　く凶暴になる。");
